(1047, 11, 'Your health really matters to us \r\n–\r\n that\r\n’\r\ns why we won\r\n’\r\nt just ask you to fill out some \r\nquestions and have a doctor send you an online prescription without speaki\r\nng to you (as \r\nsome other services do). We actually allow you to book a full con', '2017-11-22 15:54:55', '2017-11-22 15:54:55'),
