(1115, 28, '    A 2005 study of a telehealth medical evaluation prog\r\nram at five childcare centers \r\nfound that the program reduced children\r\n’\r\ns\r\n’\r\n absences due to illness by 63% and \r\navoided provider office or emergency room visits in ne\r\narly 94% of cases. ', '2017-11-22 16:50:34', '2017-11-22 16:50:34'),
(1116, 28, '    A study found that telemedicine resulted in the readm\r\nission rate being reduced from \r\n20% to 4% as well as a reduction in the length of sta\r\ny and overall costs.', '2017-11-22 16:50:34', '2017-11-22 16:50:34'),
