INSERT INTO `dod_blog` (`id`, `title`, `slug`, `category`, `date`, `postedby`, `image`, `description`, `status`, `meta_title`, `meta_keyword`, `meta_desc`, `created_at`, `updated_at`) VALUES
(15, 'Useful Tips to Help your Child Manage Stress and Anxiety', 'useful-tips-to-help-your-child-manage-stress-and-anxiety', 5, '2017-05-25', 'doctoroo', 'ee58ec4f34c2a8efeada8dc32ab71fa4082699de.png', '<p style="text-align: justify;"><strong>&ldquo;Life is not a bed of roses, it is full of thorns&rdquo;</strong></p>\r\n<p style="text-align: justify;">Make your children prepare for the life which is not just a bed of roses because it has thorns as well. You would have become their shield to protect them from the scorching heat, scratches and bitter experience that they would start facing once they step out of their comfort zone that you would create for them. Sometimes, inefficacy may lead to de-motivation which further causes the anxiety and stress.</p>\r\n<p style="text-align: justify;">Anxiety or stress is common in children like adults who would have too many commitments, conflicts in their relationships and work challenges. Over 10-20% school going children experience stress and anxiety due to several reasons. Even a large number of children experience psychological issues that don''t qualify as an anxiety disorder.</p>\r\n<p style="text-align: justify;">Being a concerned parent, it is your responsibility to help your kids manage stress and anxiety as you have gained enough experience in managing everyday challenges of life. Make your children prepare for a tough life &amp; complexities by encouraging them to follow the certain steps to take the anxiety on a serious note.</p>\r\n<p style="text-align: justify;"><strong>Encourage to face fears, not to run away:</strong> We have a tendency to run away or avoid our fears but it is even more challenging but better at the same time to face these fears. Help your child to face his fears as avoidance may encourage the anxiety-provoking situations.</p>\r\n<p style="text-align: justify;">Once you child will learn to handle the fears, he would learn to manage his stress which will not be remained for a long period.</p>\r\n<p style="text-align: justify;"><strong>It''s okay to be imperfect:</strong> Make your child understand that you won''t get bothered by his imperfections or failure. Tell him that sometimes, it''s okay being an average or below-average student. Motivate him to perform well in his area of expertise like sports or other extra-curricular activities. Encourage him to try and try harder every time he faces the failure.</p>\r\n<p style="text-align: justify;"><strong>Focus on Positives:</strong> It happens when an anxious or depressive child get lost in negative thoughts and that''s the time he should be encouraged to focus on the positive perspectives. Give him directions so that he can focus on the half-full glass instead of watching a half empty glass. Encourage him to focus on the future challenges or a good aspect of a situation.</p>\r\n<p style="text-align: justify;"><strong>Participate in Relaxing Activities:</strong> Children need time to play, relax and participate in the fun activities with their friends. Ensure that your child is wholeheartedly is participating in fun activities.</p>\r\n<p style="text-align: justify;"><strong>Model Approach Behavior with Self-care &amp; Positive Thinking:</strong> Your child will do everything you do so, face challenges, fear and keep a positive approach in mind because your child will copy you and behave how you often react or feel in a certain situation. If you take a good care of your child, your child will learn that self-care is important to face any conflict or difficult situation in life.</p>', 'Active', 'Useful Tips to Help your Child Manage Stress and Anxiety', 'Anxiety, Stress, Depressive Child ', 'Anxiety or stress is common in children like adults who would have too many commitments, conflicts in their relationships and work challenges.', '2017-07-14 07:14:53', '2017-07-14 07:14:53'),
(19, 'What are the Serious Consequences of Constipation?', 'what-are-the-serious-consequences-of-constipation', 17, '2017-05-25', 'doctoroo', '', '<p><strong>What are the symptoms of constipation?</strong></p>\r\n<p>Constipation refers to the difficulty in passing bowel motions. The motions of a person suffering from constipation are not normal and less frequent and the stools are difficult to pass from the body.</p>\r\n<p>This physical condition can be identified by a reduction in the frequency of bowel movements. It is believed that constipation arises without daily bowel movement. However, it is important to note that frequency of bowel movement differs between different people.</p>\r\n<p><strong>What Causes Constipation?</strong></p>\r\n<p>Bowel movement is the final stage of digestion. Food processing begins in the stomach and travels to the small intestine and then into the large intestine. Constipation occurs due to the indigestible residue of the ingested food, bacteria and water.</p>\r\n<p>Foods rich in fiber or roughage are very important for the human body and can prevent difficult digestion and any bowel movement obstruction. The muscles placed in the walls of the large intestine pushes contents entered in the body to move towards the rectum. Rich in fiber foods make it easier for these contents to move out of the body.</p>\r\n<p>In the colon, bulky feces stretch the walls of the colon triggering the peristaltic waves. These waves slow down through the colon and then may become drier and harder. A diet of high fiber will produce feces and retaining some water would be helpful to make them remain soft in the body.</p>\r\n<p>A person&rsquo;s diet is the main factor contributing to constipation. Even lower fluid intake, may lead to an increase in the amount of water being absorbed by the feces.</p>\r\n<p><strong>What complications occur due to Constipation?</strong></p>\r\n<p>A diet low in fiber may cause constipation which can be a serious issue. Long-term constipation with straining is one of the major reasons of the development of hemorrhoids. Hemorrhoids are very common in western countries whereas it appears less common in countries where high fiber diets are consumed.</p>\r\n<p>Overuse of laxatives may cause long term difficulties which may work by stimulating the bowel into action by improving bowel movements. The continuous use of medicine may affect muscles in the colon walls and can lead to nerve damage. Pronounced pain along with the bloating sensation of the abdomen may accompany constipation which results in the immediate need of a doctor.</p>\r\n<p><strong>Constipation Treatment</strong></p>\r\n<p><strong>Diet</strong>: Fiber is helpful in stimulating the bowel which is a simple and effective step in improving bowel motion. More people are consuming a large amount of fast food due to its convenience. These foods usually have low levels of fiber and do not include fresh fruit, vegetables or wholemeal breads which are helpful in regulating bowel movement. Also, fast foods do not contain important vitamins and trace elements which maintain a person&rsquo;s general health.</p>\r\n<p>Increasing water intake is also certainly helpful to ease constipation.</p>\r\n<p><strong>Exercise:</strong> Exercise stimulates the muscles in the colon which speed up the passage that stools pass and prevents people from becoming dehydrated. Exercise is healthy for the human body so one must spend an hour brisk walking, swimming or even spending some time with nature.</p>\r\n<p><strong>Treatments available for Constipation</strong></p>\r\n<p><strong>Laxatives:&nbsp;</strong>If attempting diet or exercise routine changes fail, laxatives may be beneficial for the human body to a certain extent. Several types of laxatives can help improve overall symptoms. The benefits of laxatives can be easily obtained as they consist of these ingredients:</p>\r\n<p><strong>Isapghula:</strong> This is a bulk-forming laxative which adds fiber to stools and increases their size which makes it easier to pass through the bowel. It is a mild and good option to consider as it can also be a safe option to use on a regular basis. It passes through the bowel without even being absorbed as bulk-forming laxatives are the best fiber supplements.</p>\r\n<p><strong>Lactulose:</strong> This is considered to be an osmotic laxative which works by holding more water in feces and making stools softer and easier to pass. People may start to experience the effects within 48 hours of use.</p>\r\n<p><strong>Senna &amp; Bisacodyl:</strong> These stimulant laxatives work by adding speed to muscular contractions in the bowel and work faster than bulk-forming and osmotic laxatives. They must be consumed before bed time to achieve bowel movement the next morning. These products are recommended to be taken only for a few days because over-use can reduce the muscle contractor of the gut. It may even make constipation worse.</p>\r\n<p><strong>Liquid Paraffin:</strong> This is classed as a lubricant laxative which works by softening the stool to make it easier to pass by avoiding the further absorption of liquids by the colon. Being oily in nature, some essential nutrients and vitamins are bound by it and prevent it from being absorbed by the body. If consumed by the lungs, it may cause pneumonia. This laxative is not recommended due the problems it may cause.</p>', 'Active', 'Symptoms of Constipation', 'Constipation, Constipation Consequences', 'Constipation refers to the difficulty in passing bowel motions. ', '2017-07-14 07:14:56', '2017-07-14 07:14:56'),
(21, 'Alcohol', 'alcohol', 16, '2017-05-25', 'doctoroo', '13cefe4c1a9b7bca978861edef82f9d025600500.jpg', '<p><strong>Alcohol consumption may be an enjoyment part of life</strong></p>\r\n<p>Alcohol consumption is an enjoyable part of the lives of many people and can be seen and served everywhere in society. It is considered to be a pleasant way to enjoy time with friends and simply relax. However, it is harmful if consumed in an excessive limit. Alcohol is addictive in nature, both physically and psychologically. Dependency may cause excess drinking which is dangerous and harmful for your health and overall well-being.</p>\r\n<p>Due to excess consumption of alcohol, you cannot operate efficiently when you stop taking it regularly. It is extremely harmful to your overall well-being and it may cause you to start suffering financially, socially and even affect your personal relationships. People stop realising that the consumption of alcohol might be damaging their personality and would compel them to misbehave with a sub-conscious mind.</p>\r\n<p><strong>The Risks of Excessive Consumption</strong></p>\r\n<p>Consumption of alcohol on a regular basis carries health risks including the risk of cancer of the mouth, throat, and breast. The amount of risk associated with alcohol consumption may depend upon how much you consume. The more you drink, the more you increase your chance of getting an alcohol related illness. Alcohol is one of the major contributors to early deaths due to injuries or diseases.</p>\r\n<p><strong>Levels of Risk</strong></p>\r\n<p><strong>Low Risk Drinking:</strong> This category defines the drinking style of those that prefer sensible drinking. An adult man or woman drinking 14 or less units in a week falls under this category. Most adults drink at this level, but this unit should not be consumed in one or two days. It should be consumed in three or more days to avoid any adverse effects on your health.</p>\r\n<p>People who are habitual of drinking excessively in one or two days in a week would increase the risk of long term illness, injury or accident. Pregnant women should definitely not consume alcohol.</p>\r\n<p><strong>Increased Drinking Risk:</strong> This is dangerous drinking category and relates to drinking 15-50 units a week. Drinking at this level seems to be very hazardous for women if they drink more than 35 units and for men, if they consume more than 50 units.</p>\r\n<p><strong>High Drinking Risk:</strong> This is an excessively harmful drinking level which relates to drinking more than 50 units in a week for men and 35 for women. Almost, 2-5% of men and women drink at this level. This level of drinking should definitely be reduced to avoid the risk of any long-term illnesses or any other hazardous effects.</p>\r\n<p><strong>The Illnesses it may cause&hellip;</strong></p>\r\n<p>Stroke<br />Diabetes<br />Heart Disease<br />Stoke<br />High Blood Pressure<br />Liver, breast, mouth, throat or bowel cancer<br />Acute Pancreatitis <br />Depression, anxiety and sleep disorders<br />Obesity<br />Liver Cirrhosis</p>\r\n<p>Many of these diseases will be diagnosed at the last stage of the illness and people may end this habit by losing their life.</p>\r\n<p>Alcohol consumption may increase your blood sugar level and you may start to experience sudden weight gain. With your weight increasing, you may start feeling high blood pressure due to the pressure being placed on your heart.</p>\r\n<p><strong>Seek Help Today</strong></p>\r\n<p>Drinking in an excessive amount is very dangerous and may turn into an addiction. It is important that you are informed about the risks associated with drinking, and the health problems it could lead to.</p>\r\n<p>You should be willing to control or improve your drinking habits. This is something that requires courage and commitment since limiting drinking habits may be a difficult process. You may consult with experts or approach family or friends for assistance.</p>\r\n<p>The team at doctoroo is here to provide confidential assistance if you need help with limiting your drinking habits today.</p>', 'Active', 'Alcohol', 'Alcohol', 'Alcohol', '2017-07-14 07:14:58', '2017-07-14 07:14:58'),
(22, 'Gastroenteritis (Gastro)', 'gastroenteritis-gastro', 5, '2017-06-27', 'doctoroo', '', '<p><strong>What is Gastroenteritis? (or Gastro)</strong></p>\r\n<p>Gastroenteritis, more commonly referred to as Gastro, is an infection that causes a lot of suffering to the patient during the few days that it is most active until it usually disappears. Some of the ways patients suffer from Gastro include:</p>\r\n<ul>\r\n<li>Diarrhoea</li>\r\n<li>Vomiting</li>\r\n<li>Abdominal (stomach) ache and pain</li>\r\n<li>Various other symptoms</li>\r\n</ul>\r\n<p>The various risks, causes, symptoms and treatment of gastroenteritis will be discussed in this article, which is only general knowledge about Gastro. For a specific analysis of your case and to receive a diagnosis and potential treatment, please seek appropriate medical care &ndash; which may include seeing a doctor online for non-emergencies. <a href="https://doctoroo.com.au">Seeing a doctor online</a> may be an appropriate course of action for mild symptoms and cases of gastro.</p>\r\n<p><strong>What is viral gastroenteritis</strong></p>\r\n<p>Many people ask what is gastro, or what is gastroenteritis, only to realise that it is a very familiar infection that they&rsquo;ve known but may be unfamiliar with. The gastro virus, or the gastro bug is simply an infection of your intestines. The meaning of Gastro varies depending on your symptoms, but ultimately, it&rsquo;s severity ranges from a slight stomach ache for 1-2 days with diarrhoea, to a lot of vomiting and diarrhoea for longer than a few days. The gastro virus or bug are actually caused by various types of viruses and bacteria which ultimately result in gastro or food poisoning.</p>\r\n<p><strong>What is the gastro virus or bug?</strong></p>\r\n<p>What is known as the gastro virus, is in fact the most typical source of gastroenteritis. These viruses quite simply spread across people via touch, where the bug is usually on the person&rsquo;s hand/s after visiting the bathroom. Since the gastro bug is on the person&rsquo;s hands, whatever they touch may also have the gastro virus and become infected with the bug. By the same transmission method of the gastro virus, if the person touches food during food preparation, the bug is then transmitted to the food (food poisoning), which can cause further transmission to other people. Due to the transmission routes which are commonly susceptible to many people&rsquo;s touch such as food poisoning, outbreaks can occur with bugs causing many people to get gastro, in close communities such as schools, universities, offices or hospitals.</p>\r\n<p><a href="https://doctoroo.com.au">BOOK &amp; SEE A DOCTOR ONLINE IN MINUTES</a></p>\r\n<p><strong>What is the meaning of gastro virus?</strong></p>\r\n<p>Gastro meaning differs between medical source, although a traditionally recognised meaning is the inflammation of the stomach lining, and both the small and large intestines. This gastro virus is very contagious and occurs commonly, causing millions of diarrhoea cases every year.</p>\r\n<p><strong>What are typical gastro symptoms?</strong></p>\r\n<p>Some signs of gastro or the symptoms of gastroenteritis are visible once the bug has entered the body. These symptoms usually show after food poisoning, which occurs once a person has consumed food which is infected with bugs that are known to cause gastroenteritis. These viruses and bugs will be discussed in more detail in this article.</p>\r\n<p>The main symptoms of gastro include diarrhoea and vomiting. The main gastro symptom, diarrhoea, is the watery faeces that occurs a few times within a one-day period. Although not common in gastroenteritis symptoms, diarrhoea may contain signs of mucus or blood. These gastroenteritis symptoms may be accompanied by the following signs of gastro:</p>\r\n<ul>\r\n<li>Stomach or abdomen aches and pains which feel like cramps. These cramp symptoms may reduce after the main symptom, diarrhoea, has passed.</li>\r\n<li>Fever, headache and limb pain are other gastroenteritis symptoms that don&rsquo;t commonly occur, but are still present in some cases</li>\r\n</ul>\r\n<p><a href="https://doctoroo.com.au">BOOK &amp; SEE A DOCTOR ONLINE FOR THESE MILD GASTRO SYMPTOMS</a></p>\r\n<p><strong>What to expect from the symptoms of gastro?</strong></p>\r\n<p>One of the major symptoms of gastro is vomiting &ndash; this usually occurs for about one day, but may last longer. Diarrhoea will usually last for about a few days longer than the vomiting, after which somewhat loose stools could occur for about 7 days until everything reverts back to normal.</p>\r\n<p>These two major symptoms of gastroenteritis, diarrhoea and vomiting, involve releasing a lot of bodily fluids, which could ultimately cause dehydration. For any case of suspected dehydration, we recommend that you consult a doctor immediately for advice. Slight dehydration is usually not a serious problem, where a large amount of fluid replenishment could revert the dehydration. In contrast, more serious dehydration could result is much more serious effects, including possibly death. We recommend that immediate, emergency care is seeked in this situation as your vital organs require fluids to properly continue to work. With a lack of hydration, some of the symptoms of gastro, and dehydration, include:</p>\r\n<ul>\r\n<li>Muscle cramping</li>\r\n<li>Light-headedness</li>\r\n<li>Tired feeling</li>\r\n<li>Dry mouth</li>\r\n<li>Fatigue</li>\r\n<li>Urine passing</li>\r\n</ul>\r\n<p>Other symptoms of gastro, and serious dehydration in adults may include:</p>\r\n<ul>\r\n<li>Confusion and potentially coma</li>\r\n<li>Increased heart rate</li>\r\n<li>Bodily fatigue</li>\r\n</ul>\r\n<p><a href="https://doctoroo.com.au">AN ONLINE DOCTOR CONSULTATION MAY BE OF HELP</a></p>\r\n<p><strong>Who does dehydration due to gastroenteritis most likely affect?</strong></p>\r\n<p>Dehydration as a result of gastro is more probably to affect:</p>\r\n<ul>\r\n<li>Adults</li>\r\n<li>Elderly</li>\r\n<li>Women who are pregnant</li>\r\n<li>Diarrhoea and/or vomiting persons, who aren&rsquo;t able to replenish the fluids lost</li>\r\n</ul>', 'Active', 'Gastroenteritis (Gastro) | Detailed information about this medical condition & recieve a diagnosis online for gastro', 'gastro, gastroenteritis, what is gastro, gastro virus, gastro bug, gastro symptoms, gastroenteritis symptoms, signs of gastro', 'This article about Gastro explains in details what gastroenteritis is, what are the symptoms and signs and how to recieve an online doctors consultation if you are suffering from mild gastro.', '2017-07-14 07:15:00', '2017-07-14 07:15:00'),
(23, 'Efficacy of Telehealth in Australia', 'efficacy-of-telehealth-in-australia', 17, '2017-12-20', 'doctoroo', '', '<p>Alexander, M. 1996. &ldquo;Telemedicine in Australia. 1: The Health Communication Network.&rdquo; <em>Journal Of Telemedicine And Telecare</em> 2. <a href="http://jtt.sagepub.com/content/1/4/187.full.pdf">http://jtt.sagepub.com/content/1/4/187.full.pdf</a>.</p>\r\n<p>Alexander, M. 1996. &ldquo;Telemedicine in Australia. 2: The Health Communication Network.&rdquo; <em>Journal Of Telemedicine And Telecare</em> 1. <a href="https://www.ncbi.nlm.nih.gov/pubmed/9375035">https://www.ncbi.nlm.nih.gov/pubmed/9375035</a>.</p>\r\n<p>Anonymous. 2010. &ldquo;The Potential of Telehealth in Australia.&rdquo; <em>PharmacoEconomics &amp; Outcomes News</em> (618): 10. <a href="http://trove.nla.gov.au/work/152879680?versionId=166613328">http://trove.nla.gov.au/work/152879680?versionId=166613328</a>.</p>\r\n<p>Armfield, Nigel R., Sisira K. Edirippulige, Natalie Bradford, and Anthony C. Smith. 2014. &ldquo;Telemedicine--Is the Cart Being Put before the Horse?&rdquo; <em>The Medical journal of Australia</em> 200(9): 530&ndash;33. <a href="https://www.mja.com.au/journal/2014/200/9/telemedicine-cart-being-put-horse">https://www.mja.com.au/journal/2014/200/9/telemedicine-cart-being-put-horse</a>.</p>\r\n<p>Benzion, Itay, and Eugene M. Helveston. 2007. &ldquo;Use of Telemedicine to Assist Ophthalmologists in Developing Countries for the Diagnosis and Management of Four Categories of Ophthalmic Pathology.&rdquo; <em>Clinical ophthalmology (Auckland, N.Z.)</em> 1(4): 489&ndash;95. <a href="https://www.ncbi.nlm.nih.gov/pmc/articles/PMC2704545/">https://www.ncbi.nlm.nih.gov/pmc/articles/PMC2704545/</a>.</p>\r\n<p>Berkhof, Farida F., Jan W. K. Van Den Berg, Steven M. Uil, and Huib A. M. Kerstjens. 2015. &ldquo;Telemedicine, the Effect of Nurse-Initiated Telephone Follow Up, on Health Status and Health-Care Utilization in COPD Patients: A Randomized Trial.&rdquo; <em>Respirology