erspective.&rdquo; <em>BMC Health Services Research</em> 16. <a href="http://bmchealthservres.biomedcentral.com/articles/10.1186/s12913-016-1401-y">http://bmchealthservres.biomedcentral.com/articles/10.1186/s12913-016-1401-y</a>.</p>\r\n<p>Della Mea, V. 1999. &ldquo;Internet Electronic Mail: A Tool for Low-Cost Telemedicine.&rdquo; <em>Journal of telemedicine and telecare</em> 5. <a href="http://jtt.sagepub.com/content/5/2/84.full.pdf">http://jtt.sagepub.com/content/5/2/84.full.pdf</a>.</p>\r\n<p>Doolan, D. 2013. &ldquo;A Telehealth Connection Service.&rdquo; <a href="http://www.hisa.org.au/slides/wed/DavidDoolan.pdf">http://www.hisa.org.au/slides/wed/DavidDoolan.pdf</a>.</p>\r\n<p>Eley, Robert et al. 2008. &ldquo;Nurses&rsquo; Confidence and Experience in Using Information Technology.&rdquo; <a href="https://core.ac.uk/display/11037222">https://core.ac.uk/display/11037222</a> (February 7, 2016).</p>\r\n<p>Eley, Robert et al. 2009. &ldquo;Attitudes of Australian Nurses to Information Technology in the Workplace: A National Survey.&rdquo; <a href="https://core.ac.uk/display/11036380">https://core.ac.uk/display/11036380</a> (February 9, 2016).</p>\r\n<p>Ellis, I. 2004. &ldquo;Is Telehealth the Right Tool for Remote Communities? Improving Health Status in Rural Australia.&rdquo; <em>Contemporary Nurse: A Journal for the Australian Nursing Profession</em> 16(3): 163&ndash;68. <a href="https://www.ncbi.nlm.nih.gov/pubmed/15125098">https://www.ncbi.nlm.nih.gov/pubmed/15125098</a>.</p>\r\n<p>Fatehi, F, NR Armfield, M Dimitrijevic, and LC Gray. 2014. &ldquo;Clinical Applications of Videoconferencing: A Scoping Review of the Literature for the Period 2002-2012.&rdquo; <em>Journal of Telemedicine and Telecare</em> 20(7): 377&ndash;83. <a href="https://www.ncbi.nlm.nih.gov/pubmed/25399998">https://www.ncbi.nlm.nih.gov/pubmed/25399998</a>.</p>\r\n<p>Garrett, Cc et al. 2011. &ldquo;Young Adults&rsquo; Views on Telemedicine Consultations for Sexual Health in Australia.&rdquo; <em