August 21, 2016).</p>\r\n<p>Yellowlees, P., and W. T. Mccoy. 1993. &ldquo;Telemedicine. A Health Care System to Help Australians.&rdquo; <em>The Medical journal of Australia</em> 159(7): 437&ndash;38. <a href="https://www.ncbi.nlm.nih.gov/pubmed/8412912">https://www.ncbi.nlm.nih.gov/pubmed/8412912</a>.</p>\r\n<p>Yellowlees, P., M. Chapman, and K. Fielke. 2013. &ldquo;Telehealth: Anywhere, Anytime, Achievements and Aspirations.&rdquo; <em>Australian And New Zealand Journal Of Psychiatry</em> 47(S1): 19&ndash;20. <a href="http://anp.sagepub.com/content/47/1_suppl.toc">http://anp.sagepub.com/content/47/1_suppl.toc</a>.</p>\r\n<p>Zilliacus, E, and B Meiser. 2010. &ldquo;The Virtual Consultation: Practitioners&rsquo; Experiences of Genetic Counseling by Videoconferencing in Australia.&rdquo; <em>Telemedicine journal and e-health?: the official journal of the American Telemedicine Association</em> 16(3): 350&ndash;57. <a href="https://www.ncbi.nlm.nih.gov/pubmed/20406122">https://www.ncbi.nlm.nih.gov/pubmed/20406122</a>.</p>\r\n<p>&nbsp;</p>', 'Active', 'Efficacy of Telehealth in Australia', 'Efficacy of Telehealth in Australia', 'Efficacy of Telehealth in Australia', '2017-12-22 13:25:33', '2017-12-22 18:55:35'),
(24, 'How to get the most out of your limited time with an Online Doctor.', 'how-to-get-the-most-out-of-your-limited-time-with-an-online-doctor-', 17, '2018-01-01', 'doctoroo', '', '<p>You consult a doctor when you are not in the best of your health, which means it is not expected of you to be much focused and concentrated clear communication is not possible for you. But this is the only time when you have to clearly explain to the doctor about the issues you are facing with your health. This also has to happen in a limited time of consultation so there are certain points that you can prepare for in advance to make the best use of the consultation time allotted to you. <a href="https://www.doctoroo.com.au/online-doctor-consultations" target="_blank" rel="noopener">Online doctor consultation</a> through Doctoroo have excellent track record of patient satisfaction in Australia. These points are valid for an <a href="https://www.doctoroo.com.au/online-doctor-consultations" target="_blank" rel="noopener">online doctor</a>&nbsp; as well.</p>\r\n<ul>\r\n<li>\r\n<p><strong>Gender</strong>:</p>\r\n</li>\r\n</ul>\r\n<p>A doctor whether it be a male or a female in the end is a doctor. You should not hesitate to share your issues with your doctor as sometimes a male doctor can be a gynecologist while a female doctor could be urologist. Just remember that a doctor is a trained professional and fir him or her you are just a patient in need of professional care.</p>\r\n<ul>\r\n<li>\r\n<p><strong>Make a note of important points beforehand.</strong></p>\r\n</li>\r\n</ul>\r\n<p>Considering your health condition it is possible that you might forget one or two important things you wanted to ask to the doctor so make a list of all of your question that cover everything.</p>\r\n<ul>\r\n<li>\r\n<p><strong>Be Honest and do not hesitate to ask</strong></p>\r\n</li>\r\n</ul>\r\n<p>You have to be completely honest with your doctor and tell them everything as lack of information may result in a poor diagnosis and treatment. Telling the doctor everything, even your past medical history will help them devise the best treatment plan and help you recover faster. If you have any doubts do not hesitate to ask the doctor. Your consultation entitles you to any and every question to be answered.</p>\r\n<p>Seeing a <a href="https://www.doctoroo.com.au/online-doctor-consultations" target="_blank" rel="noopener">Doctors online</a> can be quite intimidating as this process is relatively new but if you have a clear idea about what you are suppose to do and what you are suppose to get out of it will keep you stress free. Doctors at <a href="https://www.doctoroo.com.au/" target="_blank" rel="noopener">Doctoroo</a> are very open-minded and friendly in their demeanor who will attend to their patients with kindness and care. So before visiting a doctor online or in person just make sure of the above points and make the best of your time with them.</p>', 'Active', 'How to get the most out of your limited time with an Online Doctor.', 'book doctor online, doctor online australia, doctors online, online doctor, online doctor consultation, doctor consultation', 'You consult a doctor when you are not in the best of your health, which means it is not expected of you to be much focused and concentrated clear communication is not possible for you.', '2018-01-08 06:21:47', '2018-01-08 11:51:47'),
(25, 'Advantages of Online Doctor Consultation', 'advantages-of-online-doctor-consultation', 17, '2018-01-06', 'doctoroo', '', '<p>Online medical consultation also known as <a href="https://www.doctoroo.com.au/telemedicine" target="_blank" rel="noopener">Telehealth</a> or <a href="https://www.doctoroo.com.au/telemedicine" target="_blank" rel="noopener">Telemedicine</a> has in one way or the other become a boon to the needy populace. The need to travel long distances for basic healthcare is one of the reasons that is turning people to online doctor consultation. For the chronically ill patients, for those who want a follow-up examination, and for a periodical consultation, seeing a doctor online is like the best option as it is fast, efficient and cheaper.</p>\r\n<p>The first step for any ailment is to consult a doctor. Most of the <a href="https://www.doctoroo.com.au/online-doctor-consultations" target="_blank" rel="noopener">online doctor consultation</a> services have been conceived to help people discuss and consult a doctor from the comfort of home. The benefits of this facility are numerous. Anyone facing a health issue which is not an emergency can avail of this facility Doctoroo in Australia.</p>\r\n<p><strong>Benefits of Online Doctor Consultation</strong></p>\r\n<ul>\r\n<li>\r\n<p>Online doctor consultation providers give immediate response. The Medical Health Officer hears your complaint and responds to the situation. Please note that these services should not be called upon when immediate emergency attention is needed like in case of an accident or and heart attack</p>\r\n</li>\r\n<li>\r\n<p>There are no location boundaries for online doctor consultation. You can consult the doctor of your choice irrespective of his or your location, or the day or time</p>\r\n</li>\r\n<li>\r\n<p>At <a href="https://www.doctoroo.com.au" target="_blank" rel="noopener">Doctoroo</a>, one of the leading online consultation providers, doctors are available for online consultation 24&times;7. You don&rsquo;t have to wait for consultation days or hours. You can call them the moment you start feeling unwell.</p>\r\n</li>\r\n<li>\r\n<p>Virtual consultation is when you can see and talk to your doctor through video calls. You can talk to your doctor; hear his advice with a feeling of personal involvement.</p>\r\n</li>\r\n<li>\r\n<p>Economy is an important part of healthcare. With online consultation you are settled in your own comfort zone saving the travel expenses. Moreover, with all the services provided under one roof including online doctor consultation, diagnostics, and prescription of medication, it is certainly economical.</p>\r\n</li>\r\n<li>\r\n<p>Another major benefit of online consultation is that your medical history and records are stored online for easy future reference. You have access to investigation reports, primary care and even medicines at your home.</p>\r\n</li>\r\n<li>\r\n<p>With an online consultation, taking a second medical opinion would be very easy. By consulting a doctor who treats with a different approach, it is possible for a patient to get a second opinion in case the first consultation was a physical visit. You can also get a second opinion even if you&rsquo;re satisfied with your first doctor&rsquo;s advice, just to be on the safer side.</p>\r\n</li>\r\n</ul>\r\n<p>We technologies advancing and everything going mobile, having healthcare going mobile too is a great boon for places and regions where it is difficult to bring healthcare due to geographical and other reasons. The modern age is more pro health and if used right can help cure everyone no matter wherever they are.</p>', 'Active', 'Advantages of Online Doctor Consultation', 'Advantages of Online Doctor Consultation', 'Advantages of Online Doctor Consultation', '2018-01-08 06:29:30', '2018-01-08 11:59:31');
