(26, '5 ways to manage Heartburn during pregnancy', '5-ways-to-manage-heartburn-during-pregnancy', 17, '2018-01-16', 'doctoroo', '', '<p class="western" style="margin-bottom: 0.35cm; line-height: 115%;" align="justify"><span style="font-size: medium;">Heartburn is very common during pregnancy and statistics show more than 50% of women get heartburns during pregnancy. Heartburn mostly is common in women who are in the second or third trimester of pregnancy. It is advisable not to try any unsafe method to try to cure it as this might affect your baby&rsquo;s health. Consulting an <a href="https://www.doctoroo.com.au/online-doctor-consultations" target="_blank" rel="noopener">online doctor</a> will be a fast way for curing heartburn and provide relief sooner. Let&rsquo;s have a look at some safe ways that you can try out to cure or prevent heartburns. </span></p>\r\n<p class="western" style="margin-bottom: 0.35cm; line-height: 115%;" align="justify"><span style="font-size: medium;"><strong>Eat smaller meals</strong></span></p>\r\n<p class="western" style="margin-bottom: 0.35cm; line-height: 115%;" align="justify"><span style="font-size: medium;">If you are suffering for morning sickness eating less might not be a problem for you. If you have a good appetite, stuffing yourself to brim will cause you heartburn, pregnancy or no pregnancy. So avoid over eating and divide your 3 square meals into 5-6 smaller meals.</span></p>\r\n<p class="western" style="margin-bottom: 0.35cm; line-height: 115%;" align="justify"><span style="font-size: medium;"><strong>Go slow</strong></span></p>\r\n<p class="western" style="margin-bottom: 0.35cm; line-height: 115%;" align="justify"><span style="font-size: medium;">When you are eating take smaller portions to chew and chew well before swallowing. Eating too fast and stuffing yourself leads to heartburn as well. </span></p>\r\n<p class="western" style="margin-bottom: 0.35cm; line-height: 115%;" align="justify"><span style="font-size: medium;"><strong>Avoid spicy foods</strong></span></p>\r\n<p class="western" style="margin-bottom: 0.35cm; line-height: 115%;" align="justify"><span style="font-size: medium;">Esophageal sphincter is a muscle in your digestive tract that tends to get relaxed by spicy food. This relaxation increases the chances of heartburns. Friend or other loaded foods do the same.</span></p>\r\n<p class="western" style="margin-bottom: 0.35cm; line-height: 115%;" align="justify"><span style="font-size: medium;"><strong>Stay hydrated </strong></span></p>\r\n<p class="western" style="margin-bottom: 0.35cm; line-height: 115%;" align="justify"><span style="font-size: medium;">It has been proven that drinking while eating causes acid reflux very often. Heartburn itself is usually caused by an acid reflux from the stomach. Rather than drinking a big glass of milk with dinner, you may be better off just sipping liquids during meals. Try to get most of your fluid intake by drinking beverages between, rather than during, meals.</span></p>\r\n<p class="western" style="margin-bottom: 0.35cm; line-height: 115%;" align="justify"><span style="font-size: medium;"><strong>Keep Head and upper Chest elevated while sleeping.</strong></span></p>\r\n<p class="western" style="margin-bottom: 0.35cm; line-height: 115%;" align="justify"><span style="font-size: medium;">Heartburn is caused when the food you ate comes back as an acid reflux when you are horizontally inclined on your bed. Place your head at a higher level by using pillows for preventing heartburns.</span></p>\r\n<p class="western" style="margin-bottom: 0.35cm; line-height: 115%;" align="justify"><span style="font-size: medium;"><strong>Consider antacids</strong></span></p>\r\n<p class="western" style="margin-bottom: 0.35cm; line-height: 115%;" align="justify"><span style="font-size: medium;">If any of the above lifestyle changes are not helping antacids containing calcium or magnesium are safe to consume during pregnancies. Try avoiding antacids with aluminum in it as this might cause constipation or even be toxic at high dosage. If none of the above help consider an opinion from an&nbsp; <a href="https://www.doctoroo.com.au/online-doctors-certificate" target="_blank" rel="noopener">online doctor</a> for fast recovery.</span></p>', 'Active', '5 ways to manage Heartburn during pregnancy', '5 ways to manage Heartburn during pregnancy', '5 ways to manage Heartburn during pregnancy', '2018-01-16 10:00:48', '2018-01-16 10:00:48');
