INSERT INTO `dod_dynamic_pages` (`id`, `page_name`, `page_slug`, `page_title`, `page_desc`, `meta_keyword`, `meta_title`, `meta_desc`, `page_status`, `created_at`, `updated_at`) VALUES
(12, 'About-Us', 'about-us', 'About Us', '<p>For over 28 years, we have conducted an extensive physician survey to identify the doctors that other doctors trust most. It is the largest ongoing, peer survey in the medical industry.</p>\n<p>As a result, we have a proprietary database of more than 50,000 medical experts in over 450 specialties and subspecialties worldwide. Our mission is to engage patients and physicians to work together to improve outcomes.</p>', 'About Us', 'About Us', 'About Us', 'Active', '2017-02-23 01:42:41', '2017-07-19 10:13:18'),
(13, 'Team', 'team', 'Team', '<p>The team may also include doctors from other areas of medicine. For example, a dermatologist specializes in skin problems and may help treat skin cancer. Learn more about&nbsp;<a href="http://www.cancer.net/node/24957">the oncology team</a>.</p>\r\n<p>If a person&rsquo;s cancer diagnosis is complex, the patient&rsquo;s oncologist may ask a tumor board to review the case. A tumor board consists of medical experts from all relevant areas who help decide the best course of treatment.</p>', 'Team', 'Team', 'Team', 'Active', '2017-02-23 03:22:01', '2017-02-23 19:52:42'),
(14, 'Careers', 'careers', 'Careers', '<p>If you&rsquo;re passionate about doing what&rsquo;s right for patients and physicians, we&rsquo;re the right organization for you. We&rsquo;re looking for team players who are driven by the pursuit of excellence and committed to making a difference in health care.</p>\r\n<p>We provide over 40&nbsp;million global members with access to the best medical minds in the world. Drawing on a network of over 53,000 Best Doctors, we review medical cases to ensure our members have the right diagnoses and treatment plans.</p>\r\n<p>Our culture is dynamic and creative, with a focus on commitment, quality, and collaboration. If you&rsquo;re interested in a career where you can improve health care around the world, we invite you to view our current openings and apply to Best Doctors today.</p>\r\n<p></p>', 'Careers', 'Careers', 'Careers', 'Active', '2017-02-23 03:23:55', '2017-02-23 20:17:18'),
(15, ' Press ', 'press', ' Press ', '<p>&nbsp;Press&nbsp;</p>', ' Press ', ' Press ', ' Press ', 'Active', '2017-02-23 03:24:37', '2017-02-23 18:18:31'),
(16, ' Privacy Policy', 'privacy-policy', ' Privacy Policy', '<div class="terms-condi-main-block">\r\n<div class="content-head-main"></div>\r\n<div class="content-head-para"><span>This Privacy Policy sets out the commitment of Doctoroo Australia Pty Ltd, ABN 15616602629, its successors and assignees (referred to as <span class="head-para-bold">we, us</span> and <span class="head-para-bold">our</span>) to protecting the privacy of your personal information that we collect through this website <span class="conte-link"><a href="https://doctoroo.com.au" target="_blank" rel="noopener">https://doctoroo.com.au</a></span> (<span class="head-para-bold">Site</span>), when available the Doctoroo Australia mobile application (<span class="head-para-bold">App</span>) or directly from you, being the person, organisation or entity that uses our Site or App (referred to as <span class="head-para-bold">you</span> or <span class="head-para-bold">your</span>).</span></div>\r\n<div class="content-head-para"><span>Please read this Privacy Policy carefully. By providing personal information to us, you consent to our collection, holding, use and disclosure of your personal information in accordance with this Privacy Policy. Please contact us if you have questions, our contact details are at the end of this Privacy Policy.</span></div>\r\n<div class="content-head-para"><span>If you do not wish to provide personal information to us, then you do not have to do so, however it may affect your use of this Site, App or products and services offered on or through it.</span></div>\r\n<div class="content-head">1. &nbsp; Collection of personal information</div>\r\n<div class="content-head-para"><span><span class="head-para-bold">Personal information:</span> The type of information we collect from you or from third parties, may include: </span></div>\r\n<div class="butets-lists bold">\r\n<ul>\r\n<li><span><i class="fa fa-circle"></i></span>name;</li>\r\n<li><span><i class="fa fa-circle"></i></span> images;</li>\r\n<li><span><i class="fa fa-circle"></i></span> contact details including email address, mailing or street address and telephone number;</li>\r\n<li><span><i class="fa fa-circle"></i></span> identification papers;</li>\r\n<li><span><i class="fa fa-circle"></i></span> age or date of birth;</li>\r\n<li><span><i class="fa fa-circle"></i></span> health information including sensitive information set out in clause 4;</li>\r\n<li><span><i class="fa fa-circle"></i></span> names and details, including health information, of your family members;</li>\r\n<li><span><i class="fa fa-circle"></i></span> credit card information;</li>\r\n<li><span><i class="fa fa-circle"></i></span> insurance certificates and confirmations for healthcare providers;</li>\r\n<li><span><i class="fa fa-circle"></i></span> demographic information such as postcode;</li>\r\n<li><span><i class="fa fa-circle"></i></span> information you provide to us through surveys;</li>\r\n<li><span><i class="fa fa-circle"></i></span> details of products and services we have provided to you or that you have enquired about, and our response;</li>\r\n<li><span><i class="fa fa-circle"></i></span> your browser session and geo-location data, device and network information, statistics on page views and sessions, acquisition sources, search queries and browsing behaviour;</li>\r\n<li><span><i class="fa fa-circle"></i></span> additional personal information that you provide to us directly or indirectly through your use of our Site or App, associated applications, associated social media platforms or accounts from which you permit us to collect information;</li>\r\n<li><span><i class="fa fa-circle"></i></span> sensitive information as set out in clause 4 below; and</li>\r\n<li><span><i class="fa fa-circle"></i></span> any other information requested by us and/or provided by you.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head-para"><span><span class="head-para-bold">Your use of our Site or App:</span> As with most online businesses, we may log information about your access and use of our Site or App, including through the use of Internet cookies, your communications with our Site or App, the type of browser you are using, the type of operating system you are using and the domain name of your Internet service provider.&nbsp;</span></div>\r\n<div class="content-head-para"><span><span class="head-para-bold">Your opinion and feedback:</span> We may contact you to voluntarily respond to questionnaires, surveys or market research to seek your opinion and feedback. Providing this information is optional to you. </span></div>\r\n<div class="content-head-para"><span>If we receive your personal information from third parties, we will protect it as set out in this Privacy Policy.</span></div>\r\n<div class="content-head">2. &nbsp; Collection and use of personal information</div>\r\n<div class="content-head-para"><span>We collect and use the information for purposes including:</span></div>\r\n<div class="butets-lists bold">\r\n<ul>\r\n<li><span><i class="fa fa-circle"></i></span>to enable you to access and use our Site or App and any associated applications and associated social media platforms;</li>\r\n<li><span><i class="fa fa-circle"></i></span>to contact and communicate with you;</li>\r\n<li><span><i class="fa fa-circle"></i></span>for internal record keeping;</li>\r\n<li><span><i class="fa fa-circle"></i></span>for analytics, market research and business development including to operate and improve our Site, App and any associated applications and associated social media platforms;</li>\r\n<li><span><i class="fa fa-circle"></i></span>to run competitions or offer additional benefits to you; and</li>\r\n<li><span><i class="fa fa-circle"></i></span>for advertising and marketing, including to send you promotional information about our products and services and information and about third parties that we consider may be of interest to you.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head-para"><span>You may opt-out of receiving marketing materials from us by contacting us using the details set out below or by using the opt-out facilities provided in the marketing materials.</span></div>\r\n<div class="content-head">3. &nbsp; Disclosure of personal information to third parties</div>\r\n<div class="content-head-para"><span>We may disclose personal information to:</span></div>\r\n<div class="butets-lists bold">\r\n<ul>\r\n<li><span><i class="fa fa-circle"></i></span>healthcare providers, doctors, pharmacies and other third parties on the Site who are required to perform the services you have requested;</li>\r\n<li><span><i class="fa fa-circle"></i></span>credit reporting agencies and courts, tribunals and regulatory authorities where you fail to pay for goods or services provided to you;</li>\r\n<li><span><i class="fa fa-circle"></i></span>courts, tribunals, regulatory authorities and law enforcement officers as required by law, in connection with any actual or prospective legal proceedings, or in order to establish, exercise or defend our legal rights;</li>\r\n<li><span><i class="fa fa-circle"></i></span>third parties, including agents or sub-contractors, who assist us in providing information, products, services or direct marketing to you. This may include parties located, or that store data, outside of Australia; and</li>\r\n<li><span><i class="fa fa-circle"></i></span>third parties to collect and process data such as Google Analytics or other relevant businesses. This may include parties that store data outside of Australia.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head-para"><span>Where we disclose your personal information to third parties for these purposes, we will request that the third party follow this Privacy Policy regarding handling of your personal information</span></div>\r\n<div class="content-head-para"><span>These third parties may also store a copy of your personal information for record keeping and backup purposes such as in a file deposit, in a software or via other means.</span></div>\r\n<div class="content-head-para"><span>Such entities generally include:</span></div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>third party service providers for the purpose of enabling them to provide a service such as (but not limited to) IT service providers, data storage, web-hosting and server providers, debt collectors, maintenance or problem-solving providers; marketing or advertising providers;</li>\r\n<li>any applicable or relevant regulator or third party for the purpose of legislative or contractual compliance and/or reporting;</li>\r\n<li>any related entities of ours; or</li>\r\n<li>other entities if you have given express consent.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head-para"><span>From time to time, these parties may reside outside Australia. Our contracts with these parties generally include an obligation for them to comply with Australian privacy law. However, you acknowledge that, by agreeing to the disclosure of personal information to these entities outside of Australia, we will no longer be required to take reasonable steps to ensure the overseas recipient''s compliance with the Australian privacy law in relation to personal information and we will not be liable to you for any breach of the Australian privacy law by these overseas recipients. On this basis, you consent to such disclosure. </span></div>\r\n<div class="content-head-para"><span>If there is a change of control of our business or a sale or transfer of business assets, we reserve the right to transfer our user databases, together with any personal information and non-personal information contained in those databases, to the extent permissible by law. This information may be disclosed to a potential purchaser. We would seek to only disclose information in good faith. </span></div>\r\n<div class="content-head">4. &nbsp; How we treat personal information that is also sensitive information</div>\r\n<div class="content-head-para"><span>Sensitive information is a sub-set of personal information that is given a higher level of protection under the Australian Privacy Principles. In referring to &lsquo;sensitive information&rsquo; we mean information that relates to your racial or ethnic origin, political opinions, religion, trade union or other professional associations or memberships, philosophical beliefs, sexual orientation or practices and criminal records, health information or biometric information. </span></div>\r\n<div class="content-head-para"><span>The types of sensitive information that we may collect include health and medical information such as:</span></div>\r\n<div class="butets-lists bold">\r\n<ul>\r\n<li><span><i class="fa fa-circle"></i></span>where medication is ordered, Medicare, DVA and Safety Net Concession numbers;</li>\r\n<li><span><i class="fa fa-circle"></i></span>healthcare identifiers;</li>\r\n<li><span><i class="fa fa-circle"></i></span>patient medical history;</li>\r\n<li><span><i class="fa fa-circle"></i></span>medications, allergies, adverse events, immunisations, social history, family history and risk factors;</li>\r\n<li><span><i class="fa fa-circle"></i></span>current symptoms and conditions;</li>\r\n<li><span><i class="fa fa-circle"></i></span>photographs of the affected areas;</li>\r\n<li><span><i class="fa fa-circle"></i></span>consultation summaries from doctors;</li>\r\n<li><span><i class="fa fa-circle"></i></span>medical certificates, prescriptions, referrals and other documents;</li>\r\n<li><span><i class="fa fa-circle"></i></span>information on sexual practices; and</li>\r\n<li><span><i class="fa fa-circle"></i></span>in the case of healthcare providers including doctors, membership of certain professional associations or memberships.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head-para"><span>Sensitive information about you is only collected with your consent. By using the services available on the Site, you have expressly given us your consent to collect the relevant personal and sensitive information required to provide the services you have requested.</span></div>\r\n<div class="content-head-para"><span>In the event that you have provided your consent, sensitive information will be only be used and disclosed for purposes relating to the primary purpose for which the sensitive information was collected, including:</span></div>\r\n<div class="butets-lists bold">\r\n<ul>\r\n<li><span><i class="fa fa-circle"></i></span>providing medical or health services as well as providing all features and services offered by the Site;</li>\r\n<li><span><i class="fa fa-circle"></i></span>providing services for a purpose that is directly related to the primary purpose for which the sensitive information was collected;</li>\r\n<li><span><i class="fa fa-circle"></i></span>data analytics purposes; and/or</li>\r\n<li><span><i class="fa fa-circle"></i></span>referring you to medical or health service providers in circumstances where it is impractical for us to obtain your consent.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head-para"><span>Sensitive information may also be used or disclosed if required or authorised by law. </span></div>\r\n<div class="content-head">5. &nbsp; Your rights and controlling your personal information</div>\r\n<div class="content-head-para"><span><span class="head-para-bold">Choice and consent:</span> Providing us with your personal information is optional to you. You can choose not to provide personal information. When you provide us with your personal information, you consent to the terms in this Privacy Policy, and to us disclosing or receiving your personal information for these purposes.&nbsp;</span></div>\r\n<div class="content-head-para"><span><span class="head-para-bold">Your provision of third party information:</span> If you provide us with third party personal information then you warrant to us that you have the third party&rsquo;s consent to provide this.</span></div>\r\n<div class="content-head-para"><span><span class="head-para-bold">Restrict:</span> You may choose to restrict the collection or use of your personal information. If you have previously agreed to us using your personal information for direct marketing purposes, you may change your mind at any time by contacting us at the email address listed in this Privacy Policy. </span></div>\r\n<div class="content-head-para"><span><span class="head-para-bold">Access:</span> You may request details of personal information that we hold about you, in certain circumstances set out in the <span class="head-para-bold itlic">Privacy Act 1988</span> (Cth) (<span class="head-para-bold">Privacy Act</span> ). An administrative fee may be payable for the provision of information. We may refuse to provide you with information that we hold about you, in certain circumstances set out in the Privacy Act. </span></div>\r\n<div class="content-head-para"><span><span class="head-para-bold">Correction:</span> If you believe that any information we hold about you is inaccurate, out of date, incomplete, irrelevant or misleading, please contact us by email or update the relevant information through your account. We rely in part upon customers advising us when their personal information changes. We will respond to any request within a reasonable time. We will endeavour to promptly correct any information found to be inaccurate, incomplete or out of date.</span></div>\r\n<div class="content-head-para"><span><span class="head-para-bold">Complaints:</span> If you believe that we have breached the Australian Privacy Principles and wish to make a complaint about that breach, please contact us by email setting out details of the breach. We will promptly investigate your complaint and respond to you in writing setting out the outcome of our investigation, what steps we propose to take to remedy the breach and any other action we will take to deal with your complaint.</span></div>\r\n<div class="content-head-para"><span><span class="head-para-bold">Unsubscribe:</span> To unsubscribe from our e-mail database, or opt out of communications, please contact us using the details below.</span></div>\r\n<div class="content-head">6. &nbsp; Storage and Security</div>\r\n<div class="content-head-para"><span>We are committed to ensuring that the information you provide is secure. In order to prevent unauthorised access or disclosure, we have put in place suitable physical, electronic and managerial procedures to safeguard and secure the information and protect it from misuse, interference, loss and unauthorised access, modification and disclosure.</span></div>\r\n<div class="content-head-para"><span>No information transmitted over the Internet can be guaranteed to be secure. We cannot guarantee the security of any information that you transmit to us, or receive from us. The transmission and exchange of information is carried out at your own risk. Although we take measures to safeguard against unauthorised disclosures of information, we cannot assure you that personal information that we collect will not be disclosed in a manner that is inconsistent with this Privacy Policy.</span></div>\r\n<div class="content-head">7. &nbsp; Cookies &amp; Web Beacons</div>\r\n<div class="content-head-para"><span>We may use cookies on this Site or App from time to time. Cookies are text files placed in your computer''s browser to store your preferences. Cookies, by themselves, do not tell us your e-mail address or other personally identifiable information. However, they do allow third parties such as Google and Facebook to cause our advertisements to appear on your social media and online media feeds as part of our retargeting campaigns.&nbsp;If and when&nbsp;you choose to provide the Site or App with personal information, this information may be linked to the data stored in the cookie.</span></div>\r\n<div class="content-head-para"><span>We may use web beacons on this Site or App from time to time. Web beacons or clear.gifs are small pieces of code placed on a web page to monitor the visitors&rsquo; behaviour and collect data about the visitors viewing a web page. For example, web beacons can be used to count the users who visit a web page or to deliver a cookie to the browser of a visitor viewing that page. </span></div>\r\n<div class="content-head-para"><span>We may use Google Analytics to collect and process data. To find out how Google uses data when you use third party websites or applications, please see <span class="conte-link"><a href="https://www.google.com/policies/privacy/partners/" target="_blank" rel="noopener">www.google.com/policies/privacy/partners/</a></span> or any other URL Google may use from time to </span></div>\r\n<div class="content-head">8. &nbsp; Links to other websites</div>\r\n<div class="content-head-para"><span>Our Site or App may contain links to other websites of interest. We do not have any control over those websites. We are not responsible for or liable for the protection and privacy of any information which you provide whilst visiting such websites, and such websites are not governed by this Privacy Policy. </span></div>\r\n<div class="content-head">9. &nbsp; Amendments</div>\r\n<div class="content-head-para"><span>This Privacy Policy may be amended, including with changes, additions and deletions, from time to time in our sole discretion. Your continued use of our Site or App following any amendments indicates that you accept the amendments. You should check this Privacy Policy regularly, prior to providing personal information, to ensure you are aware of any changes, and only proceed to provide personal information if you accept the new Privacy Policy.</span></div>\r\n<div class="address-block">\r\n<div class="content-head">For any questions or notice, please contact our Privacy Officer at:</div>\r\n<div class="address-text"><span>Doctoroo Australia Pty Ltd ABN 15616602629</span> <span>Level 13/50 Carrington Street</span> <span>Sydney 2000, New South Wales</span> <span>Australia</span> <span>wecare@doctoroo.com.au</span>\r\n<div class="address-text bottom"><span><span class="address-te-bold">Last update:</span> August 2017</span></div>\r\n</div>\r\n</div>\r\n</div>', ' Privacy Policy', ' Privacy Policy', ' Privacy Policy', 'Active', '2017-02-23 03:25:03', '2017-12-21 12:28:59'),
(20, 'What-We-Do', 'what-we-do', 'What We Do', '<p><span>When you&rsquo;re facing a critical medical decision &ndash; whether an important health question or a serious diagnosis &ndash; getting it right is everything. We make it happen. Best Doctors connects you to more than 50,000 world-renowned medical experts. </span></p>\r\n<p><span>As a result, you&rsquo;re sure you have the right information, the right diagnosis and the right treatment. We can help with everything from minor surgery to major issues like cancer and heart disease. You don&rsquo;t need to travel, visit doctors&rsquo; offices or chase medical records. No matter where you live or work, you benefit from the world&rsquo;s best medical minds.</span></p>', 'What We Do', 'What We Do', 'What We Do', 'Active', '2017-02-23 17:31:21', '2017-04-10 22:24:49'),
(21, 'Companies - and - Organisations', 'companies-and-organisations', 'Companies  & Organisations', '<p><span>As the leader in expert medical review and advisory services, we have partnered with hundreds of companies, ensuring that our members have access to the very best. Members have immediate access to our database of more than 50,000 expert physicians in over 450 specialties and subspecialties. As a result, employees make better informed health care decisions while your company decreases its medical costs.</span></p>\r\n<p><span>Organizations that provide life insurance, supplemental coverage and other financial services partner with Best Doctors to deliver unique policy holder benefits. Globally, a variety of companies offer our expert medical advisory services to groups and plan members as a convenient way to add value and differentiate their offerings.</span></p>', 'Companies  & Organisations', 'Companies  & Organisations', 'Companies  & Organisations', 'Active', '2017-02-23 17:44:16', '2017-02-23 20:26:28');
INSERT INTO `dod_dynamic_pages` (`id`, `page_name`, `page_slug`, `page_title`, `page_desc`, `meta_keyword`, `meta_title`, `meta_desc`, `page_status`, `created_at`, `updated_at`) VALUES
(22, 'Patient-Marketplace-Terms-and-Condition', 'terms-and-condition', 'Patient Marketplace Terms & Condition', '<div class="terms-condi-main-block">\r\n<div class="content-head-main"></div>\r\n<div class="content-head-main no-bor">If you are experiencing a medical emergency immediatety dial 000.</div>\r\n<div class="content-head-main no-bor">Do not book or see a doctor on the application if:</div>\r\n<div class="content-head upper">You have or think you may have an emergency or critical condition or symptom, including, but in no way limited to:</div>\r\n<div class="butets-lists bold">\r\n<ul>\r\n<li><span><i class="fa fa-circle"></i></span>Severe chest pain</li>\r\n<li><span><i class="fa fa-circle"></i></span>Heart attack</li>\r\n<li><span><i class="fa fa-circle"></i></span>Stroke</li>\r\n<li><span><i class="fa fa-circle"></i></span>Loss of consciousness</li>\r\n<li><span><i class="fa fa-circle"></i></span>Severe bleeding</li>\r\n<li><span><i class="fa fa-circle"></i></span>Breathing difficulty</li>\r\n</ul>\r\n</div>\r\n<div class="content-head upper">You have or think you may have a condition or symptom which you don&rsquo;t believe or doubt can be diagnosed or treated via an online telehealth consultation.</div>\r\n<div class="content-head-main no-bor">IF YOU ARE IN DOUBT ABOUT THE SERIOUSNESS OF YOUR CONDITION, THE APPROPRIATENESS OR EFFECTIVENESS OF AN ONLINE CONSULTATION OR BELIEVE THAT YOU, OR ANYONE IS IN AN URGENT, DANGEROUS OR EMERGENCY SITUATION, YOU SHOULD NOT USE DOCTOROO AND INSTEAD CONTACT 000 IMMEDIATELY OR SEEK ALTERNATIVE AND APPROPRIATE MEDICAL SERVICES. DOCTOROO IS IN NO WAY A REPLACEMENT FOR YOUR REGULAR GP OR HEALTHCARE PROVIDER. SHOULD YOUR SYMPTOM/S OR CONDITION DEGRADE, YOU AGREE TO CONTACT YOUR REGULAR GP IMMEDIATELY OR SEEK OTHER, APPROPRIATE AND IMMEDIATE HEALTHCARE ADVICE, OPINION AND/OR TREATMENT.</div>\r\n<div class="content-head-para"><span>Doctoroo Australia Pty Ltd ABN 15616602629 (referred to as <span class="head-para-bold">Doctoroo</span>) provides a telemedicine and medication management platform available on <span class="conte-link"><a>https://doctoroo.com.au</a></span> (<span class="head-para-bold">Site</span>) and via the Doctoroo mobile applications (<span class="head-para-bold">App</span>) (collectively the <span class="head-para-bold">Services</span>). The platform connects patients (<span class="head-para-bold">Patients</span>) with doctors and other health care professionals (<span class="head-para-bold">Healthcare Providers</span>) and pharmacies (<span class="head-para-bold">Pharmacies</span>) and allows Patients to access medical services including to:</span></div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>make bookings and then to consult with a Healthcare Provider on their mobile device or computer;</li>\r\n<li>obtain prescriptions, medical certificates and referrals from a Healthcare Provider;</li>\r\n<li>order medication and repeat prescriptions from Pharmacies to be collected by or delivered to the Patient;</li>\r\n<li>consult with a Healthcare Provider via a mobile medical clinic located in a Pharmacy; and</li>\r\n<li>ask health questions to Healthcare Providers and schedule medication reminders.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head-para"><span>ask health questions to Healthcare Providers and schedule medication reminders. Patients, Healthcare Providers and Pharmacies and other users of the Site are<span class="head-para-bold">Users.</span></span></div>\r\n<div class="content-head">1. &nbsp; Contract</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>These Terms and Conditions (\r\n<div class="li-bold">Terms</div>\r\n) form a binding legal agreement between Doctoroo and each Healthcare Provider using the Site, App and Services. By accessing and using the Site, the App and the Services, each Healthcare Provider agrees to comply with and be legally bound by these Terms. Please read the Terms carefully. If there are any questions, please contact Doctoroo using the contact details at the end of these Terms.</li>\r\n<li>The Patient&rsquo;s use of the Site, the App and the Services indicates that the Patient:\r\n<div class="butets-lists inner">\r\n<ol class="upp-roman">\r\n<li>has had sufficient opportunity to access the Terms and contact Doctoroo;</li>\r\n<li>has read, accepted and will comply with the Terms;</li>\r\n<li>is 18 years or older or, if younger than 18 years, the Patient must request their parent or guardian to create an account in the parent or guardian&rsquo;s name and register the minor as a &ldquo;Family member&rdquo;. These Terms will be binding on the registered parent or guardian and they accept responsibility for all activity on their Account. A minor must not use the Services without the approval and presence of the registered parent or guardian account holder.&nbsp;</li>\r\n<li class="margi-li">If this is not correct, or if the Patient does not agree to these Terms, the Patient is not permitted to use any of the Services.</li>\r\n</ol>\r\n</div>\r\n</li>\r\n<li>Doctoroo may amend these Terms at any time without notice. Use of our Services following any such amendments will be deemed to be confirmation that the Healthcare Provider accepts those amendments. Doctoroo recommends that each Healthcare Provider check the current Terms, before continuing use of the Services. Only Doctoroo&rsquo;s authorised agents, employees and third parties have authority to change the Terms</li>\r\n<li>These Terms supplement and incorporate:\r\n<div class="butets-lists inner">\r\n<ol class="upp-roman">\r\n<li>the Doctoroo Website Terms of Use and Privacy Policy posted on the Site;</li>\r\n<li>the Stripe Australia Terms of Service including, without limitation, the Stripe Services Agreement;</li>\r\n<li>the Apple, Inc. Terms and Conditions including, without limitation, the Licensed Application End User License Agreement provided therein;</li>\r\n<li>the Android, Google Inc. Terms and Conditions including, without limitation, the License Agreement and Terms of Application;</li>\r\n<li>the Delivery Click &amp; Collect Terms and Conditions;</li>\r\n<li>all terms and conditions and privacy policies of all API&rsquo;s and third party software that are integrated into or within the Site or App or in any way used to provide our Services to you.</li>\r\n</ol>\r\n</div>\r\n</li>\r\n<li>Doctoroo&rsquo;s Privacy Policy sets out how Doctoroo collects, uses and protects the personal information of its Users. Doctoroo&rsquo;s Website Terms of Use governs Users&rsquo; use of the Site. These documents are available on the Site.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">2. &nbsp; Platform</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>The Doctoroo platform does not provide healthcare services itself and takes no part in your medical diagnosis and/or treatment. By accessing or using the Site, you acknowledge that Healthcare Providers and Pharmacies are not employees, contractors, partners or agents of Doctoroo. Doctoroo&rsquo;s responsibilities are limited to facilitating the availability of the Site, the App and the Services.</li>\r\n<li>Any arrangement between a Patient and a Healthcare Provider or Pharmacy is solely between the Patient and Healthcare Provider or Pharmacy. It is strictly and expressly not part of the User&rsquo;s agreement with Doctoroo.</li>\r\n<li>Doctoroo has no control over the conduct of Patients, Healthcare Providers or Pharmacies and any other user of the Site, the App and the Services. Doctoroo disclaims all liability in this regard, as set out in these Terms.</li>\r\n<li>\r\n<div class="li-bold">Healthcare Provider consultations:</div>\r\nPatients can enter the details of their healthcare needs on the App or Site and they will be provided with a list of Healthcare Providers and their availabilities. Patients will request a consultation with the Healthcare Provider of their choice. The Healthcare Provider will confirm or reject the consultation request. If necessary, Patients can reschedule and cancel consultations. At the time of the scheduled consultation, the Healthcare Provider will contact the Patient via the App or Site and provide the virtual consultation. If appropriate, Healthcare Providers may provide Patients with prescriptions, medical certificates, referrals or other documentation to be sent to the Patient through the Doctoroo platform communication channel or available in the Patient&rsquo;s account.</li>\r\n<li>\r\n<div class="li-bold">Pharmacy Services:</div>\r\nPatients may use Doctoroo to request Pharmacies to fulfil prescriptions and to process their orders as required. Patients can either order their prescription, medication or other pharmaceutical products online and collect the medication from the relevant Pharmacy or request delivery of their medication or other pharmaceutical products in accordance with the Delivery Click &amp; Collect Terms and Conditions. Patients may also use &ldquo;healthhubs&rdquo; in participating Pharmacies to book and attend consultations with Healthcare Providers.</li>\r\n<li>\r\n<div class="li-bold">Other Doctoroo Services:</div>\r\nPatients may use Doctoroo to ask initial, non-emergency, general health questions and to receive an answer from a Healthcare Provider or to schedule medication reminders to be sent to them as well as any other services which may be added with further upgrades to the Site and App.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">3. &nbsp; Online Registration</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>Each Patient may only have one (1)\r\n<div class="li-bold">Account</div>\r\non the Site and App. Patient information is required when registering on the Site for an Account including name, email address, phone number, address and other required information.</li>\r\n<li>Each Patient agrees to provide accurate, current and complete information during the registration and approval process as well as throughout the term of use of Doctoroo by the Patient including during consultations with Healthcare Providers and to update such information to keep it accurate, current and complete. Doctoroo reserves the right to suspend or terminate any Patient&rsquo;s Account and his/her access to the Site, App and Services if any information provided to Doctoroo proves to be inaccurate, not current or incomplete.</li>\r\n<li>Patients authorise Doctoroo to display information relating to them for marketing purposes including to allow Patients to search and book them through the Site.</li>\r\n<li>To keep information secure and confidential, Doctoroo uses SSL Certificates to establish an encrypted link between a server and a Healthcare Provider and Patient. Further information on the storage and security of personal information can be found in our Privacy Policy and Website Terms of Use.</li>\r\n<li>It is the Patient&rsquo;s responsibility to keep its Account details, username and password confidential. The Patient is liable for all activity on its Account. The Patient agrees that it will not disclose its password to any third party and that it will take sole responsibility for any activities or actions under its Account, whether or not it has authorised such activities or actions.</li>\r\n<li>The Patient will immediately notify Doctoroo of any unauthorised use of its Account.</li>\r\n<li>Patients may add family members under the age of 18 to their Account and but must not share their login details with these family members. The Patient who holds the Account must be present at all times while a family member is using the Services.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">4. &nbsp; Patient Obligations</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>Each Patient should report to Doctoroo, any activities or requests of Users which are, or which the Patient reasonably believes to be:\r\n<div class="butets-lists inner">\r\n<ol class="upp-roman">\r\n<li>suspicious;</li>\r\n<li>inconsistent;</li>\r\n<li>illegal; or</li>\r\n<li>likely to have a negative effect on the reputation of Doctoroo, the Site, the App, Services and/or a User.</li>\r\n</ol>\r\n</div>\r\n</li>\r\n<li>Each Patient acknowledges and agrees that while the Site allows Users to communicate with each other in certain respects, Patients are not permitted to share the contact information of other Users.</li>\r\n<li>Each Patient represents and warrants that any content that it provides or posts:\r\n<div class="butets-lists inner">\r\n<ol class="upp-roman">\r\n<li>will not breach any agreements it has entered into with any third parties;</li>\r\n<li>will be in compliance with all applicable laws, tax requirements, and rules and regulations that may apply to any Patient in its local area and country; and</li>\r\n<li>will not conflict with the rights of third parties.</li>\r\n</ol>\r\n</div>\r\n</li>\r\n<li>For the avoidance of doubt, Doctoroo assumes no responsibility for a Patient&rsquo;s compliance with any applicable laws, rules and regulations.</li>\r\n<li>Patients must pay all costs relating to their use of Doctoroo (including internet costs and computer costs).</li>\r\n<li>Doctoroo reserves the right, at any time and without prior notice, to remove or disable access to any Account for any reason, including Accounts that Doctoroo, at its sole discretion, considers to be objectionable for any reason, in violation of these Terms or otherwise harmful to the Site, the App or Services.</li>\r\n<li>Users acknowledge that they will not record video of any Services without written consent from both Doctoroo and the relevant Healthcare Provider.</li>\r\n<li>Any medical history a Patient provides via Doctoroo or to their Healthcare Provider should be complete and accurate, failure to do so could result in misdiagnosis.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">5. &nbsp; Consent to Treatment and Collection</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>For the purposes of the Services, the Patient gives their express consent for Healthcare Providers they have booked or may book in the future or an alternative Healthcare Provider that is available to:\r\n<div class="butets-lists inner">\r\n<ol class="upp-roman">\r\n<li>conduct a consultation and collect all information required to be able to diagnose and/or provide treatment options; and</li>\r\n<li>access their medical records, history, any uploaded images, documents, previous consultations and all data available within their Account.</li>\r\n</ol>\r\n</div>\r\n</li>\r\n<li>The Patient also provides consent to Pharmacies to review their medical history for the purpose of checking any allergies or reactions with medications and other dispensing requirements.</li>\r\n<li>Patients have the right to refuse consent to any party by notifying them directly.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">6. &nbsp; Blog</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>The Site and App has a blog and question facility on which Users are able to communicate or ask Healthcare Providers questions.</li>\r\n<li>Doctoroo asks Patients to limit their questions to topics which are relevant to Doctoroo&rsquo;s Site, App and Services.</li>\r\n<li>Doctoroo reserves the right to remove any posts or answers by Patients which Doctoroo, at its sole discretion, deems to be inappropriate.</li>\r\n<li>Patients acknowledge and agree that they are not permitted to post posts or provide answers which contain foul language, illegal material, defamatory comments, business advertisements, spam, religious debates, comments which incite fear, and/or any form of abuse, insults or personal attacks.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">7. &nbsp; Payments</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>Patients do not have to pay a fee to register for an Account or to access and use the Site.</li>\r\n<li>Patients are required to pay the fees as set out on the Site and App.</li>\r\n<li>Goods and Services Tax (\r\n<div class="li-bold">GST</div>\r\n) will be charged where applicable.</li>\r\n<li>The Patient must not pay, or attempt to pay, for the Services through any fraudulent or unlawful means.</li>\r\n<li>In the absence of fraud or mistake, all payments made are final and the Patient shall not have the right to cancel its purchase for any reason and further each Patient agrees to satisfy all such payments made, with exception to action taken under the Refund Policy set out in these Terms.</li>\r\n<li>If the Patient makes a payment by debit or credit card, the Patient warrants that the information provided to Doctoroo is true, accurate and complete, that the Patient is authorised to use the debit or credit card to make the payment, that the payment will be honoured by the card issuer, and that the Patient will maintain sufficient funds in the account to cover the purchase price.</li>\r\n<li>Nothing prevents Doctoroo from taking any action necessary to recover any unpaid fees. If the Patient fails to pay, the Patient&rsquo;s information will be passed on for collection and or legal action. The Patient acknowledges and agrees that it is liable for and will pay all costs including debt collection, commission, solicitor&rsquo;s fees and any out of pocket expense. If the Patient at any time exceeds Doctoroo&rsquo;s payment terms and as a result are passed on for collection and or legal action, Doctoroo may place a default against the Patient with a credit reporting agency.</li>\r\n<li>Doctoroo&rsquo;s pricing structure or payment methods may be amended from time to time at its sole discretion. After a pricing change, each Patient has the choice to continue using the Site and App, or to cease to use the Site or App without penalty.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">8. &nbsp; Offers and Promotions</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>Doctoroo may, from time to time, make offers or promotions which may be applicable to the Services.</li>\r\n<li>The conditions of such offers or promotions will be specified on the Site or App.</li>\r\n<li>The Patient acknowledges and agrees that Doctoroo may, at its sole discretion, remove or extend any offers or promotions, and Doctoroo will not be responsible or liable for any potential loss or damage which the Patient incurs as a result of the removal or extension of any offers or promotions.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">9. &nbsp; Dispute Resolution</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>By using our Site, App and Services, each Patient agrees that any legal remedy or liability that he or she may seek to obtain for actions or omissions of a Patient, Healthcare Provider, Pharmacy, or other third party, will be limited to a claim against the Healthcare Provider, Patient, Pharmacy or other third party, who caused harm to him or her. Doctoroo encourages Users to communicate directly with the relevant Healthcare Provider, Patient, Pharmacy or third party to resolve any disputes.</li>\r\n<li>Doctoroo provides an online dispute resolution process for Patients, Healthcare Providers and Pharmacies. Relevant parties will have the opportunity to provide evidence and documentation to prove their claim and Doctoroo may make determinations at its sole discretion. Any Doctoroo decision will be final.</li>\r\n<li>Doctoroo welcomes feedback from Patients. Doctoroo seeks to resolve concerns quickly and effectively. If any Patient has any feedback or questions about the Services, please submit your feedback via the feedback or review pages in your Account or contact Doctoroo at the email at the end of these Terms.</li>\r\n<li>If there are any complaints from a Patient, Doctoroo will aim to respond and provide a suitable solution within 45 days. If a Patient is not satisfied with Doctoroo&rsquo;s response, the Patient and Doctoroo agree to the following dispute resolution procedure:\r\n<div class="butets-lists inner">\r\n<ol class="upp-roman">\r\n<li>The complainant must tell the respondent in writing, the nature of the dispute, what outcome the complainant wants and what action the complainant thinks will settle the dispute. The Patient and Doctoroo agree to meet in good faith to seek to resolve the dispute by agreement between them (\r\n<div class="li-bold">Initial Meeting</div>\r\n).</li>\r\n<li>If a resolution cannot be agreed upon at the Initial Meeting, either the Patient or Doctoroo may refer the matter to a mediator. If the Patient and Doctoroo cannot agree on who the mediator should be, the complainant will ask the Law Society of New South Wales to appoint a mediator. The mediator will decide the time and place for mediation. Each party to the dispute must attend the mediation in good faith, to seek to resolve the dispute.</li>\r\n</ol>\r\n</div>\r\n</li>\r\n<li>Any attempts made by a party to resolve a dispute pursuant to this clause are without prejudice to other rights or entitlements of either party under these Terms, by law or in equity.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">10. &nbsp; Cancellation of Registration</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>If a Patient wishes to cancel its registration, it will need to do so in writing by contacting us at the email address at the bottom of these Terms.</li>\r\n<li>No refunds will be made upon cancellation except as specified in the Refund Policy set out in these Terms</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">11. &nbsp; Consumer Guarantees</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>Certain legislation&nbsp;including the&nbsp;Australian Consumer Law&nbsp;(\r\n<div class="li-bold">ACL</div>\r\n) in the\r\n<div class="li-bold italic">Competition and Consumer Act&nbsp;2010</div>\r\n&nbsp;(Cth), and similar consumer protection laws and regulations may confer the Patient with rights,&nbsp;warranties, guarantees and remedies relating to the provision of Services by Doctoroo to the Patient which cannot be excluded, restricted or modified (\r\n<div class="li-bold">Statutory Rights</div>\r\n).</li>\r\n<li>If the Patient is a consumer as defined in the ACL, the following notice applies to the Patient from Doctoroo: &ldquo;Doctoroo guarantees that the Services supplied to the Patient are rendered with due care and skill; fit for the purpose that Doctoroo advertises, or that the Patient has told Doctoroo he, she or it is acquiring the Services for or for a result which the Patient has told Doctoroo he, she or it wishes the Services to achieve, unless Doctoroo considers and discloses that this purpose is not achievable; and will be supplied within a reasonable time. To the extent Doctoroo is unable to exclude liability; Doctoroo&rsquo;s total liability for loss or damage suffered or incurred by the Patient from the Services is limited to Doctoroo re-supplying the Services to the Patient, or, at Doctoroo&rsquo;s option, Doctoroo refunding to the Patient the amount he, she or it has paid Doctoroo for the Services to which his, her or its claim relates.&rdquo;</li>\r\n<li>Nothing in&nbsp;these Terms&nbsp;excludes a Patient&rsquo;s Statutory Rights as a consumer under the ACL.&nbsp;Each Patient agrees that Doctoroo&rsquo;s liability for Services provided to Patients who are defined as consumers is governed solely by the ACL and these Terms.&nbsp;</li>\r\n<li>Doctoroo excludes all conditions and warranties implied by custom, law or statute except for the Patient&rsquo;s Statutory Rights. Except for the Patient&rsquo;s Statutory Rights, all material and work is provided to the Patient without warranties of any kind, either express or implied, and Doctoroo expressly disclaims all warranties of any kind including but not limited to implied warranties of merchantability and fitness for a particular purpose.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">12. &nbsp; Refund Policy</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>Doctoroo will provide refunds as required under the Australian Consumer Law.</