t&rsquo;s use of the Site, App and Services, the Patient may not and agrees that he or she will not:\r\n<div class="butets-lists inner">\r\n<ol class="upp-roman">\r\n<li>use the Site, App or Services for any commercial or other purposes that are not expressly permitted by these Terms;</li>\r\n<li>register for more than one Account or register for an Account impersonating another individual and/or entity;</li>\r\n<li>use the Services to find a Healthcare Provider and then complete, or assist another individual to complete, the booking for a consultation or transaction independent of the Services in order to circumvent the obligation to pay any fees related to Doctoroo&rsquo;s provision of the Services;</li>\r\n<li>post any material or upload any content (including but not limited to User Content) that is offensive, contains nudity or inappropriate language, contains racial or religious ranting or discrimination or defames a Healthcare Provider, Patient or Pharmacy;</li>\r\n<li>submit any false or misleading information;</li>\r\n<li>violate any local, state, provincial, national, or other law or regulation, or any order of a court, including, without limitation, zoning restrictions and tax regulations;</li>\r\n<li>copy, store or otherwise access any information contained on the Site, App and Services or content for purposes not expressly permitted by these Terms;</li>\r\n<li>infringe the rights of any person or entity, including without limitation, their intellectual property, privacy, publicity or contractual rights;</li>\r\n<li>use the Site, App or Services to transmit, distribute, post or submit any information concerning any other person or entity, including without limitation, photographs of others without their permission, personal contact information or credit, debit, calling card or account numbers;</li>\r\n<li>use the Site, App or Services in connection with the distribution of unsolicited commercial email, i.e. spam or advertisements;</li>\r\n<li>stalk or harass any other User of the Services or collect or store any personally identifiable information about any other User other than for purposes of transacting as a User on the Site or App;</li>\r\n<li>use, display, mirror or frame the Site or App, or any individual element within the Site or App, Services, Doctoroo&rsquo;s name, any Doctoroo trademark, logo or other Intellectual Property, information, or the layout and design of any page or form contained on a page, without Doctoroo&rsquo;s express written consent; or&nbsp;</li>\r\n<li>advocate, encourage, or assist any third party in doing any of the foregoing.</li>\r\n</ol>\r\n</div>\r\n</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">16. &nbsp; User Content</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>Users are permitted to post, upload, publish, submit or transmit relevant information and content (\r\n<div class="li-bold">User Content</div>\r\n). By making available any User Content or any Intellectual Property on or through the Site, App and Services, the User grants to Doctoroo a worldwide, irrevocable, perpetual, non-exclusive, transferable, royalty-free licence to use the User Content and Intellectual Property, with the right to use, view, copy, adapt, modify, distribute, license, sell, transfer, publicly display, publicly perform, transmit, stream, broadcast, access, or otherwise exploit such User Content and Intellectual Property on, through, or by means of the Site, App and Services.</li>\r\n<li>The User agrees that it is solely responsible for all User Content and Intellectual Property that it makes available through the Site, App and Services. The User represents and warrants that:\r\n<div class="butets-lists inner">\r\n<ol class="upp-roman">\r\n<li>it is either the sole and exclusive owner of all User Content and Intellectual Property that it makes available through the Site, App and Services, or that it has all rights, licences, consents and releases that are necessary to grant to Doctoroo the rights in such User Content or Intellectual Property, as contemplated under these Terms; and</li>\r\n<li>neither the User Content nor the posting, uploading, publication, submission or transmittal of the User Content or Doctoroo&rsquo;s use of the User Content (or any portion thereof) on, through or by means of the Site, App and the Services will infringe, misappropriate or violate a third party&rsquo;s patent, copyright, trademark, trade secret, moral rights or other Intellectual Property rights, or rights of publicity or privacy, or result in the violation of any applicable law or regulation.</li>\r\n</ol>\r\n</div>\r\n</li>\r\n<li>Doctoroo may at its sole discretion remove any User Content that is offensive or in breach of these Terms.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">17. &nbsp; Disclaimers</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>Doctoroo does not guarantee that healthcare, prescription fulfilment or other services will be requested by any Patients, nor does Doctoroo guarantee that Patients will be able to find desirable Healthcare Providers or Pharmacies.</li>\r\n<li>Doctoroo does not endorse any Healthcare Provider, Pharmacy or Patient. Doctoroo requires Healthcare Providers and Pharmacies to confirm that they have provided accurate information. Doctoroo performs some background searches on Healthcare Providers but cannot be held responsible for any inaccurate or false information provided by a Healthcare Provider.</li>\r\n<li>Users acknowledge that Doctoroo is designed for English speaking users and Doctoroo is not responsible for any language misunderstandings during the Services. Although some Healthcare Providers may claim to speak a language other than English, Doctoroo makes no representations or warranties in relation to their proficiency.</li>\r\n<li>Doctoroo accepts no responsibility for and makes no representations or warranties to any User or to any other person or entity as to the reliability, accuracy or completeness of the information contained on the Site or the App. Doctoroo disclaims any and all liability related to any and all Patients, Healthcare Providers, Pharmacies and any related services.</li>\r\n<li>By using the Site, App or Services, each User agrees that any legal remedy or liability that it seeks to obtain for actions or omissions of Healthcare Providers, Patients, Pharmacies or other third parties will be limited to a claim against the Healthcare Providers, Patients, Pharmacy or other third party who caused it harm.</li>\r\n<li>To the fullest extent allowable under applicable law, Doctoroo disclaims all warranties, representations and conditions, whether express or implied, including any warranties, representations and conditions that the Site, App or Services are merchantable, of satisfactory quality, reliable, accurate, complete, suitable or fit for a particular purpose or need, non-infringing or free of defects or errors.</li>\r\n<li>For the avoidance of doubt, Doctoroo is not responsible for any duties, fees, taxation, visa or immigration matters associated under these Terms. Doctoroo advises that all Patients using the Site, App and Services should seek advice in relation to these matters.</li>\r\n<li>Each Healthcare Providers, Patients, Pharmacy who uses the Site, App and the Services does so at their own risk.</li>\r\n<li>Doctoroo excludes all express and implied conditions and warranties, except for the Patient&rsquo;s Statutory Rights, to the fullest extent permitted by law, including but not limited to:\r\n<div class="butets-lists inner">\r\n<ol class="upp-roman">\r\n<li>Doctoroo expressly disclaims any implied or express guarantees, warranties, representations or conditions of any kind, which are not stated in these Terms;</li>\r\n<li>Doctoroo does not warrant that the Site, the App, the Services, content on the Site or App (including pictures, videos, sound clips, resumes, links etc.), or the Patient&rsquo;s access to the Site, the App or the Services will be error free, that any defects will be corrected or that the Site, the App or the server which stores and transmits material to the Patient is free of viruses or any other harmful components;</li>\r\n<li>Doctoroo takes no responsibility for, and will not be liable for, the Site, the App, the Services, the Healthcare Providers, Pharmacies, Patients or related services being unavailable, of a particular standard of workmanship, failing to meet the relevant User&rsquo;s needs, or being of less than merchantable quality; and</li>\r\n<li>Doctoroo will not be liable for any loss, damage, costs or expense whether direct, indirect, incidental, special, consequential and/or incidental, including lost profits, loss of data or loss of goodwill, service interruption, computer damage or system failure or the cost of substitute products or services, or for any damages for personal, bodily injury, death or emotional distress, loss of revenue, production, opportunity, access to markets, goodwill, reputation, use or any indirect, remote, abnormal or unforeseeable loss, or any loss or damage relating to business interruption, loss of programs or other data on the Patient&rsquo;s information systems or costs of replacement goods, or otherwise, suffered by the Patient or claims made against the Patient, arising out of or in connection with the Site, the App, Services, content on the Site or App, inability to access or use the Site, the App, the Services, any healthcare services or the Terms, even if Doctoroo was expressly advised of the likelihood of such loss or damage.</li>\r\n</ol>\r\n</div>\r\n</li>\r\n<li>Doctoroo provides the Site and App on an &ldquo;as-is&rdquo; basis, and makes no guarantee and holds the exclusive and complete right and discretion to alter, stop, remove, temporarily or indefinitely, any feature, functionality or purpose of the Site, App or Services, at any time, and without any notice.</li>\r\n<li>Patients should always seek the advice of a doctor or other qualified healthcare provider regarding any medical concerns including before starting, stopping or modifying any treatment or medication notwithstanding any advice or content received or read via Doctoroo.</li>\r\n<li>Any content on Doctoroo (including blogs, emails, newsletter or any other form of communication from Doctoroo) is solely for the purpose of general reference only, and does not constitute comprehensive medical information or knowledge or specific advice for your particular health condition, and may not include all potential information on the matter. Any content may contain errors, omissions or inaccuracies, be outdated, unreliable or incomplete, and Doctoroo is not liable for any damage, harm or loss caused by the use of, lack of, visibility to or otherwise existence of such information or content and your action or inaction relating to such content. Such information may be compiled from a variety of sources.</li>\r\n<li>The Patient agrees not to attempt to impose liability on, or seek any legal remedy from Doctoroo with respect to such actions or omissions.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">18. &nbsp; Limitation of Liability</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>(a)To the extent permitted by law, Doctoroo&rsquo;s total liability arising out of or in connection with the Site, the App, the Services or the Terms, however arising, including under contract, tort, negligence, in equity, under statute or otherwise, is limited to Doctoroo re-supplying the Services to the Patient, or, at Doctoroo&rsquo;s option, Doctoroo refunding to the Patient the amount it paid for the Services to which its claim relates. Doctoroo&rsquo;s total liability to the Patient for all damages in connection with the Services will not exceed the price paid by the Patient under these Terms for the 12 months period prior to the act which gave rise to the liability, or one hundred dollars (AUD$100) if no such payments have been made.</li>\r\n<li>(b)The limitations of damages set forth above are fundamental elements of the basis of the bargain between Doctoroo and the Patient. Some jurisdictions do not allow the exclusion or limitation of liability for consequential or incidental damages, so the above limitation may not apply to the Patient.</li>\r\n<li>This limitation of liability reflects the allocation of risk between the parties. The limitations specified in this section will survive and apply even if any limited remedy specified in these terms is found to have failed of its essential purpose. The limitations of liability provided in these terms inure to the benefit of Doctoroo.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">19. &nbsp; Indemnity</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>Each Patient agrees to defend and indemnify and hold Doctoroo (and Doctoroo&rsquo;s parent, related bodies corporate, officers, directors, contractors, employees and agents) harmless from and against any claims, actions, suits, demands, damages, liabilities, costs or expenses (including legal costs and expenses on a full indemnity basis), including in tort, contract or negligence, arising out of or connected to the Patient&rsquo;s use of or access to the Services; any breach by the Patient of these Terms; any wilful, unlawful or negligent act or omission by the Patient; and any violation by the Patient of any applicable laws or the rights of any third party.</li>\r\n<li>Doctoroo reserves the right to assume the exclusive defence and control of any matter otherwise subject to indemnification by the Patient, in which event the Patient will cooperate in asserting any available defences.</li>\r\n<li>This defence and indemnification obligation will survive these Terms and the Patient&rsquo;s use of the Site, App or Services. These Terms, and any rights and licences granted hereunder, may not be transferred or assigned by the Patient, but may be assigned by Doctoroo without restriction.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">General</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>\r\n<div class="li-bold">Accuracy:</div>\r\nWhile Doctoroo will endeavour to keep the information up to date and correct, Doctoroo makes no representations, warranties or guarantee, express or implied, about the completeness, accuracy, reliability, suitability or availability of any information, images, products, services, or related graphics contained on the Site or App for any particular purpose. The Patient hereby acknowledges that such information and materials may contain mistakes, inaccuracies or errors and Doctoroo expressly excludes any liability for such to the fullest extent permissible by law.</li>\r\n<li>\r\n<div class="li-bold">Termination:</div>\r\nDoctoroo reserves the right to refuse supply of the Services required by any Patient, terminate any Patient&rsquo;s Account, terminate its contract with any Patient, and remove or edit content on the Site or App, if the Patient commits a non-remediable breach or a remediable breach that is not remedied within 5 days, in its sole discretion. If Doctoroo decides to terminate a Patient&rsquo;s Account any of the following may occur, with or without notice to the Patient: (a) the Patient&rsquo;s Account will be deactivated, its password will be disabled and he or she will not be able to access the Site, App, Services, its Account or its User Content; (b) any pending or future consultations, orders or other requested services consultations will be immediately terminated; (c) Doctoroo may communicate to the relevant Patient that the consultation has been cancelled; (d) Doctoroo may refund the Patient in full, regardless of the cancellation and refund policy; and (e) the Patient will not be entitled to any compensation for consultations that were cancelled as a result of a suspension, deactivation or termination of their Account.</li>\r\n<li>\r\n<div class="li-bold">Fraudulent Activities:</div>\r\nEach Patient acknowledges and agrees that, in the event Doctoroo reasonably suspects that there are fraudulent activities occurring within the Site, App and Services, Doctoroo reserves the right to immediately terminate any Accounts involved in such activities, contact the relevant authorities and provide all necessary information to assist in proceedings and investigations.</li>\r\n<li>\r\n<div class="li-bold">Force Majeure:</div>\r\nDoctoroo will not be liable for any delay or failure to perform its obligations under the Terms if such delay is due to any circumstance beyond its reasonable control.</li>\r\n<li>\r\n<div class="li-bold">Notice:</div>\r\nAny notice in connection with the Terms will be deemed to have been duly given when made in writing and delivered or sent by email or post to the party to whom such notice is intended to be given or to such other address or email address as may from time to time be notified in writing to the other party.</li>\r\n<li>\r\n<div class="li-bold">Waiver:</div>\r\nAny failure by a party to insist upon strict performance by the other of any provision in the Terms will not be taken to be a waiver of any existing or future rights in relation to the provision. No waiver by Doctoroo of any of the Terms shall be effective unless Doctoroo expressly states that it is a waiver and Doctoroo communicates it to the Patient in writing.</li>\r\n<li>\r\n<div class="li-bold">Assignment:</div>\r\nA Patient must not assign any rights and obligations under the Terms whether in whole or in part without Doctoroo&rsquo;s prior written consent.</li>\r\n<li>\r\n<div class="li-bold">Severability:</div>\r\nIf any of the Terms are determined by any competent authority to be invalid, unlawful or unenforceable to any extent, such term, condition or provision will to that extent be severed from the remaining terms, conditions and provisions which will continue to be valid to the fullest extent permitted by law.</li>\r\n<li>\r\n<div class="li-bold">Jurisdiction and Applicable Law:</div>\r\nThese Terms, use of this Site, the App, the Services and any dispute arising out of any Patient&rsquo;s use of the Site, App or Services is subject to the laws of New South Wales, Australia, and subject to the exclusive jurisdiction of the New South Wales courts. The Site and App may be accessed throughout Australia and overseas. Doctoroo makes no representation that the content of the Site and App complies with the laws (including intellectual property laws) of any country outside Australia. If a Patient accesses the Site or App from outside Australia, it does so at its own risk and are responsible for complying with the laws in the place where he/she accesses the Site or App.</li>\r\n<li>\r\n<div class="li-bold">Entire Agreement:</div>\r\nThese Terms and any document expressly referred to in them represent the entire agreement between Doctoroo and each Patient, and supersede any prior agreement, understanding or arrangement between Doctoroo and each Patient, whether oral or in writing.</li>\r\n</ul>\r\n</div>\r\n<div class="address-block">\r\n<div class="content-head">For questions and notices, please contact:</div>\r\n<div class="address-text"><span>Doctoroo Australia Pty Ltd ABN 15616602629</span> <span>Level 13/50 Carrington Street</span> <span>Sydney 2000, New South Wales</span> <span>Australia</span> <span>wecare@doctoroo.com.au</span>\r\n<div class="address-text bottom"><span><span class="address-te-bold">Last update:</span>August 2017</span></div>\r\n</div>\r\n</div>\r\n</div>', 'Patient Marketplace Terms & Condition', 'Patient Marketplace Terms & Condition', 'Patient Marketplace Terms & Condition', 'Active', '2017-02-23 17:59:00', '2018-01-02 16:31:40');
