(23, 'private - health -funds ', 'private-health-funds', 'Private  health  funds ', '<p>The Doctors&rsquo; Health Fund is a registered private health insurer which serves the Australian medical community. It was established in 1977.</p>\r\n<p>The Fund offers a service that protects members from the impact of health care incidents in their lives. It provides convenience and flexibility with a choice of hospital and extras cover.</p>\r\n<p>Our Top Cover for hospital offers the best gap cover in Australia. It delivers unrestricted choice of doctor and greater benefits which are based on the AMA List of Medical Services and Fees.</p>', 'private  health funds ', 'private  health  funds ', 'private health funds ', 'Active', '2017-02-23 19:14:04', '2017-03-14 20:30:21'),
