 suffered by you or any third party, or claims made against you or any third party which result from any use of or access to, or any inability to use or access, the Site. </span></div>\r\n<div class="content-head-para"><span>To the extent permitted by law, we exclude all representations, guarantees, warranties or terms (whether express or implied) other than those expressly set out in these Terms, and the Australian Consumer Law to the extent applicable.</span></div>\r\n<div class="content-head-para"><span><span class="head-para-bold">14. &nbsp; Disclaimer:</span> The Site is provided to you without warranties, express or implied, including but not limited to implied warranties of merchantability and/or fitness for a particular purpose. We do not warrant that the functions contained in any material on the Site or your access to the Site will be error free, that any defects will be corrected, that the Site or the server which stores and transmits material to you are free of viruses or any other harmful components, or that the Site will operate on a continuous basis or be available at any time. </span></div>\r\n<div class="content-head-para"><span>While we endeavour to keep the Site and Information up to date and correct, we make no representations, warranties or guarantee, express or implied, about:</span></div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>the completeness, accuracy, reliability, suitability or availability of any Information, images, products, services, or related graphics contained on the Site for any purpose;</li>\r\n<li>Third Party Information; or</li>\r\n<li>Third Party Sites.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head-para"><span>You read, use, and act on information contained on the Site, Third Party Information and/or Third Party Sites, strictly at your own risk. </span></div>\r\n<div class="content-head-para"><span><span class="head-para-bold">15. &nbsp; Indemnity: </span> By using the Site, you agree to defend and fully indemnify and hold us (and our officers, directors, employees, contractors and agents) harmless from and against all claims, actions, suits, demands, damages, liabilities, costs or expenses (including legal costs and expenses on a full indemnity basis), including in tort, contract or negligence, arising out of or connected to: </span></div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>your use of or access to the Site;</li>\r\n<li>any breach by you of these Terms; or</li>\r\n<li>any wilful, unlawful or negligent act or omission by you.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head-para"><span>This defence and indemnification obligation will survive these Terms and your use of the Site. These Terms, and any rights and licences granted hereunder, may not be transferred or assigned by you, but may be assigned by us without restriction.</span></div>\r\n<div class="content-head-para"><span><span class="head-para-bold">16. &nbsp; Breach: </span> You may only use the Site for lawful purposes and in a manner consistent with the nature and purpose of the Site. By using the Site, you agree that the exclusions and limitations of liability set out in these Terms are reasonable. If you do not think they are reasonable you must not use the Site. We reserve the right to remove any and all content found to be in breach of intellectual property rights, including without limitation copyright, or which in our opinion is deemed inappropriate and/or illegal. If you breach these Terms, we reserve the right to block you from the Site and to enforce our rights against you. If we do not act in relation to a breach of these Terms by you, this does not waive our rights to act with respect to subsequent or similar breaches of these Terms by you. All rights not expressly granted in these Terms are reserved.</span></div>\r\n<div class="content-head-para"><span><span class="head-para-bold">17. &nbsp; Exclusion of competitors: </span> You are prohibited from using the Site, including the Information, in any way that competes with our business. If you breach this term, we will hold you responsible for any loss that we may sustain, and hold you accountable for any profits that you may make from non-permitted use. We reserve the right to exclude any person from using the Site and Information, in our sole discretion. </span></div>\r\n<div class="content-head-para"><span><span class="head-para-bold">18. &nbsp; Enforceability: </span> If any provision of these Terms is found to be illegal, invalid or unenforceable by a court of law, then the provision will not apply in that jurisdiction and is deemed not to have been included in these Terms in that jurisdiction. This will not affect the remainder of these Terms, which continue in full force and effect. </span></div>\r\n<div class="content-head-para"><span><span class="head-para-bold">19. &nbsp; Further assurances: </span> Each party must, at its own expense, do everything reasonably necessary to give full effect to these Terms and the events contemplated by them. </span></div>\r\n<div class="content-head-para"><span><span class="head-para-bold">20. &nbsp; Termination: </span> These Terms are effective until terminated by us, which we may do at any time and without notice to you. In the event of termination, all restrictions imposed on you by these Terms and limitations of liability set out in the Terms will survive. </span></div>\r\n<div class="content-head-para"><span><span class="head-para-bold">21. &nbsp; Disputes: </span> You agree to use your best endeavours to use mediation and negotiation to resolve any dispute arising out of or relating to these Terms, prior to resorting to an external dispute resolution process. Please notify us in writing of any dispute you may have. </span></div>\r\n<div class="content-head-para"><span><span class="head-para-bold">22. &nbsp; Jurisdiction: </span> Your use of the Site and any dispute arising out of your use of it is subject to the laws of New South Wales and the Commonwealth of Australia. These Terms are governed by the laws of New South Wales and the Commonwealth of Australia and subject to the exclusive jurisdiction of the courts operating in New South Wales. The Site may be accessed throughout Australia and overseas. We make no representation that the Site complies with the laws (including intellectual property laws) of any country outside Australia. If you access the Site from outside Australia, you do so at your own risk and are responsible for complying with the laws in the place where you access the Site. </span></div>\r\n<div class="content-head">For questions and notices, please contact us at:</div>\r\n</div>', 'Terms of Use', 'Terms of Use', 'Terms of Use', 'Active', '2017-05-30 00:42:08', '2017-12-21 07:06:00');
INSERT INTO `dod_dynamic_pages` (`id`, `page_name`, `page_slug`, `page_title`, `page_desc`, `meta_keyword`, `meta_title`, `meta_desc`, `page_status`, `created_at`, `updated_at`) VALUES
(27, 'Healthcare Provider Marketplace Terms & Condition', 'healthcare-provider-marketplace-terms-condition', 'Healthcare Provider Marketplace Terms & Condition', '<div class="terms-condi-main-block">\r\n<div class="content-head-main"></div>\r\n<div class="content-head-para"><span>Doctoroo Australia Pty Ltd ABN 15616602629 (referred to as <span class="head-para-bold">Doctoroo</span>) provides a telemedicine and medication management platform available on <span class="conte-link"><a>https://doctoroo.com.au</a></span> (<span class="head-para-bold">Site</span>) and via the Doctoroo mobile applications ( <span class="head-para-bold">App</span>) (collectively the <span class="head-para-bold">Services</span>). The platform connects patients (<span class="head-para-bold">Patients</span>) with doctors and other health care professionals (<span class="head-para-bold">Healthcare Providers</span>) and pharmacies (<span class="head-para-bold">Pharmacies</span>) and allows Patients to access medical services including to:</span></div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>make bookings and then to consult with a Healthcare Provider on their mobile device or computer;</li>\r\n<li>get prescriptions, medical certificates and referrals from a Healthcare Provider;</li>\r\n<li>order medication and repeat prescriptions from Pharmacies to be collected by or delivered to the Patient;</li>\r\n<li>consult with a Healthcare Provider via a mobile medical clinic located in a Pharmacy; and</li>\r\n<li>ask health questions to Healthcare Providers and schedule medication reminders. Patients, Healthcare Providers and Pharmacies and other users of the Site are\r\n<div class="li-bold">Users.</div>\r\n</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">1. &nbsp; Contract</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>These Terms and Conditions (\r\n<div class="li-bold">Terms</div>\r\n) form a binding legal agreement between Doctoroo and each Healthcare Provider using the Site, App and Services. By accessing and using the Site, the App and the Services, each Healthcare Provider agrees to comply with and be legally bound by these Terms. Please read the Terms carefully. If there are any questions, please contact Doctoroo using the contact details at the end of these Terms.</li>\r\n<li>The Healthcare Provider&rsquo;s use of the Site, the App and the Services indicates that:\r\n<div class="butets-lists inner">\r\n<ol class="upp-roman">\r\n<li>the Healthcare Provider has had sufficient opportunity to access the Terms and contact Doctoroo;</li>\r\n<li>the Healthcare Provider has read, accepted and will comply with the Terms;</li>\r\n<li>the Healthcare Provider has legal capacity to enter into a contract for sale; and</li>\r\n<li>the Healthcare Provider is 18 years or older.&nbsp; If this is not correct, or if the Healthcare Provider does not agree to these Terms, the Healthcare Provider is not permitted to use any of the Services.</li>\r\n</ol>\r\n</div>\r\n</li>\r\n<li>Doctoroo may amend these Terms at any time without notice. Use of our Services following any such amendments will be deemed to be confirmation that the Healthcare Provider accepts those amendments. Doctoroo recommends that each Healthcare Provider check the current Terms, before continuing use of the Services. Only Doctoroo&rsquo;s authorised agents, employees and third parties have authority to change the Terms</li>\r\n<li>These Terms supplement and incorporate:\r\n<div class="butets-lists inner">\r\n<ol class="upp-roman">\r\n<li>the Doctoroo Website Terms of Use and Privacy Policy posted on the Site;</li>\r\n<li>the Stripe Australia Terms of Service including, without limitation, the Stripe Services Agreement;</li>\r\n<li>the Apple, Inc. Terms and Conditions including, without limitation, the Licensed Application End User License Agreement provided therein; and</li>\r\n<li>the Android, Google Inc. Terms and Conditions including, without limitation, the License Agreement and Terms of Application.</li>\r\n</ol>\r\n</div>\r\n</li>\r\n<li>Doctoroo&rsquo;s Privacy Policy sets out how Doctoroo collects, uses and protects the personal information of its Users. Doctoroo&rsquo;s Website Terms of Use governs Users&rsquo; use of the Site. These documents are available on the Site.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">2. &nbsp; Introductory Service Only</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>The Doctoroo platform does not provide healthcare services itself and takes no part in your medical diagnosis and/or treatment. By accessing or using the Site, you acknowledge that Healthcare Providers and Pharmacies are not employees, contractors, partners or agents of Doctoroo. Doctoroo&rsquo;s responsibilities are limited to facilitating the availability of the Site, the App and the Services.</li>\r\n<li>Any arrangement between a Patient and a Healthcare Provider or Pharmacy is solely between the Patient and Healthcare Provider or Pharmacy. It is strictly and expressly not part of the User&rsquo;s agreement with Doctoroo.</li>\r\n<li>Doctoroo has no control over the conduct of Patients, Healthcare Providers or Pharmacies and any other user of the Site, the App and the Services. Doctoroo disclaims all liability in this regard, as set out in these Terms.</li>\r\n<li>\r\n<div class="li-bold">Healthcare Provider consultations:</div>\r\nPatients can enter the details of their healthcare needs on the App or Site and they will be provided with a list of Healthcare Providers and their availabilities. Patients will request a consultation with the Healthcare Provider of their choice. The Healthcare Provider will confirm or reject the consultation request. If necessary, Patients can reschedule and cancel consultations. At the time of the scheduled consultation, the Healthcare Provider will ring the Patient via the App or Site and provide the virtual consultation. If appropriate, Healthcare Providers may provide Patients with prescriptions, medical certificates, referrals or other documentation to be sent to the Patient through the Doctoroo platform communication channel or available in the Patient&rsquo;s account.</li>\r\n<li>\r\n<div class="li-bold">Pharmacy Services:</div>\r\nPatients may use Doctoroo to request Pharmacies to fulfil prescriptions and to process their orders as required. Patients can either order their prescription, medication or other pharmaceutical products online and collect the medication from the relevant Pharmacy or request delivery of their medication or other pharmaceutical products. Patients may also use &ldquo;healthhubs&rdquo; in participating Pharmacies to book and attend consultations with Healthcare Providers.</li>\r\n<li>\r\n<div class="li-bold">Other Doctoroo Services:</div>\r\nPatients may use Doctoroo to ask initial, non-emergency, general health questions and to receive an answer from a Healthcare Provider or to schedule medication reminders to be sent to them as well as any other services which may be added with further upgrades to the Site and App.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">3. &nbsp; Online Registration</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>Each Healthcare Provider may only have one (1)\r\n<div class="li-bold">Account</div>\r\non the Site and App. Healthcare Providers will apply to Doctoroo with their details and will be contacted by Doctoroo to provide further information and paperwork before being, if approved, accepted to the platform and granted an Account.</li>\r\n<li>Each Healthcare Provider agrees to provide accurate, current and complete information during the registration and approval process as well as throughout the term of use of Doctoroo by the Healthcare Provider and to update such information to keep it accurate, current and complete. Doctoroo reserves the right to suspend or terminate any Healthcare Provider&rsquo;s Account and his/her access to the Site, App and Services if any information provided to Doctoroo proves to be inaccurate, not current or incomplete</li>\r\n<li>Healthcare Providers authorise Doctoroo to display information relating to them for marketing purposes including to allow Patients to search and book them through the Site.</li>\r\n<li>To keep information secure and confidential, Doctoroo uses SSL Certificates to establish an encrypted link between a server and a Healthcare Provider and a Patient. Further information on the storage and security of personal information can be found in our Privacy Policy and Website Terms of Use.</li>\r\n<li>It is the Healthcare Provider&rsquo;s responsibility to keep its Account details, username and password confidential. The Healthcare Provider is liable for all activity on its Account. The Healthcare Provider agrees that it will not disclose its password to any third party and that it will take sole responsibility for any activities or actions under its Account, whether or not it has authorised such activities or actions.</li>\r\n<li>The Healthcare Provider will immediately notify Doctoroo of any unauthorised use of its Account.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">4. &nbsp; Healthcare Provider Obligations</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>Each Healthcare Provider should report to Doctoroo, any activities or requests of Users which are, or which the Healthcare Provider reasonably believes to be:\r\n<div class="butets-lists inner">\r\n<ol class="upp-roman">\r\n<li>suspicious;</li>\r\n<li>inconsistent;</li>\r\n<li>illegal; or</li>\r\n<li>likely to have a negative effect on the reputation of Doctoroo, the Site, the App, Services and/or a User.</li>\r\n</ol>\r\n</div>\r\n</li>\r\n<li>Each Healthcare Provider acknowledges and agrees that while the Site allows Users to communicate with each other in certain respects, Healthcare Providers are not permitted to share the contact information of other Users.</li>\r\n<li>Each Healthcare Provider represents and warrants that any content that it provides or posts:\r\n<div class="butets-lists inner">\r\n<ol class="upp-roman">\r\n<li>will not breach any agreements it has entered into with any third parties;</li>\r\n<li>will be in compliance with all applicable laws, tax requirements, and rules and regulations that may apply to any Healthcare Provider in its local area and country; and</li>\r\n<li>will not conflict with the rights of third parties.</li>\r\n</ol>\r\n</div>\r\n</li>\r\n<li>Healthcare Providers must maintain required licences and authorisations to practice medicine and telemedicine consultations or the speciality for which they will provide consultations.</li>\r\n<li>Healthcare Providers must maintain professional liability insurance that covers telehealth via our platform and cyber insurance to cover any loss of data or other cyber related issues, must have no criminal convictions, must be of stable mental state and must have sound technical and computer knowledge.</li>\r\n<li>Healthcare Providers must follow the Australian Medical Association&rsquo;s guidelines for the practice of medicine or any other applicable professional body guidelines and all other laws applicable to them including ensuring the privacy of information and patient privacy during the consultation and in relation to written records as well as any guidelines on any maximum number of consultations allowed per day.</li>\r\n<li>For the avoidance of doubt, Doctoroo assumes no responsibility for a Healthcare Provider&rsquo;s compliance with any applicable laws, rules and regulations.</li>\r\n<li>Healthcare Providers are responsible for all advice they give during Patient consultations as well as any other communication, suggestions, treatments, diagnoses or lack thereof.</li>\r\n<li>Healthcare Providers must pay all costs relating to their use of Doctoroo (including internet costs and computer costs).</li>\r\n<li>Doctoroo reserves the right, at any time and without prior notice, to remove or disable access to any Account for any reason, including Accounts that Doctoroo, at its sole discretion, considers to be objectionable for any reason, in violation of these Terms or otherwise harmful to the Site, the App or Services.</li>\r\n<li>Healthcare Providers must complete any training or continuing education which Doctoroo, at its sole discretion, considers necessary and will provide evidence of completion of the training or continuing education.</li>\r\n<li>During the term of these Terms and for one year after termination of these Terms between the Healthcare Provider and Doctoroo, Healthcare Providers must not (i) contact any Patients who were introduced to the Healthcare Provider by Doctoroo and (ii) compete with Doctoroo, enter into business arrangements, advise, work for, consult with, provide services to, or in any way assist a competitor of Doctoroo (who were competitors at the date of termination of these Terms between the Healthcare Provider and Doctoroo or within the 12 months prior).</li>\r\n<li>Users acknowledge that they will not record video of any Services without written consent from both Doctoroo and the relevant Healthcare Provider.</li>\r\n<li>If a Healthcare Provider does not find a telemedicine consultation as beneficial to the patients&rsquo; health, they will, at their judgement, offer the Patient alternative means of obtaining the required health care. Healthcare Providers will not exploit a Patient or conduct unnecessary telemedicine consults through Doctoroo for issues, symptoms or conditions they know or think may not be able to be diagnosed or treated via Doctoroo from the consultation request details of the Patient. Healthcare Providers also work in full autonomy with their information collection, symptom checking, diagnosis and possible treatments. Healthcare Providers are not obligated to provide any demand requested by the Patient, unless where the Healthcare Provider believes to be within the medical guidelines and is appropriate for the Patient&rsquo;s care.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">5. &nbsp; Blog</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>The Site and App has a blog and question facility on which Users are able to communicate or ask Healthcare Providers questions.</li>\r\n<li>Doctoroo asks Healthcare Providers to limit their comments to topics which are relevant to Doctoroo&rsquo;s Site, App and Services.</li>\r\n<li>Doctoroo reserves the right to remove any posts or answers by Healthcare Providers which Doctoroo, at its sole discretion, deems to be inappropriate.</li>\r\n<li>Healthcare Providers acknowledge and agree that they are not permitted to post posts or provide answers which contain foul language, illegal material, defamatory comments, business advertisements, spam, religious debates, comments which incite fear, and/or any form of abuse, insults or personal attacks.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">6. &nbsp; Payments</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>Healthcare Providers who register on the Site will be required to pay, in advance, a monthly membership fee (\r\n<div class="li-bold">Membership Fee</div>\r\n). Healthcare Providers acknowledge and agree that:\r\n<div class="butets-lists inner">\r\n<ol class="upp-roman">\r\n<li>to maintain a membership, payment will be made to Doctoroo on a monthly payment date, from the debit or credit card that the Healthcare Provider has provided; and</li>\r\n<li>if Doctoroo is unable to take payment from the debit or credit card, Doctoroo will attempt to contact the Healthcare Provider via email as soon as Doctoroo is aware of the payment failure.</li>\r\n</ol>\r\n</div>\r\n</li>\r\n<li>Until payment is confirmed, the Healthcare Provider will not be able to use the Site.</li>\r\n<li>Healthcare Providers agree that where a Membership Fee is payable, payment will automatically be deducted on the payment date. If a Healthcare Provider wishes to cancel their registration or deactivate an Account, he or she must do so prior to the payment date.</li>\r\n<li>Healthcare Providers will receive payment for their services directly from Patients via a third party payment processor as set out on the Site and App. Doctoroo may make available to Patients a receipt and/or tax invoice for consultations purchased from a Heathcare Provider via Doctoroo.</li>\r\n<li>Goods and Services Tax (\r\n<div class="li-bold">GST</div>\r\n) will be charged where applicable.</li>\r\n<li>The Healthcare Provider must not pay, or attempt to pay, for the Services through any fraudulent or unlawful means.</li>\r\n<li>In the absence of fraud or mistake, all payments made are final and the Healthcare Provider shall not have the right to cancel its purchase for any reason and further each Healthcare Provider agrees to satisfy all such payments made, with exception to action taken under the Refund Policy set out in these Terms.</li>\r\n<li>If the Healthcare Provider makes a payment by debit or credit card, the Healthcare Provider warrants that the information provided to Doctoroo is true, accurate and complete, that the Healthcare Provider is authorised to use the debit or credit card to make the payment, that the payment will be honoured by the card issuer, and that the Healthcare Provider will maintain sufficient funds in the account to cover the purchase price.</li>\r\n<li>Nothing prevents Doctoroo from taking any action necessary to recover any unpaid fees. If the Healthcare Provider fails to pay, the Healthcare Provider&rsquo;s information will be passed on for collection and or legal action. The Healthcare Provider acknowledges and agrees that it is liable for and will pay all costs including debt collection, commission, solicitor&rsquo;s fees and any out of pocket expense. If the Healthcare Provider at any time exceeds Doctoroo&rsquo;s payment terms and as a result are passed on for collection and or legal action, Doctoroo may place a default against the Healthcare Provider with a credit reporting agency.</li>\r\n<li>Doctoroo&rsquo;s pricing structure or payment methods may be amended from time to time at its sole discretion. After a pricing change, each Healthcare Provider has the choice to continue using the Site and App, or to cease to use the Site or App without penalty.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">7. &nbsp; Offers and Promotions</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>Doctoroo may, from time to time, make offers or promotions which may be applicable to the Services.</li>\r\n<li>The conditions of such offers or promotions will be specified on the Site or App.</li>\r\n<li>The Healthcare Provider acknowledges and agrees that Doctoroo may, at its sole discretion, remove or extend any offers or promotions, and Doctoroo will not be responsible or liable for any potential loss or damage which the Healthcare Provider incurs as a result of the removal or extension of any offers or promotions.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">8. &nbsp; Dispute Resolution</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>By using our Site, App and Services, each Healthcare Provider agrees that any legal remedy or liability that he or she may seek to obtain for actions or omissions of a Healthcare Provider, Patient, Pharmacy, or other third party, will be limited to a claim against the Healthcare Provider, Patient, Pharmacy or other third party, who caused harm to him or her. Doctoroo encourages Users to communicate directly with the relevant Healthcare Provider, Patient, Pharmacy or third party to resolve any disputes.</li>\r\n<li>Doctoroo provides an online dispute resolution process for Patients, Healthcare Providers and Pharmacies. Relevant parties will have the opportunity to provide evidence and documentation to prove their claim and Doctoroo may make determinations at its sole discretion. Any Doctoroo decision will be final.</li>\r\n<li>Doctoroo welcomes feedback from Healthcare Providers. Doctoroo seeks to resolve concerns quickly and effectively. If any Healthcare Provider has any feedback or questions about the Services, please submit your feedback via the feedback or review pages in your Account or contact Doctoroo at the email at the end of these Terms. Doctoroo will have exclusive ownership of all rights to any comments, reviews, suggestions or other\r\n<div class="li-bold">feedback</div>\r\nregarding Doctoroo transmitted through any medium, collectively, Feedback. Doctoroo will not be required to treat any Feedback as confidential and will be entitled to use Feedback for any commercial or other purpose whatsoever without compensation.</li>\r\n<li>If there are any complaints from a Healthcare Provider, Doctoroo will aim to respond and provide a suitable solution within 45 days. If a Healthcare Provider is not satisfied with Doctoroo&rsquo;s response, the Healthcare Provider and Doctoroo agree to the following dispute resolution procedure:\r\n<div class="butets-lists inner">\r\n<ol class="upp-roman">\r\n<li>The complainant must tell the respondent in writing, the nature of the dispute, what outcome the complainant wants and what action the complainant thinks will settle the dispute. The Healthcare Provider and Doctoroo agree to meet in good faith to seek to resolve the dispute by agreement between them (\r\n<div class="li-bold">Initial Meeting</div>\r\n).</li>\r\n<li>If a resolution cannot be agreed upon at the Initial Meeting, either the Healthcare Provider or Doctoroo may refer the matter to a mediator. If the Healthcare Provider and Doctoroo cannot agree on who the mediator should be, the complainant will ask the Law Society of New South Wales to appoint a mediator. The mediator will decide the time and place for mediation. Each party to the dispute must attend the mediation in good faith, to seek to resolve the dispute.</li>\r\n</ol>\r\n</div>\r\n</li>\r\n<li>Any attempts made by a party to resolve a dispute pursuant to this clause are without prejudice to other rights or entitlements of either party under these Terms, by law or in equity.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">9. &nbsp;Cancellation of Registration</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>If a Healthcare Provider wishes to cancel its registration, it will need to do so in writing by contacting us at the email address at the bottom of these Terms.</li>\r\n<li>No refunds will be made upon cancellation except as specified in the Refund Policy set out in these Terms.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">10. &nbsp; Consumer Guarantees</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>Certain legislation&nbsp;including the&nbsp;Australian Consumer Law&nbsp;(\r\n<div class="li-bold">ACL</div>\r\n) in the&nbsp;Competition and Consumer Act&nbsp;2010&nbsp;(Cth), and similar consumer protection laws and regulations may confer the Healthcare Provider with rights,&nbsp;warranties, guarantees and remedies relating to the provision of Services by Doctoroo to the Healthcare Provider which cannot be excluded, restricted or modified (\r\n<div class="li-bold">Statutory Rights</div>\r\n).</li>\r\n<li>If the Healthcare Provider is a consumer as defined in the ACL, the following notice applies to the Healthcare Provider from Doctoroo: &ldquo;Doctoroo guarantees that the Services supplied to the Healthcare Provider are rendered with due care and skill; fit for the purpose that Doctoroo advertises, or that the Healthcare Provider has told Doctoroo he, she or it is acquiring the Services for or for a result which the Healthcare Provider has told Doctoroo he, she or it wishes the Services to achieve, unless Doctoroo considers and discloses that this purpose is not achievable; and will be supplied within a reasonable time. To the extent Doctoroo is unable to exclude liability; Doctoroo&rsquo;s total liability for loss or damage suffered or incurred by the Healthcare Provider from the Services is limited to Doctoroo re-supplying the Services to the Healthcare Provider, or, at Doctoroo&rsquo;s option, Doctoroo refunding to the Healthcare Provider the amount he, she or it has paid Doctoroo for the Services to which his, her or its claim relates.&rdquo;</li>\r\n<li>Nothing in&nbsp;these Terms&nbsp;excludes a Healthcare Provider&rsquo;s Statutory Rights as a consumer under the ACL.&nbsp;Each Healthcare Provider agrees that Doctoroo&rsquo;s liability for Services provided to Healthcare Providers who are defined as consumers is governed solely by the ACL and these Terms.&nbsp;</li>\r\n<li>Doctoroo excludes all conditions and warranties implied by custom, law or statute except for the Healthcare Provider&rsquo;s Statutory Rights. Except for the Healthcare Provider&rsquo;s Statutory Rights, all material and work is provided to the Healthcare Provider without warranties of any kind, either express or implied, and Doctoroo expressly disclaims all warranties of any kind including but not limited to implied warranties of merchantability and fitness for a particular purpose.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">11. &nbsp;Refund Policy</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>Doctoroo will provide refunds as required under the Australian Consumer Law.</li>\r\n<li>Patients may cancel or reschedule confirmed consultations with Healthcare Providers up to one hour prior to the schedule start of the consultation or unconfirmed consultations without cancellation fee. If a Patient cancels or reschedules within one hour of the scheduled confirmed consultation, the booking fee for the consultation will be forfeited. If a Healthcare Provider misses a scheduled consultation by more than 15 minutes, the Patient will be entitled to refund of the booking fee.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">12. &nbsp;Intellectual Property</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>All logos, slogans, content, designs, diagrams, drawings, graphics, images, layouts, appearance, videos, ideas, methods, databases, codes, algorithms, software, fees, pricing, notes, documents, domain names, confidential information, copyright, rights in circuit layouts (or similar rights), registered or unregistered trade marks, trade names, patent, know-how, trade secrets and any other intellectual or industrial property whether such rights are capable of being registered or not (collectively Intellectual Property), including but not limited to copyright which subsists in all creative and literary works displayed on the Site, the App and Services, the layout, appearance and look of the Site and App, together with any applications for registration and any rights to registration or renewal of such rights anywhere in the world, whether created before or after the date of these Terms and whether used or contained in the Site or App is owned, controlled or licensed to Doctoroo (or its affiliates and/or third party licensors as applicable).</li>\r\n<li>The User agrees that, as between the User and Doctoroo, Doctoroo owns or holds the relevant licence to all Intellectual Property rights in the Site, the App and Services, and that nothing in these Terms constitutes a transfer of any Intellectual Property. The Intellectual Property, Site, App and Services are protected by copyright, trademark, patent, trade secret, international treaties, laws and other proprietary or industrial rights whether such rights are capable of being registered or not, and also may have security components that protect digital information only as authorised by Doctoroo or the owner of the content.</li>\r\n<li>Some Intellectual Property used in connection with the Site, App and Services are the trademarks of their respective owners (collectively\r\n<div class="li-bold">Third Party Marks</div>\r\n).</li>\r\n<li>Doctoroo&rsquo;s Intellectual Property and Third Party Marks may not be copied, imitated or used, in whole or in part, without the prior written permission of Doctoroo or the applicable trademark holder or Intellectual Property owner.</li>\r\n<li>Users of the Site and App do not obtain any interest or licence in the Intellectual Property or Third Party Marks without the prior written permission of Doctoroo or the applicable Intellectual Property owner. Users may not do anything which interferes with or breaches the Intellectual Property rights.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">13. &nbsp; User Licence</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>Subject to these Terms, Doctoroo grants the User a personal, non-exclusive, non-transferable, limited and revocable licence to use the Site, App and Services for its own personal and/or non-commercial use only on a computer or mobile device owned or controlled by the User as permitted in accordance with these Terms (\r\n<div class="li-bold">User Licence</div>\r\n), and not to use the Site, App and Services in any other way or for any other purpose, apart from local fair dealing legislation in accordance with the Copyright Act 1968 (Cth). All other uses are prohibited without Doctoroo&rsquo;s prior written consent.</li>\r\n<li>The right to use the Site, App and Services is licensed to the User and not being sold to the User. A User has no rights in the Site, App and Services other than to use it in accordance with these Terms.</li>\r\n<li>This Agreement and User Licence governs any updates to, or supplements or replacements for the Site, App and Services, unless separate Terms accompany such updates, supplements or replacements, in which case the separate Terms will apply.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">14. &nbsp; Permitted and Prohibited Conduct</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>The Healthcare Provider will not remove, alter or obscure any copyright, trademark, service mark or other proprietary rights notices incorporated in or accompanying the Site, App and Services, or Intellectual Property.</li>\r\n<li>The Healthcare Provider is solely responsible for compliance with any and all laws, rules, regulations, including but not limited to tax obligations that may apply to its use of the Site, App and Services.</li>\r\n<li>The Healthcare Provider must not post, upload, publish, submit or transmit any content that:\r\n<div class="butets-lists inner">\r\n<ol class="upp-roman">\r\n<li>infringes, misappropriates or violates a third party&rsquo;s patent, copyright, trademark, trade secret, moral rights or other intellectual property rights, or rights of publicity or privacy;</li>\r\n<li>is fraudulent, false, misleading or deceptive;</li>\r\n<li>denigrates Doctoroo, the Site, the App, Services, Patients, Healthcare Providers or Pharmacies;</li>\r\n<li>violates, or encourages any conduct that would violate, any applicable law or regulation or would give rise to civil liability;</li>\r\n<li>is defamatory, obscene, pornographic, vulgar, offensive, promotes discrimination, bigotry, racism, hatred, harassment or harm against any individual or group;</li>\r\n<li>is violent or threatening or promotes violence or actions that are threatening to any other person; or</li>\r\n<li>promotes illegal or harmful activities or substances.</li>\r\n</ol>\r\n</div>\r\n</li>\r\n<li>In connection with the Healthcare Provider&rsquo;s use of the Site, App and Services, the Healthcare Provider may not and agrees that it will not:\r\n<div class="butets-lists inner">\r\n<ol class="upp-roman">\r\n<li>use the Site, App or Services for any commercial or other purposes that are not expressly permitted by these Terms;</li>\r\n<li>register for more than one Account or register for an Account on behalf of another individual and/or entity;</li>\r\n<li>use the Services to find a Patient and then complete, or assist another individual to complete, the booking for a consultation or transaction independent of the Services in order to circumvent the obligation to pay any fees related to Doctoroo&rsquo;s provision of the Services;</li>\r\n<li>post any material or upload any content (including but not limited to User Content) that is offensive, contains nudity or inappropriate language, contains racial or religious ranting or discrimination or defames a Healthcare Provider, Patient or Pharmacy;</li>\r\n<li>submit any false or misleading information;</li>\r\n<li>as a Healthcare Provider, offer any healthcare services that it does not intend to honour or cannot provide;</li>\r\n<li>violate any local, state, provincial, national, or other law or regulation, or any order of a court, including, without limitation, zoning restrictions and tax regulations;</li>\r\n<li>copy, store or otherwise access any information contained on the Site, App and Services or content for purposes not expressly permitted by these Terms;</li>\r\n<li>infringe the rights of any person or entity, including without limitation, their intellectual property, privacy, publicity or contractual rights;</li>\r\n<li>use the Site, App or Services to transmit, distribute, post or submit any information concerning any other person or entity, including without limitation, photographs of others without their permission, personal contact information or credit, debit, calling card or account numbers;</li>\r\n<li>use the Site, App or Services in connection with the distribution of unsolicited commercial email, i.e. spam or advertisements;</li>\r\n<li>stalk or harass any other User of the Services or collect or store any personally identifiable information about any other User other than for purposes of transacting as a User on the Site or App;</li>\r\n<li>use, display, mirror or frame the Site or App, or any individual element within the Site or App, Services, Doctoroo&rsquo;s name, any Doctoroo trademark, logo or other Intellectual Property, information, or the layout and design of any page or form contained on a page, without Doctoroo&rsquo;s express written consent; or&nbsp;</li>\r\n<li>advocate, encourage, or assist any third party in doing any of the foregoing.</li>\r\n</ol>\r\n</div>\r\n</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">15. &nbsp; User Content</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>Users are permitted to post, upload, publish, submit or transmit relevant information and content (\r\n<div class="li-bold">User Content</div>\r\n). By making available any User Content or any Intellectual Property on or through the Site, App and Services, the User grants to Doctoroo a worldwide, irrevocable, perpetual, non-exclusive, transferable, royalty-free licence to use the User Content and Intellectual Property, with the right to use, view, copy, adapt, modify, distribute, license, sell, transfer, publicly display, publicly perform, transmit, stream, broadcast, access, or otherwise exploit such User Content and Intellectual Property on, through, or by means of the Site, App and Services. If Doctoroo uses any User Content, it will be in strict compliance with our Privacy Policy.</li>\r\n<li>illegal; or\r\n<div class="butets-lists inner">\r\n<ol class="upp-roman">\r\n<li>it is either the sole and exclusive owner of all User Content and Intellectual Property that it makes available through the Site, App and Services, or that it has all rights, licences, consents and releases that are necessary to grant to Doctoroo the rights in such User Content or Intellectual Property, as contemplated under these Terms; and</li>\r\n<li>neither the User Content nor the posting, uploading, publication, submission or transmittal of the User Content or Doctoroo&rsquo;s use of the User Content (or any portion thereof) on, through or by means of the Site, App and the Services will infringe, misappropriate or violate a third party&rsquo;s patent, copyright, trademark, trade secret, moral rights or other Intellectual Property rights, or rights of publicity or privacy, or result in the violation of any applicable law or regulation.</li>\r\n</ol>\r\n</div>\r\n</li>\r\n<li>Doctoroo may at its sole discretion remove any User Content that is offensive or in breach of these Terms.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">16. &nbsp; Disclaimers</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>Doctoroo does not guarantee that healthcare services or prescription fulfilment services will be requested by any Patients, nor does Doctoroo guarantee that Patients will be able to find desirable Healthcare Providers or Pharmacies.</li>\r\n<li>Doctoroo does not endorse any Healthcare Provider, Pharmacy or Patient. Doctoroo requires Healthcare Providers and Pharmacies to confirm that they have provided accurate information. Doctoroo performs some background searches on Healthcare Providers but cannot be held responsible for any inaccurate or false information provided by a Healthcare Provider.</li>\r\n<li>Users acknowledge that Doctoroo is designed for English speaking users and Doctoroo is not responsible for any language misunderstandings during the Services.</li>\r\n<li>Doctoroo accepts no responsibility for and makes no representations or warranties to any User or to any other person or entity as to the reliability, accuracy or completeness of the information contained on the Site or the App. Doctoroo disclaims any and all liability related to any and all Patients, Healthcare Providers, Pharmacies and any related services.</li>\r\n<li>By using the Site, App or Services, each User agrees that any legal remedy or liability that it seeks to obtain for actions or omissions of Healthcare Providers, Patients, Pharmacies or other third parties will be limited to a claim against the Healthcare Providers, Patients, Pharmacy or other third party who caused it harm.</li>\r\n<li>To the fullest extent allowable under applicable law, Doctoroo disclaims all warranties, representations and conditions, whether express or implied, including any warranties, representations and conditions that the Site, App or Services are merchantable, of satisfactory quality, reliable, accurate, complete, suitable or fit for a particular purpose or need, non-infringing or free of defects or errors.</li>\r\n<li>For the avoidance of doubt, Doctoroo is not responsible for any duties, fees, taxation, visa or immigration matters associated under these Terms. Doctoroo advises that all Healthcare Providers using the Site, App and Services should seek advice in relation to these matters.</li>\r\n<li>Each Healthcare Providers, Patients, Pharmacy who uses the Site, App and the Services does so at their own risk</li>\r\n<li>Doctoroo excludes all express and implied conditions and warranties, except for the Healthcare Provider&rsquo;s Statutory Rights, to the fullest extent permitted by law, including but not limited to:\r\n<div class="butets-lists inner">\r\n<ol class="upp-roman">\r\n<li>iDoctoroo expressly disclaims any implied or express guarantees, warranties, representations or conditions of any kind, which are not stated in these Terms;</li>\r\n<li>Doctoroo does not warrant that the Site, the App, the Services, content on the Site or App (including pictures, videos, sound clips, resumes, links etc.), or the Healthcare Provider&rsquo;s access to the Site, the App or the Services will be error free, that any defects will be corrected or that the Site, the App or the server which stores and transmits material to the Healthcare Provider is free of viruses or any other harmful components</li>\r\n<li>Doctoroo takes no responsibility for, and will not be liable for, the Site, the App, the Services, the Healthcare Providers, Pharmacies, Patients or related services being unavailable, of a particular standard of workmanship, failing to meet the relevant User&rsquo;s needs, or being of less than merchantable quality; and</li>\r\n<li>Doctoroo will not be liable for any loss, damage, costs or expense whether direct, indirect, incidental, special, consequential and/or incidental, including lost profits, loss of data or loss of goodwill, service interruption, computer damage or system failure or the cost of substitute products or services, or for any damages for personal, bodily injury, death or emotional distress, loss of revenue, production, opportunity, access to markets, goodwill, reputation, use or any indirect, remote, abnormal or unforeseeable loss, or any loss or damage relating to business interruption, loss of programs or other data on the Healthcare Provider&rsquo;s information systems or costs of replacement goods, or otherwise, suffered by the Healthcare Provider or claims made against the Healthcare Provider, arising out of or in connection with the Site, the App, Services, content on the Site or App, inability to access or use the Site, the App, the Services, any healthcare services or the Terms, even if Doctoroo was expressly advised of the likelihood of such loss or damage.</li>\r\n</ol>\r\n</div>\r\n</li>\r\n<li>The Healthcare Provider agrees not to attempt to impose liability on, or seek any legal remedy from Doctoroo with respect to such actions or omissions.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">17. &nbsp; Limitation of Liability</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>To the extent permitted by law, Doctoroo&rsquo;s total liability arising out of or in connection with the Site, the App, the Services or the Terms, however arising, including under contract, tort, negligence, in equity, under statute or otherwise, is limited to Doctoroo re-supplying the Services to the Healthcare Provider, or, at Doctoroo&rsquo;s option, Doctoroo refunding to the Healthcare Provider the amount it paid for the Services to which its claim relates. Doctoroo&rsquo;s total liability to the Healthcare Provider for all damages in connection with the Services will not exceed the price paid by the Healthcare Provider under these Terms for the 12 months period prior to the act which gave rise to the liability, or one hundred dollars (AUD$100) if no such payments have been made.</li>\r\n<li>The limitations of damages set forth above are fundamental elements of the basis of the bargain between Doctoroo and the Healthcare Provider. Some jurisdictions do not allow the exclusion or limitation of liability for consequential or incidental damages, so the above limitation may not apply to the Healthcare Provider.</li>\r\n<li>This limitation of liability reflects the allocation of risk between the parties. The limitations specified in this section will survive and apply even if any limited remedy specified in these terms is found to have failed of its essential purpose. The limitations of liability provided in these terms inure to the benefit of Doctoroo.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">18. &nbsp; Indemnity</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>Each Healthcare Provider agrees to defend and indemnify and hold Doctoroo (and Doctoroo&rsquo;s parent, related bodies corporate, officers, directors, contractors, employees and agents) harmless from and against any claims, actions, suits, demands, damages, liabilities, costs or expenses (including legal costs and expenses on a full indemnity basis), including in tort, contract or negligence, arising out of or connected to the Healthcare Provider&rsquo;s use of or access to the Services; any breach by the Healthcare Provider of these Terms; any wilful, unlawful or negligent act or omission by the Healthcare Provider; and any violation by the Healthcare Provider of any applicable laws or the rights of any third party.</li>\r\n<li>Doctoroo reserves the right to assume the exclusive defence and control of any matter otherwise subject to indemnification by the Healthcare Provider, in which event the Healthcare Provider will cooperate in asserting any available defences.</li>\r\n<li>This defence and indemnification obligation will survive these Terms and the Healthcare Provider&rsquo;s use of the Site, App or Services. These Terms, and any rights and licences granted hereunder, may not be transferred or assigned by the Healthcare Provider, but may be assigned by Doctoroo without restriction.</li>\r\n</ul>\r\n</div>\r\n<div class="content-head">19. &nbsp; General</div>\r\n<div class="butets-lists">\r\n<ul>\r\n<li>\r\n<div class="li-bold">Accuracy:</div>\r\nWhile Doctoroo will endeavour to keep the information up to date and correct, Doctoroo makes no representations, warranties or guarantee, express or implied, about the completeness, accuracy, reliability, suitability or availability of any information, images, products, services, or related graphics contained on the Site or App for any particular purpose. The Healthcare Provider hereby acknowledges that such information and materials may contain mistakes, inaccuracies or errors and Doctoroo expressly excludes any liability for such to the fullest extent permissible by law.</li>\r\n<li>\r\n<div class="li-bold">Termination:</div>\r\nDoctoroo reserves the right to refuse supply of the Services required by any Healthcare Provider, terminate any Healthcare Provider&rsquo;s Account, terminate its contract with any Healthcare Provider, and remove or edit content on the Site or App, if the Healthcare Provider commits a non-remediable breach or a remediable breach that is not remedied within 5 days, in its sole discretion. If Doctoroo decides to terminate a Healthcare Provider&rsquo;s Account any of the following may occur, with or without notice to the Healthcare Provider: (a) the Healthcare Provider&rsquo;s Account will be deactivated, its password will be disabled and it will not be able to access the Site, App, Services, its Account or its User Content; (b) any pending or future consultations will be immediately terminated; (c) Doctoroo may communicate to the relevant Patient that the consultation has been cancelled; (d) Doctoroo may refund the Patient in full, regardless of the cancellation and refund policy; and (e) the Healthcare Provider will not be entitled to any compensation for consultations that were cancelled as a result of a suspension, deactivation or termination of their Account.</li>\r\n<li>\r\n<div class="li-bold">Fraudulent Activities:</div>\r\nDoctoroo reserves the right to refuse supply of the Services required by any Healthcare Provider, terminate any Healthcare Provider&rsquo;s Account, terminate its contract with any Healthcare Provider, and remove or edit content on the Site or App, if the Healthcare Provider commits a non-remediable breach or a remediable breach that is not remedied within 5 days, in its sole discretion. If Doctoroo decides to terminate a Healthcare Provider&rsquo;s Account any of the following may occur, with or without notice to the Healthcare Provider: (a) the Healthcare Provider&rsquo;s Account will be deactivated, its password will be disabled and it will not be able to access the Site, App, Services, its Account or its User Content; (b) any pending or future consultations will be immediately terminated; (c) Doctoroo may communicate to the relevant Patient that the consultation has been cancelled; (d) Doctoroo may refund the Patient in full, regardless of the cancellation and refund policy; and (e) the Healthcare Provider will not be entitled to any compensation for consultations that were cancelled as a result of a suspension, deactivation or termination of their Account.</li>\r\n<li>\r\n<div class="li-bold">Force Majeure:</div>\r\nDoctoroo will not be liable for any delay or failure to perform its obligations under the Terms if such delay is due to any circumstance beyond its reasonable control.</li>\r\n<li>\r\n<div class="li-bold">Notice:</div>\r\nAny notice in connection with the Terms will be deemed to have been duly given when made in writing and delivered or sent by email or post to the party to whom such notice is intended to be given or to such other address or email address as may from time to time be notified in writing to the other party.</li>\r\n<li>\r\n<div class="li-bold">Waiver:</div>\r\nAny failure by a party to insist upon strict performance by the other of any provision in the Terms will not be taken to be a waiver of any existing or future rights in relation to the provision. No waiver by Doctoroo of any of the Terms shall be effective unless Doctoroo expressly states that it is a waiver and Doctoroo communicates it to the Healthcare Provider in writing.</li>\r\n<li>\r\n<div class="li-bold">Assignment:</div>\r\nA Healthcare Provider must not assign any rights and obligations under the Terms whether in whole or in part without Doctoroo&rsquo;s prior written consent.</li>\r\n<li>\r\n<div class="li-bold">Severability:</div>\r\nIf any of the Terms are determined by any competent authority to be invalid, unlawful or unenforceable to any extent, such term, condition or provision will to that extent be severed from the remaining terms, conditions and provisions which will continue to be valid to the fullest extent permitted by law.</li>\r\n<li>\r\n<div class="li-bold">Jurisdiction and Applicable Law:</div>\r\nThese Terms, use of this Site, the App, the Services and any dispute arising out of any Healthcare Provider&rsquo;s use of the Site, App or Services is subject to the laws of New South Wales, Australia, and subject to the exclusive jurisdiction of the New South Wales courts. The Site and App may be accessed throughout Australia and overseas. Doctoroo makes no representation that the content of the Site and App complies with the laws (including intellectual property laws) of any country outside Australia. If a Healthcare Provider accesses the Site or App from outside Australia, it does so at its own risk and are responsible for complying with the laws in the place where he/she accesses the Site or App.</li>\r\n<li>\r\n<div class="li-bold">Entire Agreement:</div>\r\nThese Terms and any document expressly referred to in them represent the entire agreement between Doctoroo and each Healthcare Provider, and supersede any prior agreement, understanding or arrangement between Doctoroo and each Healthcare Provider, whether oral or in writing.</li>\r\n</ul>\r\n</div>\r\n<div class="address-block">\r\n<div class="content-head">For questions and notices, please contact:</div>\r\n<div class="address-text"><span>Doctoroo Australia Pty Ltd ABN 15616602629</span> <span>Level 13/50 Carrington Street</span> <span>Sydney 2000, New South Wales</span> <span>Australia</span> <span>wecare@doctoroo.com.au</span>\r\n<div class="address-text bottom"><span><span class="address-te-bold">Last update:</span>August 2017</span></div>\r\n</div>\r\n</div>\r\n</div>', 'Healthcare Provider Marketplace Terms & Condition', 'Healthcare Provider Marketplace Terms & Condition', 'Healthcare Provider Marketplace Terms & Condition', 'Active', '2018-01-02 16:05:49', '2018-01-02 16:05:49');
INSERT INTO `dod_email_template` (`id`, `template_name`, `template_subject`, `template_from`, `template_from_mail`, `template_html`, `template_variables`, `deleted_at`, `created_at`, `updated_at`) VALUES
(6, 'Account Activation', 'Doctoroo-Verify Your Account', 'Doctoroo', 'doctorOO@webwing.com', '<h2>Verify Your Email Address</h2>\n<p>&nbsp;</p>\n<p>&nbsp;Hello<strong> ##USER_FNAME##, </strong></p>\n<div style="text-align: left;"><br />Thank you&nbsp;&nbsp;for creating an account with&nbsp;&nbsp;##APP_NAME##.</div>\n<div style="text-align: left;">&nbsp;</div>\n<div style="text-align: left;">You are successfully register with us and now you have to complete our authentication process. You have to verify your account by clicking following activation button.</div>\n<div style="text-align: left;">&nbsp;</div>\n<div style="text-align: left;">&nbsp;</div>\n<div style="text-align: center;">&nbsp;</div>\n<div style="text-align: center;">&nbsp;</div>\n<div style="text-align: center;"><strong>Please click on below button to verify your account.</strong></div>\n<div style="text-align: center;">&nbsp;</div>\n<div style="text-align: center;">&nbsp;</div>\n<div style="text-align: center;">##ACTIVATION_URL## .<br /><br /></div>\n<div style="text-align: center;">&nbsp;.</div>\n<div>&nbsp;</div>\n<div>&nbsp;</div>\n<div>Thanks and Regards,<br />&nbsp;##APP_NAME##</div>', '##USER_FNAME##~##APP_NAME##~##ACTIVATION_URL##~##EMAIL##', NULL, '2016-05-15 12:12:14', '2017-05-25 05:43:58'),
(7, 'Forgot Password', 'Doctoroo-Forget Password', 'Doctoroo', 'doctorOO@webwing.com', '<p>Hello <strong>##FIRST_NAME##</strong> ,</p>\n<p>You forget your password, don''t worry. Our system help you to reset your password easily.</p>\n<p>Following &nbsp;are the details of your account. You can now set your new password by just click on following button.</p>\n<p>&nbsp;</p>\n<p><strong>Account Details:</strong></p>\n<table>\n<tbody>\n<tr>\n<td style="width: 103px;"><strong>Username</strong></td>\n<td style="width: 485px;">##EMAIL##</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p style="text-align: center;"><strong>Reset Your Password Just Click On Following Button</strong></p>\n<p style="text-align: center;">&nbsp;</p>\n<p style="text-align: center;">##REMINDER_URL##</p>\n<p style="text-align: left;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p style="text-align: left;">&nbsp;</p>\n<p style="text-align: left;">&nbsp;</p>\n<p style="text-align: left;"><br /><br />Thanks and Regards, &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; <br />##SITE_URL## &nbsp;&nbsp;</p>', '##FIRST_NAME##~##EMAIL##~##REMINDER_URL##~##SITE_URL##', NULL, '2016-05-15 14:43:47', '2017-03-02 23:44:37'),
(38, 'Patient - Account verification Email Template', 'Doctoroo-verify your account', 'Doctoroo', 'doctorOO@webwing.com', '<p>Hello ##FIRST_NAME## ,<br /><br /></p>\r\n<p>Welcome to Doctoroo. To verify your account please click following link</p>\r\n<p>##ACTIVATION_LINK##</p>\r\n<div>&nbsp;</div>\r\n<div>Now that you''re part of the doctoroo community, you have access to a powerful medical app at your finger tips. You''ll also be among the first to hear about upcoming updates, free health tips &amp; prizes!</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>Share us with your friends, so we can take of them too link to copy &amp; share or button that creates an email with invitation<br /><br /><br /> Thanks &amp; Regards ,<br />##APP_NAME##<br />&nbsp;</div>\r\n<div style="text-align: center; color: #51ab51;">Stay connected with the community !</div>\r\n<div style="text-align: center; color: #51ab51;">&nbsp;</div>\r\n<div style="text-align: center;">Be the first to know when we launch</div>\r\n<div style="text-align: center;">&nbsp;</div>', '####FIRST_NAME####~####ACTIVATION_LINK####~####APP_NAME####', NULL, '2017-02-22 18:01:25', '2017-10-03 10:34:01'),
(39, 'Send Account Credential', 'Doctoroo-Account Credential', 'Doctoroo', 'doctorOO@webwing.com', '<p>Hello <strong>##FIRST_NAME##</strong> ,</p>\r\n<p>Following &nbsp;are the credential of your account,You can login to your account using these credential.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Account Credential:</strong></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td style="width: 103px;"><strong>Username</strong></td>\r\n<td style="width: 485px;">##EMAIL##</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 103px;"><strong>Password</strong></td>\r\n<td style="width: 485px;">##PASSWORD##</td>\r\n</tr>\r\n\r\n</tbody>\r\n</table>\r\n\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;"><br /><br />Thanks and Regards, &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; <br />##APP_NAME## &nbsp;&nbsp;</p>', 'NA', NULL, NULL, NULL),
(40, 'member_unlink', 'Doctoroo-Member Unlink', 'Doctoroo', 'doctorOO@webwing.com', '<p>Hello ##MEMBER## ,<br /><br /></p>\r\n<p>##SENDER## has <strong>unlink</strong> you. Please Click following link&nbsp; to unlink your account.</p>\r\n<p>##UNLINK##</p>\r\n<p><br /> Thanks &amp; Regards ,<br />##APP_NAME##<br />&nbsp;</p>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>', '##MEMBER##', NULL, '2017-07-06 18:07:36', '2017-07-28 17:35:48'),
(41, 'patient-account_details_set', 'Doctoroo-Account Details set', 'Doctoroo', 'doctoroo@webwing.com', '<p>Hello ##MEMBER## ,</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Your Account has been configured successfully, click following button to set your account details.</p>\r\n<p>##PASSWORDSET##</p>\r\n<p><br /> Thanks &amp; Regards ,<br />##APP_NAME##<br />&nbsp;</p>', '##MEMBER##~##PASSWORD_SET##~####', NULL, '2017-07-07 09:40:35', '2017-11-04 09:31:16'),
(42, 'invitation', 'Join Doctoroo', 'Doctoroo', 'doctoroo@webwing.com', '<p>Hello ##MEMBER## ,</p>\r\n<h1 style="text-align: center;"><strong>You''ve been invited to</strong></h1>\r\n<h1 style="text-align: center;"><strong> join Doctoroo family</strong></h1>\r\n<p>&nbsp;</p>\r\n<p>Please click on Accept invitation to join Doctoroo</p>\r\n<p style="text-align: center;"><strong>&nbsp;##ACCEPT##</strong></p>\r\n<p><br /> Thanks &amp; Regards ,<br />##APP_NAME##<br />&nbsp;</p>', '##ACCEPT##', NULL, '2017-07-13 10:21:46', '2017-07-29 08:55:42'),
(43, 'User Login from New Device', 'User Login from New Device', 'ADMIN', 'doctoroo@webwing.com', '<p>Hi ##FIRST_NAME## ,<br /><br /></p>\r\n<p class="textbox" dir="ltr">We noticed a recent sign-in to your doctoroo account from an unknown device or browser.</p>\r\n<p class="textbox" dir="ltr">&nbsp;</p>\r\n<div><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Time: &nbsp;##CURRENT_DATETIME##.</strong></div>\r\n<div><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Browser:</strong> &nbsp;##BROWSER_OS##</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>\r\n<p class="textbox" dir="ltr"><strong>If this is you</strong>, no further action is required.</p>\r\n<p class="textbox" dir="ltr"><strong>If you don&rsquo;t recognize this activity</strong>, please&nbsp;reset your password&nbsp;immediately.</p>\r\n<p class="textbox" dir="ltr">&nbsp;</p>\r\n<p class="textbox" dir="ltr">Security is important to us at doctoroo, and we&rsquo;ll inform you if we notice unrecognised logins&nbsp;in your account. Please note that we may be unable to&nbsp;recognise a sign-in attempt when&nbsp;you&rsquo;ve cleared your cookies or are logged in under private browsing mode.</p>\r\n<p class="textbox" dir="ltr">Warm regards,</p>\r\nThe ##APP_NAME## team</div>\r\n<div>Taking care of you</div>\r\n<div style="text-align: center;">&nbsp;</div>', '####FIRST_NAME####~####APP_NAME####~####BROWSER_OS####~####CURRENT_DATETIME####', NULL, '2017-09-15 11:57:46', '2017-11-04 10:09:44'),
(44, 'Doctor - Account verification Email Template', 'Doctoroo - Approvable for the Doctor Sign-up', 'Doctoroo', 'doctorOO@webwing.com', '<p>Hello ##FIRST_NAME## ,<br /><br /></p>\r\n<p>Welcome to Doctoroo. Admin has approve your application for account please click following link</p>\r\n<p>##ACTIVATION_LINK##</p>\r\n<div>&nbsp;</div>\r\n<div>Now that you''re part of the doctoroo community, you have access to a powerful medical app at your finger tips. You''ll also be among the first to hear about upcoming updates, free health tips &amp; prizes!</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>Share us with your friends, so we can take of them too link to copy &amp; share or button that creates an email with invitation<br /><br /><br /> Thanks &amp; Regards ,<br />##APP_NAME##<br />&nbsp;</div>\r\n<div style="text-align: center; color: #51ab51;">Stay connected with the community !</div>\r\n<div style="text-align: center; color: #51ab51;">&nbsp;</div>\r\n<div style="text-align: center;">Be the first to know when we launch</div>\r\n<div style="text-align: center;">&nbsp;</div>', '####FIRST_NAME####~####ACTIVATION_LINK####~####APP_NAME####', NULL, '2017-02-22 18:01:25', '2017-10-03 10:34:01'),
(45, 'Patient - Change profile type', 'Doctoroo - Change Profile type', 'Doctoroo', 'doctoroo@webwing.com', '<p>Hello ##PATIENT_NAME## ,</p>\r\n<p>##DOCTOR_NAME## ##MSG## Click following link if you want to change your profile type.</p>\r\n<p>&nbsp;</p>\r\n<p>##CHANGE_TYPE_BTN##</p>', '####CHANGE_TYPE_BTN####~####PATIENT_NAME####~####DOCTOR_NAME####~####MSG####', NULL, '2017-10-23 14:04:19', '2017-11-09 17:31:15');
