INSERT INTO `dod_faqs` (`id`, `category_id`, `question`, `slug`, `answer`, `status`, `created_at`, `updated_at`) VALUES
(5, 7, 'What is Best Doctors and what services does Best Doctors provide?', 'what-is-best-doctors-and-what-services-does-best-doctors-provide', 'We bring together the best medical minds in the world to help people get the right diagnosis and treatment.', 'Active', '2017-02-24 01:57:24', '2017-07-25 10:54:59'),
(6, 7, 'What is Doctor Timing or When  Patient can call Doctor', 'what-is-doctor-timing-or-when-patient-can-call-doctor', '9-7pm', 'Active', '2017-02-26 18:04:59', '2017-07-25 10:55:21'),
(7, 7, 'What is the cost of doctors', 'what-is-the-cost-of-doctors', '$20                    ', 'Active', '2017-02-28 17:42:28', '2017-07-25 10:55:41'),
(8, 7, 'What is Doctoroo', 'what-is-doctoroo', 'Doctoroo is an online platform allowing Healthcare professionals to offer their services online - through video visits, digital', 'Active', '2017-02-28 20:28:19', '2017-07-25 10:55:54'),
(9, 1, 'How many doctors available at evening?', 'how-many-doctors-available-at-evening', 'I''ts depend on condition.                    ', 'Active', '2017-07-17 14:58:56', '2017-07-25 08:51:51'),
(10, 1, 'What is doctoroo?', 'what-is-doctoroo', 'Doctoroo is a online system that helps patients and doctors', 'Active', '2017-07-17 15:47:51', '2017-07-25 08:51:53'),
(11, 1, 'How do I schedule medical appointments with a specialist at Doctor Today?', 'how-do-i-schedule-medical-appointments-with-a-specialist-at-doctor-today', 'You or your attendant can contact the International Patients Service Centre of the location of your choice, via telephone, fax, email or letter. Details are available at the Contact us section of this website. Alternatively, you can fill in the form available in the website in the Contact Us section.\r\n', 'Active', '2017-07-19 12:54:49', '2017-07-25 08:51:55'),
(12, 1, 'When making a medical appointment what information must I provide?', 'when-making-a-medical-appointment-what-information-must-i-provide', 'You must provide all relevant information on your medical condition, including scans, medical history, and current medication etc.If you have been referred to Doctor Today by a doctor in your home city, please carry the contact details of the doctor.\r\n', 'Active', '2017-07-19 12:55:30', '2017-07-25 04:26:10'),
(13, 1, 'Will Doctor Today assist me if i required in house hospitalization ?', 'will-doctor-today-assist-me-if-i-required-in-house-hospitalization-', 'Yes. Doctor Today offers 8% discount on your total in patient bill if you got admitted at our impaneled  hospital.\r\n', 'Active', '2017-07-19 12:55:50', '2017-07-25 08:51:58'),
(14, 1, 'Without a referral from my local doctor, can I seek an appointment with a specialist at Doctor Today?', 'without-a-referral-from-my-local-doctor-can-i-seek-an-appointment-with-a-specialist-at-doctor-today', 'Yes. You can contact the Doctor Today Patients centre of our various Doctor Today locations directly, with details of your medical history and treatment sought. Our Patient Service Co-ordinators will recommend and also schedule an appointment, with an appropriate specialist.\r\n', 'Active', '2017-07-19 12:56:05', '2017-07-25 08:52:00'),
(15, 1, 'Will someone guide me on the duration and cost of treatments?', 'will-someone-guide-me-on-the-duration-and-cost-of-treatments', 'Definitely. Once you have consulted the appropriate specialist, our Relationship Manager will give you a complete plan on the approximate length of stay at the hospitals and the total cost of the treatment, along with the necessary pre/post treatment care.\r\n', 'Active', '2017-07-19 12:56:23', '2017-07-25 08:52:02'),
(16, 1, 'Can I claim the medical expenses from my health Insurance Provider?', 'can-i-claim-the-medical-expenses-from-my-health-insurance-provider', 'Doctor Today do not offer services as a Insurance provider although we provide or treat our patients in ‘Multispecialty clinics’ across the India.\r\n', 'Active', '2017-07-19 12:57:04', '2017-07-25 08:52:04'),
(17, 1, 'What are the modes of payment available ?', 'what-are-the-modes-of-payment-available-', 'We accept all major credit cards like VISA, MASTER CARD, AMEX & CIRRUS and Traveler’s cheques. We also have an online payment gateway in our website for select locations.\r\n', 'Active', '2017-07-19 12:57:23', '2017-07-25 08:52:06');
