(7, 'After hours home Doctor', 'after-hours-home-doctor', 'After hours home Doctor', 'GP available 24/7, anywhere you are, using any device\r\n. ', '24/7 Hour Home Doctor |  After Hours GP Helpline | Doctors Open Sunday', '24 7 doctor, 24 hour doctor, after hours doctor, after hours gp, after hours gp helpline, doctors open on Sunday, home doctor, doctor at home, house doctor, house call doctor, home doctor service, home visit doctor, national home doctor', 'AFTER HOURS HOME DOCTOR ', 'Do you need an after hours GP help? Doctoroo offers online doctor 24/7 hour service. Doctors Open On Sunday providing you with the best care at home when you need it.', 'We ’ ve all been there ', 'Feeling sick, needing help from a doctor quickly, and realising \r\nthat the doctor\r\n’\r\ns clinic is closed after \r\nhours or on a Sunday. Sometimes we\r\n’\r\nre just too busy to go during the day, and by the time we arrive \r\nhome, there\r\n’\r\ns no time to go to the medical centre and get a check-up. At other \r\ntimes, the last thing \r\nwe want to do whilst sick is travelling to and waiting for hours at the d\r\noctor\r\n’\r\ns office \r\n–\r\n to then only be \r\nseen for a few minutes.  ', 'Doctors available for you, when you need them most ', 'We no longer need to wait to get treated, while having sleepless nights \r\nuntil the doctors open the \r\nnext day. Our \r\nGP\r\n’\r\ns are available: \r\n<br>\r\n1.\r\n24 hours a day \r\n<br>\r\n2.\r\n7 days a week \r\n<br>\r\n3.\r\nAfter hours every day (including Saturday and Sunday) \r\n<br>\r\n4.\r\n365 days a year ', 'after-hours-home-doctor', 'after-hours-home-doctor', 'after-hours-home-doctor', 'How does doctoroo work? ', 'Doctoroo is a telemedicine platform created by a Medical Scientist, with advi\r\nce from a select team \r\nof doctors, pharmacists and health experts, doctoroo delivers healthcare to \r\nAustralians anytime, \r\nanywhere.  \r\nWe have a range of doctors on our platform, who are qualified, experienced, insured, \r\ncaring and \r\nspeak a range of languages. You can sign up for free, choose a doctor, select a sui\r\ntable time, pay & \r\nconfirm your booking. You\r\n’\r\nll then receive a reminder 5 minutes before your consultation, after \r\nwhich the doctor will then call you via the app.  ', '', 'yes', 'Benefits of Telemedicine', 'With increasing number of Australians using telemedicine every year (MBS Onli\r\nne, 2016 Link: \r\nhttp://www.mbsonline.gov.au/internet/mbsonline/publishing.nsf/Cont\r\nent/connectinghealthservice\r\ns-factsheet-stats\r\n ), there are many situations and people that would greatly benefit from \r\nTelemedicine, including: ', 'Being filled with sick people, Medical Centres sometimes are why we catch the flu \r\nor a virus ', 'How much does it cost?', 'Although no one can put a price on a person’s health, it’s completely free to signup & use our app. \r\nYou’ll only need to pay when you book a doctor.  \r\nAs Australia’s most affordable way to see a doctor online, consultations start from just $28, with the average consultation being around 7-8 minutes, costing just $38.  \r\nFor full pricing details, [View our Pricing] ', 'What can you do on doctoroo?', 'Besides being a 24 hour online medical centre and an after hours GP helpline \r\nfor you to use anytime, \r\nyour account allows you to: ', 'You may be asking yourself, how exactly can a doctor dia\r\ngnose and treat me online? \r\nWhen we set out to make your healthcare easier, we knew that we could never replac\r\ne a traditional, \r\nin\r\n-person consultation with Doctors, and we haven\r\n’\r\nt tried to. What we have done instead, is offer a \r\ncomplimentary service where you can use our platform for issues that don\r\n’\r\nt require physical \r\nexamination.  \r\n', 'How do I get started? ', 'Taking care of your health doesn\r\n’\r\nt need to be complicated, and with Doctoroo, it\r\n’\r\ns just one click \r\naway \r\n–\r\n from seeing a doctor, getting treatment and your medications delivered t\r\no you or ready to \r\ncollect from your nearest pharmacy.  \r\nButton: Make an Account for Free ', '2017-11-22 07:06:02', '2017-11-22 12:36:02'),
(8, 'Online Doctor Consultations', 'online-doctor-consultations', 'Online Doctor Consultations', 'Online Doctor Consultations', 'Book Online Doctors Appointment Australia | Online Doctor Consultation', 'book doctor online, doctor online australia, doctors online, online doctor, book online appointment, online doctor service, online doctor consultation', 'Online Doctor Consultations', 'Book doctor online consultation in just a single-click. Fix an appointment with specialist doctors and get an online doctor consultation at home. 24/7 hour doctor assistance.', 'Online Doctor Consultations', 'By simply making an account, you can book a doctor in less than a \r\nminute using your phone or \r\ncomputer. Our doctors are available for you 24 hours a day, 365 days \r\nevery year. Here\r\n’\r\ns a quick \r\nou\r\ntline of how it works: \r\n1.\r\nMake an Account \r\n\r\n2.\r\nSearch for a Doctor (by name, gender, language, time) \r\n3.\r\nConfirm booking & pay \r\n4.\r\nAwait a call from your doctor \r\n5.\r\nReceive advice, medical certificate, prescription or referrals right after the call\r\n6.\r\nPickup your medication from your local pharmacy, or have it delivered to\r\n you ', 'Online Doctor Consultations', 'Online Doctor Consultations', 'Online Doctor Consultations', 'Online Doctor Consultations', 'Online Doctor Consultations', 'Online Doctor Consultations', 'Online Doctor Consultations', '', 'no', '', '', '', '', '', '', '', '', '', '', '2017-11-22 08:26:45', '2017-11-22 13:56:46'),
(9, 'Online Doctors', 'online-doctors', 'Online Doctors', 'Online Doctors', 'Online Doctors', 'Online Doctors', 'Online Doctors', 'Online Doctors', ' Online Doctors', ' Online Doctors', ' Online Doctors', 'Online Doctors', ' Online Doctors', 'Online Doctors', 'Online Doctors', 'Online Doctors', 'Online Doctors', '', 'no', '', '', '', '', '', '', '', '', '', '', '2017-03-31 03:15:45', '2017-03-30 21:45:45'),
(10, 'Online Doctors Certificate', 'online-doctors-certificate', 'Online Doctors Certificate', 'Get a Medical Certificate anywhere in Australia ', 'How to Get Online Medical Certificate | Online Doctor Service Australia', 'how to get a medical certificate, medical certificate, medical certificate australia, medical certificates online, online medical certificate online medical advice, online doctors australia, online doctor service', 'Online Doctors Certificate ', 'Getting a medical certificate from an online doctor saves a lot of times. The online doctors at doctoroo  may be able to help. Get your medical certificate online now.', 'Convenient. Easy. Affordable. ', 'It\r\n’\r\ns ironic that when we\r\n’\r\nre sick, doctors tell us to \r\nrest in bed\r\n yet we had to get out of bed to get \r\nthat advice. With doctoroo, that\r\n’\r\ns no longer the case, with medical certificates now easily obtainable \r\nonline using any device, anytime, anywhere you are in Australia.  ', 'How is it possible to get a medical certificate online? ', 'Our telemedicine platform was designed by a Medical Scientist to ensure that it was \r\nquick and easy \r\nto get your medical certificate when you need it most. It takes less than \r\n60 seconds to book a doctor \r\nand most consultations take less than 5 minutes, where the doctor can act\r\nually diagnose you, offer \r\ntreatment, and write up your medical certificate, which will be available for \r\ndownload right after \r\nyour call\r\nWhat\r\n’\r\ns included in our sick notes? \r\n<br>\r\n1.\r\nDoctors details \r\n<br>\r\n\r\n2.Date of absence \r\n<br>\r\n3.\r\nReason for absence (if required) \r\n<br>\r\n4.\r\nRecommendations about how and when you''ll be able to return to your du\r\nties \r\n?<br>\r\n5.\r\nWhether you''re able to return to your duties with amended responsibilities (e.g\r\n. no heavy \r\nlifting or reduced hours) \r\n<br>\r\n6.\r\nInstructions on how your employer or institution can authenticate \r\nthe validity of the sick \r\nnote ', 'Online Doctors Certificate', 'Online Doctors Certificate', 'Online Doctors Certificate', 'Is the Medical Certificate Official? ', 'Of course! The Medicate Certificate sent to you follows the guidelines out\r\nlined by the AMA \r\n(Australian Medical Association). It\r\n’\r\nll have all the doctors\r\n’\r\n details, the date of absence and the \r\nreason for absence, as well as all other required details.  \r\nThe Medicate Certificate supplied to you meets all Australian Laws and Regulati\r\nons, the \r\nrequirements of the Fair Work Act and the guidelines set by the AMA. The M\r\nedical Certificate can \r\neasily be verified by contacting the appropriate Doctor. \r\nThe medical certificate will be available for download as a PDF in your doc\r\ntoroo account, which you \r\ncan then easily download and email to your company or institution. ', '', 'yes', 'What can you use the medical certificate for?', 'We understand that many organisations, companies and institutions require \r\nyou to have a Doctor\r\n’\r\ns \r\nCertificate when you\r\n’\r\nre absent or know you\r\n’\r\nll be absent. Our medical certificates can be used for all \r\nsituations, including: ', 'Most other situations - as you would with a traditional certificate', 'How much does a medical certificate cost?', 'Although there is no set cost for a medical certificate, seeing a doc\r\ntor online on our platform is the \r\nmost affordable in Australia. Most medical certificate consultations cost just\r\n $28.  \r\nFor full pricing details, [Visit our Pricing Page.] ', 'What conditions can I get a medical certificate for? ', 'Most conditions can be given a medical certificate for, although some \r\nmay require an in-persn \r\ndoctor visit to get proper diagnosis and treatment. Some of the common\r\n conditions you can receive \r\na medical certificate for include: ', 'Why do I need to a see a doctor to get my medical certif\r\nicate? \r\nSometimes we may think we have a simple illness and misdiagnose it as the \r\nflu, a harmless headache \r\nor stomach ache and self-treat it. In order to avoid this, and for \r\ndoctors to actually ask you questions \r\nabout your condition in case its more serious than you had thoug\r\nht, to get a medical certificate you\r\n’\r\nll need to see a doctor who can also offer you advice on how to get b\r\netter soon and any treatment \r\nyou need. Most medical certificate consultations take less than 5 minute\r\ns and can be done from \r\nanywhere. \r\nCan my employer, school, university or sports club chec\r\nk the validity?\r\nYour employer or institution can easily verify the details contained wit\r\nhin your sick note, the time of \r\nconsultation and the doctor who you had a consultation. This is do\r\nne directly with us, which means \r\nyou won''t need to do anything else', 'How do I get started?', 'Getting started is easy and free. Click the button below to make an account, and see a doctor today! {Make a Free Account} ', '2018-01-04 14:12:34', '2018-01-04 19:42:36'),
(11, 'Online Doctor Prescriptions', 'online-doctor-prescriptions', 'Online Doctor Prescriptions', 'Australian Doctors who genuiely look after Us', 'Online Doctor Prescriptions | Doctor Consultation | City, Diet Doctor', 'online prescriptions, prescriptions online, online doctor consultation, City Doctors, Diet Doctor, prescriptions', 'Online Doctor Prescriptions', 'Get doctors prescription online without going anywhere. Register yourself at Doctoroo for city doctors and find your specialist for online prescriptions.', 'We ’ ve all been there ', 'Ever needed a prescription and had to wait hours to be seen by a doctor?\r\n The hassle of travelling to \r\na doctor has been a common cause of why Australians aren\r\n’\r\nt taking their medications \r\n–\r\n the \r\ntraditional way to get a prescription is just inefficient, impractical and\r\n simply outdated.  ', 'The new way to get a prescription - online ', 'When we already know which prescription we need, why should we waste hours of our t\r\nime and go \r\nthrough the hassle of having to travel to the doctor for somethin\r\ng that only takes a few minutes? \r\nThat\r\n’\r\ns no longer the case with doctoroo \r\n–\r\n where you can now get your prescriptions online, anytime, \r\nanywhere in Australia.  ', 'Online Doctor Prescriptions', 'Online Doctor Prescriptions', 'Online Doctor Prescriptions', 'It doesn ’ t stop there ', 'What\r\n’\r\ns the point of being able to get your prescriptions online, only\r\n the then need to travel to your \r\npharmacy to buy the medication? Doctoroo allows you to send in yo\r\nur online prescription to any \r\npharmacy in Australia, where they\r\n’\r\nll prepare the order for you, and alert you once ready for pickup.  \r\nThe added benefit is being able to have your prescription medication (and ot\r\nher non-prescription \r\nmedication) delivered right to you \r\n–\r\n whether you\r\n’\r\nre at home, the office or anywhere in Australia, \r\nwe\r\n’\r\nll get the medication to you.  ', 'bb', 'yes', 'How is Doctoroo ’ s  online prescription service different? ', 'Doctoroo has been built for you \r\n–\r\n to use whenever you need it, intuitively and quickly. To achieve \r\nthis, we\r\n’\r\nve created ways that you can better take care of your health. ', 'What can you get a prescription for? \r\nMost S3 and S4 scheduled drugs can be prescribed on doctoroo, with docto\r\nrs usually offering  \r\nOf course, some drugs cannot be prescribed due to health concerns, abuse, ad\r\ndiction or other \r\nmedicolegal reasons, which is for the safety of all involved. For these cases, we\r\n encourage patients \r\nvisit an in-person GP for advice and treatment.  \r\nYou can also request to have a generic or original brand for your medication \r\norder, just as you would \r\nin a traditional pharmacy.  ', 'How much does it cost?', 'Although no one can put a price on a person\r\n’\r\ns health, it\r\n’\r\ns completely free to signup & use our app. \r\nYou\r\n’\r\nll only need to pay when you book a doctor.  \r\nThere\r\n’\r\ns no set fee for a single prescription, as doctors offer this as part of their c\r\nonsultation, which \r\nstart from just $28. We\r\n’\r\nre proud to say that our partnerships with doctors and industry partners \r\nmean we\r\n’\r\nre Australia\r\n’\r\ns most affordable way to see a doctor online. \r\nThe average consultation is around 7-8 minutes, costing just $38.  \r\nFor full pricing details, [View our Pricing] ', 'What else can you do on doctoroo?', 'Besides being an online prescription service for us to use anytime, your acc\r\nount allows you to: ', 'Online Doctor Prescriptions', 'How do I get started?', 'Average calls lasts 6-8 minues and cost just $24 - $36. All other app features are free for you (no astericks!) ', '2017-11-22 10:24:53', '2017-11-22 15:54:55'),
(12, 'See a Doctor at home', 'see-a-doctor-at-home', 'See a Doctor at home', 'See a Doctor at home', 'See a Doctor Online | Home Doctor Service | Home Visit Doctor', 'home doctor, see a doctor online, dr online, home doctor service, home visit doctor, national home doctor', 'See a Doctor at home', 'See a doctor online. It''s easy. If you live in Australia, just select a time and book home doctor, home visit doctor and get home doctor service anywhere in Australia.', 'See a Doctor at home', ' See a Doctor at home', 'See a Doctor at home', 'See a Doctor at home', 'See a Doctor at home', 'See a Doctor at home', 'See a Doctor at home', 'See a Doctor at home', 'See a Doctor at home', 'aa', 'no', '', '', '', '', '', '', '', '', '', '', '2018-01-04 14:11:14', '2018-01-04 19:41:16'),
(13, 'Talk to a Doctor online', 'talk-to-a-doctor-online', 'Talk to a Doctor online', 'Ready to give you the care and medical advice you need ', 'Talk to a Doctor Online |  See a Doctor Online Medical Advice service', 'talk to a doctor, talk to a doctor online, speak to doctor, medical advice, see a doctor', 'Talk to a Doctor online', 'Ask a doctor online and get online medical advice at Doctoroo. Talk to a doctor online without any hassle, anytime, anywhere. See a doctor 24/7 on your computer or mobile.', 'A doctor online, anytime, anywhere', 'Gone are the days of having to travel to a doctor, wait hours until \r\nyou\r\n’\r\nre seen for something that \r\nusually takes just a few minutes. Doctoroo is the exciting new app where y\r\nou can talk to a doctor \r\nonline, using any device. getting online medical advice has never b\r\neen easier, where you could see a \r\ndoctor in just a few minutes from now.   ', 'How do I speak to a doctor online?', 'In order to get online medical advice, you\r\n’\r\nll first need to create a doctoroo account. Setting it all up \r\nand booking a doctor takes less than 60 seconds! Here\r\n’\r\ns how you can signup: \r\n<br>\r\n1.\r\nMake an Account \r\n<br>\r\n2.\r\nSearch for a Doctor (by name, gender, language, time) \r\n<br>\r\n3.\r\nConfirm booking & pay \r\n<br>\r\n4.\r\nAwait a call from your doctor \r\n<br>\r\n5.\r\nReceive advice, medical certificate, prescription or referrals right after the call\r\n<br>\r\n6.\r\nPickup your medication from your local pharmacy, or have it delivered to\r\n you ', 'Free to Signup ', '5-20 years experienced doctors', 'Other languages', 'How  do I  get ready for the consultation? ', 'In order to get ready for the doctor to give you the best care, yo\r\nu\r\n’\r\nll first need to be in a private \r\nspace, where no one can disturb your consultation or listen in on the c\r\nonversation with your doctor. \r\nOther ways to get ready for the best care online include: \r\n<br>\r\n1.\r\nMaking sure you have good internet connection  \r\n<br>\r\n2.\r\nYour device has enough battery to last at least for the next 30 minutes\r\n<br>\r\n3.\r\nYou have the doctoroo app installed on your phone and you\r\n’\r\nve logged in \r\n<br>\r\n4.\r\nIf using a computer, check your microphone and camera are connected and\r\n functioning \r\nproperly \r\n<br>\r\n5.\r\nThere are no loud sounds around you that may interfere with your consult\r\nation ', 'aa', 'yes', 'About our doctors ?', 'Some of Australia\r\n’\r\ns best doctors have joined doctoroo from all over Australia, and provide o\r\nnline \r\nconsultations to their patients and patients across the country. We know tha\r\nt your health is a \r\nprivate topic and so we all want a doctor who can listen, understand and \r\nshare their valuable advice \r\nwith us. That\r\n’\r\ns why we\r\n’\r\nve chosen doctors who are', 'You\r\n’\r\nll be able to see your doctors profile before you book them, and we aim\r\n to have many doctors \r\nto select from at your time of booking.  \r\n<br>\r\nDon\r\n’\r\nt just take our word for it - Backed by science & resear\r\nch\r\nWe\r\n’\r\nre serious about healthcare and about the health of our users. That\r\n’\r\ns why we\r\n’\r\nve made sure \r\ndoctoroo actually helps you. Telehealth platforms have been studied, an\r\nd shown to be beneficial in \r\nvarious ways through widely-recognised scientific research and studies.  \r\n<br>\r\n1.\r\n    A 2005 study of a telehealth medical evaluation prog\r\nram at five childcare centers \r\nfound that the program reduced children\r\n’\r\ns\r\n’\r\n absences due to illness by 63% and \r\navoided provider office or emergency room visits in ne\r\narly 94% of cases. \r\n<br>\r\n2.\r\n    A study found that telemedicine resulted in the read\r\nmission rate being reduced from \r\n20% to 4% as well as a reduction in the length of sta\r\ny and overall costs.\r\n<br>\r\n3.\r\n    In the US, 74% of patients said they would use telehea\r\nlth services \r\n<br>\r\n4.\r\n    About 90% of surveyed healthcare executives report tha\r\nt their organizations have \r\nalready begun developing or implementing a telemedici\r\nne program  \r\n<br>\r\n5.\r\n    A 2008 UC-San Francisco study compared skin cancer patien\r\nts who received store \r\nand forward tele-dermatology services with patients who\r\n received conventional \r\ndermatology referrals. The tele-dermatology patients, on\r\n average, completed their \r\ninitial consults in 4 days, versus 48 days for conventiona\r\nlly referred patients \r\n<br>\r\n6.\r\n    A study of post-traumatic stress disorder patients found th\r\nat telemedicine patients \r\nhad fewer treatment program drop-outs, 6% versus 29%. ', 'How much does seeing a doctor online cost?', 'Although no one can put a price on a person\r\n’\r\ns health, it\r\n’\r\ns completely free to signup & use our app. \r\nYou\r\n’\r\nll only need to pay when you talk to a doctor online.  \r\nAs Australia\r\n’\r\ns most affordable way to see a doctor online, consultations start from just\r\n $28, with the \r\naverage consultation being around 7-8 minutes, costing just $38.  \r\n', 'What can I speak to the doctor about? ', 'When we set out to make seeing a doctor online easier for Australians, we knew \r\nthat we could never \r\nreplace a traditional, in-person consultation with our Doctors, and we h\r\naven\r\n’\r\nt tried to. What we \r\nhave done instead, is offer a complimentary service where you can use our platform for \r\nissues that \r\ndon\r\n’\r\nt r\r\nequire physical examination.  \r\n<br>\r\nConditions you see a doctor about online ', 'Some of Australia\r\n’\r\ns best doctors have joined doctoroo from all over Australia,', 'How do I get started?', 'Average calls lasts 6-8 minues and cost just $24 - $36. All other app features are free for you (no astericks!) ', '2017-11-22 10:28:44', '2017-11-22 15:58:45'),
(17, 'Chat with a Doctor', 'chat-with-a-doctor', 'Chat with a Doctor', 'Chat with a Doctor on your phone ', 'Chat with Doctor | Depression Helpline Chat | Phone Doctor | Doctor App', 'doctor chat, doctor app, phone doctor, qoctor, depression helpline chat, Dr App', 'Chat with a Doctor on your phone ', 'Get doctor App & chat with a doctor online. Download Doctoroo''s dr App for depression helpline chat for quick support. Chat one on one with a qualified doctor. Chat now!', 'The Future of Healthcare begins today ', 'Gone are the days of travelling to a Doctor and waiting hours to be see\r\nn for a few minutes. With \r\ndoctoroo, it takes less than a minute to book a doctor via our web\r\nsite or mobile app. After booking a \r\ndoctor, you\r\n’\r\nll get a call via the app at the selected time where you can see the docto\r\nr via video and \r\nchat about your health condition, receive treatment, a medical certificat\r\ne or prescription.  ', 'How does it work?', 'By simply making an account, you can book a doctor in less than a \r\nminute using your phone or \r\ncomputer. Our doctors are available for you 24 hours a day, 365 days \r\nevery year. Here\r\n’\r\ns a quick \r\nou\r\ntline of how it works: \r\n<br>\r\n1.Make an Account \r\n<br>\r\n2.Search for a Doctor (by name, gender, language, time) \r\n<br>\r\n3.Confirm booking & pay \r\n<br>\r\n4.Await a call from your doctor \r\n<br>\r\n5.Receive advice, medical certificate, prescription or referrals right after the call\r\n<br>\r\n6.Pickup your medication from your local pharmacy, or have it delivered to\r\n you ', '', '', '', 'Who is Doctoroo made for?', 'Everyone! Our platform was designed for all ages, all educational backgrounds an\r\nd computer \r\nknowledge skills. We\r\n’\r\nve made it as simple and fast as possible to see a doctor. Some of our users \r\ninclude Australians who: \r\n<br>\r\n1.\r\nHave difficulty travelling or arranging travel \r\n<br>\r\n2.\r\nAre simply too busy or time-poor ', '', 'yes', 'Abo