(18, 'ONLINE DOCTORS AUSTRALIA', 'online-doctors-australia', '', 'Book a Doctor’s appointment today and have your consultation online ', 'online  doctors  australia', 'online  doctors  australia, online  doctor  australia ,online  doctor service  ,doctor consultation ,online  doctor appointment ,online  doctor consultation ', 'ONLINE DOCTORS AUSTRALIA ', 'online \r\ndoctors \r\naustralia', 'How can I book a Doctor online? ', 'Booking a doctor online on our platform takes less than a minute, and\r\n all you\r\n’\r\nll need to do is: \r\n<br>\r\n1.\r\nMake an account \r\n<br>\r\n2.\r\nSelect your suitable day & time \r\n<br>\r\n3.\r\nSelect your doctor \r\n<br>\r\n4.\r\nConfirm & pay for consultation \r\nAll this will take you less than a minute and you can make a booking\r\n on any device, anytime, \r\nanywhere in Australia.  ', 'How are the online consultations conducted?', 'After making a booking, you\r\n’\r\nll receive a notification 5 minutes before your consultation time in \r\norder \r\nto prepare and be ready in a private sitting. Your doctor will then cal\r\nl you via the doctoroo app, and \r\nyou\r\n’\r\nll be able to see the doctor face-\r\nto\r\n-face and exchange messages and photos during the \r\nconsultation.  \r\nYour doctor will ask you questions to confirm your identity and to\r\n diagnose your symptoms. He\r\n’\r\nll \r\nthen give you appropriate advice and treatment to help with your condi\r\ntion.  ', '', '', '', 'What else can you do?', 'Besides having a consultation online, doctoroo also allows you to: \r\n<br>\r\n1.\r\nGet prescriptions for various medications \r\n<br>\r\n2.\r\nGet a medical certificate for work, school, university or sports \r\n<br>\r\n3.\r\nClick & collect your medications from your nearest pharmacy \r\n<br>\r\n4.\r\nHave your medications delivered to your home or office \r\n<br>\r\n5.\r\nGet Medical Exams, Pathology and Specialist Referrals \r\n<br>\r\n6.\r\nInvite your own Doctor to the platform \r\n<br>\r\n7.\r\nManage your medications, and easily reorder medications & repeats ', '', 'yes', 'What can I see the doctor for?', 'Our online consultation service allows you to see the doctor for a ran\r\nge of conditions. Some of these \r\ninclude: ', 'We highly recommend that you always visit the next available GP in p\r\nerson or call 000 for \r\nemergencies for any of the conditions above.  ', 'How much does it cost? ', 'Although no one can put a price on a person\r\n’\r\ns health, it\r\n’\r\ns completely free to signup & use our app. \r\nYou\r\n’\r\nll only need to pay when you book a doctor.  \r\nAs Australia\r\n’\r\ns most affordable way to see a doctor online, consultations start from just\r\n $28, with the \r\naverage consultation being around 7-8 minutes, costing just $38.  \r\n', 'Benefits of Doctoroo', 'Benefits of Doctoroo', 'Available 24 hours a day, every day of the year', 'How do I get started?', 'Average calls lasts 6-8 minues and cost just $24 - $36. All other app features are free for you (no astericks!) ', '2017-10-23 06:13:30', '2017-04-04 00:11:41'),
(20, 'Dial a Doctor on demand', 'dial-a-doctor-on-demand', '', 'Dial a doctor anytime, using any device', 'Dial a Doctor | Doctors on Demand | Doctors on Call | Dial a Dr', 'dial a doctor, dial a dr, call a doctor, doctors on demand, doctor on call, 24/7 hours, doctroo', 'Doctors available on demand', 'Doctors On Demand is the quick way to see a doctors on your device. Connect to a doctor on call for healthcare assistance. Dial a doctor anywhere and anytime. Dial a Dr ', 'The old, inefficient way', 'When sick, in pain or needing to see a doctor for a check-up, we \r\noften find ourselves travelling to the \r\ndoctor, waiting for hours, to then only see the doctor for a few short\r\n minutes. Being at the doctors\r\n’\r\nclinic may have actually made us more sick, as it\r\n’\r\ns often a common place for people to transfer the \r\nflu and infections. That was the inefficient way. That was the unsafe way. That\r\n was the old way.  ', 'The future of your health is in the palm of your hand s, literally  ', 'The new way is using your phone to book a GP, who will then give you\r\n a call at your booking time. It\r\n’\r\ns \r\na very simple process, and booking a doctor takes less than 60 seconds. Do\r\nctoroo is like having a \r\ndoctor on call, available for you on demand wherever you go. You\r\n’\r\nll be able to dial a doctor of your \r\nchoice \r\n–\r\n you can search doctors by name, gender, availability and even languages spo\r\nken. Seeing a \r\ndoctor has never been easier.  ', '', '', '', 'How does it work?', 'Our online Doctor service is very simple to use for all patients \r\n–\r\n simply make an account, complete \r\nsome details about yourself, search for a doctor and pay to confirm you\r\nr booking. \r\nYou\r\n’\r\nll then receive a call from your Doctor, right on your appointment\r\n time, where you can see them \r\nface-\r\nto\r\n-face via your device camera. They\r\n’\r\nll conduct their consultations as they would for in-person \r\npatients, asking you the standard questions and diagnosing you and offeri\r\nng appropriate treatment \r\nif necessary.  \r\nWhen we would previously dial a Doctor to book an appointment, then t\r\nravel to them, wait in the \r\nclinic and then go to the pharmacy to pick up our medications \r\n–\r\n we can now do all that from the \r\ncomfort and convenience of our homes, office or anywhere in Australia. Simp\r\nly put, if you can access \r\nFacebook on your device, you can now access a Doctor through Do\r\nctoroo.  ', '', 'yes', 'What else can you do?', 'Having a GP on call isn\r\n’\r\nt the only exciting feature of doctoroo, your account allows yo\r\nu to: ', 'you will able to see doctror', 'How much does it cost? ', 'View our Pricing page here', 'Benefits of Doctoroo', 'Benefits of Doctoroo', 'Don\r\n’\r\nt just take our word for it - Backed by science & researc\r\nh \r\nWe\r\n’\r\nre serious about healthcare and about the health of our users. That\r\n’\r\ns why we\r\n’\r\nve made sure \r\ndoctoroo actually helps you. Telehealth platforms have been studied, an\r\nd shown to be beneficial in \r\nvarious ways through widely-recognised scientific research and studies.  \r\n', 'How do I get started?', 'Getting started is easy and free. Click the button below to make an account,\r\n and see a doctor today! \r\n{Make a Free Account} ', '2018-01-08 08:25:34', '2018-01-08 13:55:35'),
(21, 'Book a Doctor Online in Australia', 'book-a-doctor-online-in-australia', '', 'Book a GP online, anytime, anywhere.', 'Book an Australian Doctor online', 'Book an Australian Doctor online', 'Book an Australian Doctor online', 'Book an Australian Doctor online', 'See a doctor online, wherever you are in Australia', 'Doctoroo is Australia\r\n’\r\ns most integrated platform to see a doctor online and manage your \r\nmedications. We have a range of experienced and qualified doctors who care about t\r\nheir patients, \r\nspeak multiple languages and are available anytime of the day. We\r\n’\r\nve truly created a platform that \r\nour users love and is available for you when you need it', 'Book a doctor online, anytime, anywhere', 'Booking a GP online takes less than 60 seconds and can be done anytim\r\ne, using any device. \r\nIt\r\n’\r\ns \r\ncompletely free to book a doctor online. In many instances, you\r\n’\r\nll be seeing your doctor within \r\nminutes, getting diagnosed, receiving treatment and feeling better sooner', '', '', '', 'Who can see a doctor online?', 'Literally anyone in Australia who has access to a phone, laptop or tab\r\nlet with a camera, microphone \r\nand internet connection (these days, that\r\n’\r\ns virtually our whole population).  \r\nDoctoroo was built to make doctor''s easily accessible and affordable for Au\r\nstralian''s who don\r\n’\r\nt have \r\nthe time to travel to a doctor, wait for hours and then travel to the p\r\nharmacy, for something they \r\ncould''ve easily done in a few minutes from their phones at home or the \r\noffice.  \r\nDoctoroo also makes it easy for any Australians who: \r\n<br>\r\n1.\r\nLive in remote areas  \r\n<br>\r\n2.\r\nAre housebound  \r\n<br>\r\n3.\r\nHave difficulty travailing  \r\n<br>\r\n4.\r\nHave trouble lining up childcare  \r\n<br>\r\n5.\r\nJust don''t have the time to make it to a doctor or pharmacy  \r\nOf course in some situations, assistance or supervision is required if a non-tech\r\nnical person or \r\nminor-aged person, respectively, wishes to use our platform.  ', '', 'yes', 'What can you do on doctoroo?', 'Besides being a 24 hour online medical centre and an after hours GP helpline \r\nfor you to use anytime, \r\nyour account allows you to: Besides being a 24 hour online medical centre and an after hours GP helpline \r\nfor you to use anytime, \r\nyour account allows you to: ', 'You will see our Doctor', 'How much does it cost?', 'Although no one can put a price on a person\r\n’\r\ns health, it\r\n’\r\ns completely free to signup & use our app. \r\nYou\r\n’\r\nll only need to pay when you book a doctor.  \r\nAs Australia\r\n’\r\ns most affordable way to see a doctor online, consultations start from just\r\n $28, with the \r\naverage consultation being around 7-8 minutes, costing just $38.  \r\n', 'About our doctors', 'Some of Australia\r\n’\r\ns best doctors have joined doctoroo from all over Australia, and provide o\r\nnline \r\nconsultations to their patients and patients across the country. We know tha\r\nt your health is a \r\nprivate topic and so we all want a doctor who can listen, understand and \r\nshare their valuable advice \r\nwith us. That\r\n’\r\ns why we\r\n’\r\nve chosen doctors who are: ', 'You\r\n’\r\nll be able to see your doctors profile before you book them, and we aim\r\n to have many doctors \r\nto select from at your time of booking.  ', 'Book an Australian Doctor online', 'Book an Australian Doctor online', '2017-04-04 00:14:17', '2017-04-04 00:14:17'),
(23, 'See a GP online', 'see-a-gp-online', '', 'An online Australian Doctor for me', 'Online GP, GP on Call, GP Helpline, After Hours GP', 'gp to you,after hours gp, gp2u, gp helpline, online gp, gp online, gp service', 'See a GP online', 'Get GP on call at Doctoroo! Yes, no need to worry. Now, consult with online GP to You with Doctoroo''s helpline. 24*7, Sunday open. Book after hours gp helpline.', 'Online GP ’ s available anytime ', 'Have you ever wondered to yourself \r\nI wish there was a doctor available for me to see after hours\r\n? \r\nWe have too! In fact, it was the reason why doctoroo was started \r\n–\r\n to give better healthcare access \r\nto Australians all over the country, whenever they need it.  ', 'How does Doctoroo benefit me? ', 'Besides booking a doctor through the app and seeing an online GP, d\r\noctoroo allows you to: \r\n<br>\r\n1.\r\nSpeak with a doctor on any device \r\n<br>\r\n2.\r\nDoctors available 24/7 \r\n<br>\r\n3.\r\nGet medical advice, diagnosis and treatment \r\n<br>\r\n4.\r\nGet prescriptions straight to your phone \r\n<br>\r\n5.\r\nGet repeat prescriptions for your medications \r\n<br>\r\n6.\r\nOrder any medication from any pharmacy across Australia \r\n<br>\r\n7.\r\nManage, get reminded and reorder your medications and repeats \r\n<br>\r\n8.\r\nHave your medications delivered to you \r\n<br>\r\n8.\r\nClick & collect medications from your nearest pharmacy ', '', '', '', 'Who are the Doctors?', 'ome of the best there are in Australia. All Doctors on our platform are select\r\ned based on very high \r\nstandards. We ensure that all Doctors on our platform are accredited and registered by\r\n AHPRA, and \r\nhave full indemnity insurance. Many of them have between 5 \r\n–\r\n 20+ years of experience and some \r\neven speak other languages too! \r\nTestimonials \r\nDr. Smith really saved me a lot of time and was very understanding about my \r\nhealth issue. He gave \r\nme a prescription, which I then took to my pharmacy and collected my\r\n medication\r\n Jane Albert  \r\nThe Doctoroo app has been so useful! The Doctor treated me during the \r\nmiddle of the night, and by \r\nthe next morning, my medication had arrived home. Great service to use.\r\n Therese Nehme \r\nThe Dr that treated me was so understanding and caring, it felt like I was t\r\nalking to my actual GP. It \r\nalso wasn\r\n’\r\nt expensive, costing just $38, I was able to get treatment and a medical cert\r\nificate for \r\nwork. Thanks doctoroo!', '', 'yes', 'Is doctoroo for me? ', 'Doctoroo was built to make doctors easily accessible and affor\r\ndable for Australian''s who \r\ndon\r\n’\r\nt have the time to travel to a doctor, wait for hours and th\r\nen travel to the pharmacy, for \r\nsomething they could have easily done in a few minutes from \r\ntheir phones at home or the \r\noffice.  \r\nDoctoroo also makes it easy for any Australians who', 'you will able to sees a doctor profile', 'How much does it cost?', 'Although no one can put a price on a person\r\n’\r\ns health, it\r\n’\r\ns completely free to signup & use our app. \r\nYou\r\n’\r\nll only need to pay when you book an online GP.  \r\nAs Australia\r\n’\r\ns most affordable way to see a doctor online, consultations start from just\r\n $28, with the \r\naverage consultation being around 7-8 minutes, costing just $38.  \r\n', 'How exactly can a doctor diagnose and treat me online', 'When we set out to make healthcare easier for Australians, we knew that we could never \r\nreplace a \r\ntraditional, in-person consultation with our Doctors, and we haven\r\n’\r\nt tried to. What we have done \r\ninstead, is offer a complimentary online service where you can use our platform for i\r\nssues that don\r\n’\r\nt \r\nrequire physical examination\r\nConditions the doctor can treat me for', 'you may also see adoctor or message doctor', 'See a GP online', 'See a GP online', '2018-01-04 14:07:59', '2018-01-04 19:38:02'),
(24, 'Home Doctor service, online', 'home-doctor-service-online', '', 'The new way of a Doctor visiting your home, nationally.', 'Home Doctor Service | Home Visit Doctor |  Doctor at Home – Droo', 'Home doctoro service, home doctor, doctor at home, house doctor, house call doctor, home doctor service, home visit doctor', 'Home Doctor service, online ', 'Doctoroo offers home doctor service, home visit doctor to all suburbs across Australia. A Doctor to your home, office  in less than hour. Call and request a doctor.', 'The traditional house call doctor service', 'The traditional way to see a doctor was to travel to the doctor, wait\r\n at the clinic and then be seen for \r\na few minutes. This was then evolved into a home doctor service \r\n–\r\n where you were able to call a \r\ndoctor to travel to your house. Although this may be a good opt\r\nion for some situations, three main \r\nissues were noted by many users: \r\n<br>\r\n1)\r\nLong waiting times involved for the doctor to visit your hom\r\ne, where a few doctors would be \r\nservicing a large area \r\n<br>\r\n2)\r\nDue to the large country we have, it\r\n’\r\ns almost impossible to be able to reach all users, as \r\nsome towns and cities are tens of hours away of driving \r\n<br>\r\n3)\r\nDue to restrictions by the government, all these home doctor services aren\r\n’\r\nt available during \r\nworking hours, which means users still need to travel to the doctor unti\r\nl the home doctor \r\nservice opened or have to delay the doctor visit until after hours \r\n–\r\n and when we\r\n’\r\nre feeling \r\nsick, waiting is the last thing we all want to be doing.  ', 'The new way to see a doctor at home ', 'Doctoroo was built to address not only the above limitations, bu\r\nt many other issues and \r\ninefficiencies in our healthcare system which are unfortunately all too comm\r\non for many \r\nAustralians.  \r\nThe new, exciting way to see a doctor on doctoroo is so straight\r\nforward, you\r\n’\r\nll be wondering why it \r\nwasn\r\n’\r\nt made any sooner! Here how it works: \r\n<br>\r\n1.\r\nMake an Account \r\n<br>\r\n2.\r\nSearch for a Doctor (by name, gender, language, time) \r\n<br>\r\n3.\r\nConfirm booking & pay \r\n<br>\r\n4.\r\nAwait a call from your doctor \r\n<br>\r\n5.\r\nReceive advice, medical certificate, prescription or referrals right after the call', '', '', '', 'What else can you do on doctoroo?', 'Besides being an online national home doctor service for you to use any\r\ntime, your account allows \r\nyou to: \r\n<br>\r\n1.\r\nSpeak with a doctor on any device, from home or the office \r\n<br>\r\n2.Doctors available 24/7 \r\n<br>\r\n3.Get medical advice, diagnosis and treatment \r\n<br>\r\n4.Get prescriptions that you can download after the video visit \r\n\r\n<br>\r\n5.Get repeat prescriptions for your medications \r\n<br>\r\n6.Order any medication from any pharmacy across Australia \r\n<br>\r\n7.Manage, get reminded and reorder your medications and repeats \r\n<br>\r\n8.Have your medications delivered to you \r\n<br>\r\n9.Click & collect medications from your nearest pharmacy \r\n<br>\r\n10.Have your consultation summary sent to your normal family GP  \r\n<br>\r\n11.Save your medical history for future use ', '', 'yes', 'About our doctors ', 'Some of Australia\r\n’\r\ns best doctors have joined doctoroo from all over Australia, and provide o\r\nnline \r\nconsultations to their patients and patients across the country. We know tha\r\nt your health is a \r\nprivate topic and so we all want a doctor who can listen, understand and \r\nshare their valuable advice \r\nwith us. That\r\n’\r\ns why we\r\n’\r\nve chosen doctors who are: ', 'You\r\n’\r\nll be able to see your doctors profile before you book them, and we aim\r\n to have many doctors \r\nto select from at your time of booking.  \r\n', 'How much does it cost? ', 'Although no one can put a price on a person\r\n’\r\ns health, it\r\n’\r\ns completely free to signup & use our app. \r\nYou\r\n’\r\nll only need to pay when you book a doctor.  \r\nAs Australia\r\n’\r\ns most affordable way to see a doctor online, consultations start from just\r\n $28, with the \r\naverage consultation being around 7-8 minutes, costing just $38.  \r\n', 'How secure are my consultations and information? ', 'We recognize that security is an essential consideration and that\r\n’\r\ns why we\r\n’\r\nve fully reviewed and \r\naddressed any security concerns with your safety as the first priority. Our sec\r\nurity policy has been a \r\nsimple one \r\n–\r\n to build a system that we\r\n’\r\nd trust our own personal data to be stored on. Is doctoroo national? \r\nThe great part about the internet is its accessible form almost anywhere in the wor\r\nld. This means \r\nthat as long as you can access Facebook, you can now see a doctor anywhere \r\nin Australia! Whether \r\nyou\r\n’\r\nre in Sydney, Melbourne, Brisbane, Perth, Adelaide, Darwin, Hobart, Canberra or an\r\ny place in \r\nbetween with an internet connection, you can easily book and see a doc\r\ntor online.  Some of the \r\nmeasures we take to ensure your privacy and security of your data include: \r\n How secure are my consultations and information? \r\nWe recognize that security is an essential consideration and that\r\n’\r\ns why we\r\n’\r\nve fully reviewed and \r\naddressed any security concerns with your safety as the first priority. Our sec\r\nurity policy has been a \r\nsimple one \r\n–\r\n to build a system that we\r\n’\r\nd trust our own personal data to be stored on. Some of the \r\nmeasures we take to ensure your privacy and security of your data include: \r\n-\r\nWe use industry standard security technologies such as HTTPS support, secure \r\nRTP, HTTP \r\nauthentication, secure WebSockets and application level authentication \r\nusing tokens via \r\nsecure video platforms \r\n-\r\nSSL certificate  \r\n-\r\nConsultations aren\r\n’\r\nt recorded, meaning if in the almost rare case of a data breach, anythin\r\ng \r\nyou\r\n’\r\nve spoken to the doctor about via video cannot be seen or retrieved \r\n-\r\nOur servers: ', 'Is doctoroo national? \r\n<br>\r\nThe great part about the internet is its accessible form almost anywhere in the wor ld. This means that as long as you can access Facebook, you can now see a doctor anywhere in Australia! Whether you ’ re in Sydney, Melbourne, Brisbane, Perth, Adelaide, Darwin, Hobart, Canberra or an y place in between with an internet connection, you can easily book and see a doc tor online.', 'How do I get started?', 'Average calls lasts 6-8 minues and cost just $24 - $36. All other app features are free for you (no astericks!) ', '2018-01-04 14:10:35', '2018-01-04 19:40:37');
