(26, 'Get a Sick Note & Doctor''s Certificate', 'get-a-sick-note-&-doctor-certificate', '', 'Official Certificates delivered to you online, anytime, any\r\nwhere. ', 'Sick Note, Doctors Note, Sick Certificate, Doctor, Medical Certificate', 'doctors note, sick note, sick certificate, doctor certificate', 'Get a Sick Note & Doctor''s Certificate ', 'Get a sick note, doctor note, sick certificate, doctor certificate, medical certificate online using your  tablet, or phone. anytime & anywhere you are in Australia.', 'Convenient. Easy. Affordable. ', 'It\r\n’\r\ns ironic that when we\r\n’\r\nre sick, doctors tell us to \r\nrest in bed\r\n yet we had to get out of bed to get \r\nthat advice. With doctoroo, that\r\n’\r\ns no longer the case, with \r\na \r\ndoctors\r\n’\r\n note now easily obtainable \r\nonline using any device, anytime, anywhere you are in Australia.  ', 'How is it possible to get a doctor ’ s note online? ', 'Our telemedicine platform was designed by a Medical Scientist to ensure that it was \r\nquick and easy \r\nto get your doctors certificate when you need it most. It takes less th\r\nan 60 seconds to book a doctor \r\nand most consultations take less than 5 minutes, where the doctor can also\r\n diagnose you, offer \r\ntreatment, and write up your doctors certificate, which will be available \r\nfor download right after \r\nyour call.  \r\nWhat\r\n’\r\ns included in our sick certificates? \r\n<br>\r\n1.\r\nDoctors details \r\n<br>\r\n2.\r\nDate of absence \r\n<br>\r\n3.\r\nReason for absence (if required) \r\n<br>\r\n4.\r\nRecommendations about how and when you''ll be able to return to your du\r\nties \r\n<br>\r\n5.\r\nWhether you''re able to return to your duties with amended responsibilities (e.g\r\n. no heavy \r\nlifting or reduced hours) \r\n<br>\r\n6.\r\nInstructions on how your employer or institution can authenticate \r\nthe validity of the sick \r\nnote ', '', '', '', 'Is the Doctors sick certificate official? ', 'Of course! The sick certificate sent to you follows the guidelines outlined \r\nby the AMA (Australian \r\nMedical Association). It\r\n’\r\nll have all the doctors\r\n’\r\n details, the date of absence and the reason for \r\nabsence, as well as all other required details.  \r\nThe doctor\r\n’\r\ns note supplied to you meets all Australian Laws and Regulations, the requi\r\nrements of \r\nthe Fair Work Act and the guidelines set by the AMA. The sick certific\r\nate can easily be verified by \r\ncontacting the appropriate Doctor. \r\nThe doctors certificate will be available for download as a PDF in your doc\r\ntoroo account, which you \r\ncan then easily download and email to your company or institution. ', '', 'yes', 'What can you use the doctors certificate for?', 'We understand that many organisations, companies and institutions require \r\nyou to have a Doctor\r\n’\r\ns \r\nCertificate when you\r\n’\r\nre absent or know you\r\n’\r\nll be absent. Our doctor\r\n’\r\ns certificates can be used for all \r\nsituations, including: ', 'you will be able to see  your doctor ', 'How much does a doctor ’ s certificate cost? ', 'Although there is no set cost for a doctor\r\n’\r\ns note, seeing a doctor online on our platform is the most \r\naffordable in Australia. Most doctors certificate consultations cost just \r\n$28.  \r\n', 'What conditions can I get a doctor ’ s certificate for? ', 'Most conditions can be given a doctor\r\n’\r\ns certificate for, although some may require an in-person \r\ndoctor visit to get proper diagnosis and treatment. Some of the common\r\n conditions you can receive \r\na \r\ndoctor\r\n’\r\ns certificate for include: ', 'Why do I need to a see a doctor to get my doctors certifi\r\ncate? \r\nSometimes we may think we have a simple illness and misdiagnose it as the \r\nflu, a harmless headache \r\nor stomach ache and self-treat it. In order to avoid this, and for \r\ndoctors to actually ask you questions \r\nabout your condition in case its more serious than you had thoug\r\nht, to get a doctors certificate you\r\n’\r\nll \r\nneed to see a doctor who can also offer you advice on how to get bet\r\nter soon and any treatment \r\nyou need. Most doctors certificate consultations take less than 5 minu\r\ntes and can be done from \r\nanywhere. \r\nCan my employer, school, university or sports club chec\r\nk the validity?\r\nYour employer or institution can easily verify the details contained wit\r\nhin your sick note, the time of \r\nconsultation and the doctor who you had a consultation. This is do\r\nne directly with us, which means \r\nyou won''t need to do anything else. ', 'How do I get started?', 'Average calls lasts 6-8 minues and cost just $24 - $36. All other app features are free for you (no astericks!) ', '2018-01-05 10:05:21', '2018-01-04 19:39:51'),
(28, 'Homepage Doctoroo', 'homepage-doctoroo', '', 'DOCTOROO \r\n–\r\n Talk to a Doctor from just $28. Australia\r\n’\r\ns Telehealth Platform ', 'Online Doctor 24/7 | Consult a Doctor Online | Dr Online | Doctoroo', 'Doctors Online, Online Doctor, Online Dr, Dr Online, Doctoroo, quick consultation, Online Doctor 24/7', 'DOCTOROO  –  Talk to a Doctor from just $28. Australia ’ s Telehealth Platform ', 'Find doctors online at Doctoroo in Australia to book Dr online for quick consultation, prescription order & referral request in the most convenient way.  See  doctor 24/7 hour.', 'What is Telemedicine? ', 'The Australian Government (Department of Health) [link: \r\nhttp://www.health.gov.au/internet/main/publishing.nsf/content/e-heal\r\nth-telehealth\r\n] \r\ndefines \r\nTelemedicine \r\nas\r\n the: \r\nuse of telecommunication technologies to exchange health informati\r\non and provide health care \r\nservices across geographic, time, social and cultural barriers\r\n                                  ~ The International Organ\r\nisation for Standardisation  \r\nBasically, Telemedicine is allowing Doctors to see, diagnose and offer treatm\r\nent to Patients via their \r\nphone, tablet, computer or any smart device connected to the int\r\nernet.  ', 'Benefits of Telemedicine & Telehealth', 'With increasing number of Australians using telehealth every year (MBS Online,\r\n 2016 Link: \r\nhttp://www.mbsonline.gov.au/internet/mbsonline/publishing.nsf/Cont\r\nent/connectinghealthservice\r\ns-factsheet-stats\r\n ), there are many situations and people that would greatly benefit from teleheal\r\nth\r\n, \r\nincluding: \r\n<br>\r\n1.\r\nNo need to waste time travelling to the Doctor for something that \r\ncan be simply treated \r\nonline  \r\n<br>\r\n2.\r\nBeing filled with sick people, Medical Centres sometimes are why we catch the flu\r\n or a virus \r\n<br>\r\n3.\r\nIf you have kids, you know what a hassle it can be to arrange to take them \r\nto the Doctor \r\n<br>\r\n4.\r\nYou may have a private or embarrassing question or topic you want to disc\r\nuss with a Doctor \r\n<br>\r\n5.\r\nIf your Doctor or Medical Centre isn\r\n’\r\nt open after hours or on Sundays\r\n, \r\nyou can still be see \r\nand treated \r\n?\r\nOften, Doctors tell us to rest in bed, and that\r\n’\r\ns where you can now see the doctor from  ', '', '', '', 'Doctoroo  –  the telehealth platform with a difference ', 'Doctoroo was designed by a Medical Scientist, with vast contributions fro\r\nm many Pharmacists and \r\nDoctors. Our core mission is taking care of you \r\n–\r\n whether it be by booking a Doctor online, ordering \r\nyour medication, arranging medication delivery or any of the other features \r\nour users love about us.  \r\nAbout our name \r\nThe name \r\ndoctoroo\r\n originated with our core mission \r\n–\r\ntaking care of you, anytime, anywhere\r\n. \r\nBeing an extremely fast Australian-native animal with many species being no\r\ncturnal, it was a perfect \r\nfit for giving fast access to Australians to a doctor, anytime of the day\r\n. \r\nSince users find out about us via their friends, family or colleagues, somet\r\nimes our name Is misspelt \r\nas \r\ndoctor oo\r\n, \r\ndoctor roo\r\n, \r\ndroo\r\n and \r\ndr oo\r\n among many. \r\n<br>\r\nDon\r\n’\r\nt just take our word for it - Backed by science & researc\r\nh \r\nWe\r\n’\r\nre serious about healthcare and about the health of our users. That\r\n’\r\ns why we\r\n’\r\nve made sure \r\ndoctoroo actually helps you. Telehealth platforms have been studied, an\r\nd shown to be beneficial in \r\nvarious ways through widely-recognised scientific research and studies.  \r\n<br>\r\n1.\r\n    A 2005 study of a telehealth medical evaluation prog\r\nram at five childcare centers \r\nfound that the program reduced children\r\n’\r\ns\r\n’\r\n absences due to illness by 63% and \r\navoided provider office or emergency room visits in ne\r\narly 94% of cases. \r\n<br>\r\n2.\r\n    A study found that telemedicine resulted in the readm\r\nission rate being reduced from \r\n20% to 4% as well as a reduction in the length of sta\r\ny and overall costs. \r\n<br>\r\n3.\r\n    In the US, 74% of patients said they would use telehea\r\nlth services \r\n<br>\r\n4.\r\n    About 90% of surveyed healthcare executives report tha\r\nt their organizations have \r\nalready begun developing or implementing a telemedici\r\nne program \r\n<br> \r\n5.\r\n    A 2008 UC-San Francisco study compared skin cancer patien\r\nts who received store \r\nand forward tele-dermatology services with patients who\r\n received conventional \r\ndermatology referrals. The tele-dermatology patients, on\r\n average, completed their \r\ninitial consults in 4 days, versus 48 days for conventiona\r\nlly referred patients \r\n<br>\r\n6.\r\n    A study of post-traumatic stress disorder patients found t\r\nhat telemedicine patients \r\nhad fewer treatment program drop-outs, 6% versus 29%. ', '', 'yes', 'Don ’ t just take our word for it - Backed by science & researc h ', 'We\r\n’\r\nre serious about healthcare and about the health of our users. That\r\n’\r\ns why we\r\n’\r\nve made sure \r\ndoctoroo actually helps you. Telehealth platforms have been studied, an\r\nd shown to be beneficial in \r\nvarious ways through widely-recognised scientific research and studies.  ', 'you can sees a doctor', 'How much does seeing a doctor online cost? ', 'Although no one can put a price on a person ’ s health, it ’ s completely free to signup & use our app. You ’ ll only need to pay when you talk to a doctor online. As Australia ’ s most affordable way to see a doctor online, consultations start from just $28, with the average consultation being around 7-8 minutes, costing just $38.', 'DOCTOROO  –  Talk to a Doctor from just $28. Australia ’ s Telehealth Platform ', 'DOCTOROO  –  Talk to a Doctor from just $28. Australia ’ s Telehealth Platform ', 'DOCTOROO  –  Talk to a Doctor from just $28. Australia ’ s Telehealth Platform ', 'How do I get started?', 'Average calls lasts 6-8 minues and cost just $24 - $36. All other app features are free for you (no astericks!) ', '2017-11-22 11:20:32', '2017-11-22 16:50:34'),
(29, 'See a Doctor at home, without travelling anywhere', 'see-a-doctor-at-home-without-travelling-anywhere', '', 'Instead of a GP coming to you, see one online today ', 'Travel Doctor | Doctor to Your Door | Doctor to You – Droo', 'Doctor, Travel Doctor, Doctor to Your Door, Doctor to You ', 'See a Doctor at home, without travelling anywhere.  ', 'Travel doctor service is the fastest way to see an urgent care doctors when you travel. Doctor to your door is an after hours house visit doctor. Book Doctor to You', 'the traditional doctor to you service', 'One of the ways to see a doctor is to book over the phone and wait for t\r\nhe doctor to come to you. \r\nAlthough the benefit of this is that you\r\n’\r\nre ordering a doctor to your door and you don\r\n’\r\nt need to \r\ntravel to the doctor, the main issues with this include: \r\n<br>\r\n1.\r\nThe travel doctor may take hours to arrive to you,  \r\n<br>\r\n2.\r\nThere are some areas where the GP can\r\n’\r\nt travel to you \r\n<br>\r\n3.\r\nThese doctor to your door services are only available after hours due to\r\n government \r\nrestrictions, meaning you\r\n’\r\nll need to wait until the end of the day until you can get the \r\nGP to \r\nyou ', 'The new way to see a GP', 'Online. Anytime. Anywhere. And the best part? The doctor doesn\r\n’\r\nt travel to you, nor do you have to \r\ntravel to the doctor. You could consider our platform a GP helpli\r\nne but with many other features, \r\nincluding: \r\n<br>\r\n1.\r\nSpeak with a doctor on any device \r\n<br>\r\n2.\r\nDoctors available 24/7  \r\n<br>\r\n3.\r\nGet medical advice, diagnosis and treatment \r\n<br>\r\n4.\r\nGet prescriptions straight to your phone \r\n<br>\r\n5.\r\nGet repeat prescriptions for your medications \r\n<br>\r\n6.\r\nOrder any medication from any pharmacy across Australia \r\n<br>\r\n7.\r\nManage, get reminded and reorder your medications and repeats \r\n<br>\r\n8.\r\nHave your medications delivered to you \r\n<br>\r\n9.\r\nClick & collect medications from your nearest pharmacy \r\n<br>\r\n10.\r\nUse it as a GP helpline with our qualified GP\r\n’\r\ns ', '', '', '', 'Who can use doctoroo?', 'Doctoroo was built to make doctor''s easily accessible and afforda\r\nble for Australian''s who \r\ndon\r\n’\r\nt have the time to travel to a doctor, wait for hours and th\r\nen travel to the pharmacy, for \r\nsomething they could''ve easily done in a few minutes from t\r\nheir phones at home or the office.  \r\nDoctoroo also makes it easy for any Australians who: \r\n<br>\r\n1.\r\nLive in remote areas  \r\n<br>\r\n2.\r\nAre housebound  \r\n<br>\r\n3.\r\nHave difficulty travailing  \r\n<br>\r\n4.\r\nHave trouble lining up childcare  \r\n<br>\r\n5.\r\nJust don''t have the time to make it to a doctor or pharma\r\ncy  ', '', 'yes', 'About our doctors', 'Some of Australia\r\n’\r\ns best doctors have joined doctoroo from all over Australia, and provide \r\nonline \r\nconsultations to their patients and patients across the country. We know tha\r\nt your health is a \r\nprivate topic and so we all want a doctor who can listen, understand and \r\nshare their valuable advice \r\nwith us. That\r\n’\r\ns why we\r\n’\r\nve chosen doctors who are:\r\n', 'Testimonials \r\nI\r\n’\r\nve\r\n used doctoroo 2 times, once was with Dr. U. Smith. He was really helpful\r\n and I felt like he was \r\nmy family GP.', 'How much does it cost?', 'Although no one can put a price on a person\r\n’\r\ns health, it\r\n’\r\ns completely free to signup & use our app. \r\nYou\r\n’\r\nll only need to pay when you book a doctor.  \r\nAs Australia\r\n’\r\ns most affordable way to see a doctor online, consultations start from just\r\n $28, with the \r\naverage consultation being around 7-8 minutes, costing just $38.  \r\n', 'You may be asking yourself, how exactly can a doctor dia gnose and treat me online? ', 'When we set out to solve the above issues, we knew that we could never replace a trad\r\nitional, in-\r\nperson consultation with our Doctors, and we haven\r\n’\r\nt tried to. What we have done instead, is offer a \r\ncomplimentary service where you can use our platform for issues that don\r\n’\r\nt require physical \r\nexamination.  \r\n<br>\r\nConditions our Doctors can treat', 'See a Doctor at home, without travelling anywhere. ', 'How do I get started?', 'Average calls lasts 6-8 minues and cost just $24 - $36. All other app features are free for you (no astericks!) ', '2018-01-04 14:13:11', '2018-01-04 19:43:13'),
(30, 'Telemedicine', 'telemedicine', 'Telemedicine', 'Leading the way in Australian healthcare', 'Telehealth in Australia | Telemedicine and Telehealth – Doctoroo', 'Telemedicine, telehealth, telehealth australia, Doctoroo', 'Australian Telehealth & Telemedicine platform ', 'Get help for your loved ones with telemedicine, Telehealth. Register at Doctoroo and find a best telehealth, telemedicine services in Australia. Book doctor online.', 'What is Telemedicine? ', 'The Australian Government <a href="http://www.health.gov.au/internet/main/publishing.nsf/content/e-health-telehealth">Department of Health</a> defines Telemedicine as the: \r\n<p>\r\n"Use of telecommunication technologies to exchange health information and provide health care services across geographic, time, social and cultural barriers"\r\n<br />\r\n<center>~ The International Organisation for Standardisation</center>  \r\n<p>\r\nBasically, Telemedicine is allowing Doctors to see, diagnose and offer treatment to Patients via their phone, tablet, computer or any smart device connected to the internet.  ', 'Benefits of Telemedicine & Telehealth', 'With increasing number of Australians using telehealth every year \r\n<a href="http://www.mbsonline.gov.au/internet/mbsonline/publishing.nsf/Content/connectinghealthservices-factsheet-stats">MBS Online</a>, there are many situations and people that would greatly benefit from telehealth, including: \r\n<br>\r\n- No need to waste time travelling to the Doctor for something that can be simply treated online  \r\n<br>\r\n- Being filled with sick people, Medical Centres sometimes are why we catch the flu or a virus \r\n<br>\r\n- If you have kids, you know what a hassle it can be to arrange to take them to the Doctor \r\n<br>\r\n- You may have a private or embarrassing question or topic you want to discuss with a Doctor \r\n<br>\r\n- If your Doctor or Medical Centre isn’t open after hours or on Sundays, you can still be seen and treated.\r\n<br>\r\n- Many people looking for the top-notch quality healthcare services try to find us spelling our name incorrectly on the web - doctor roo, doctor oo, dr oo and droo. ', '', '', '', 'Doctoroo  –  the telehealth platform with a difference ', 'doctoroo was designed by a Medical Scientist, with vast contributions from many pharmacists and doctors. Our core mission is taking care of you – whether it be by booking a Doctor online, ordering your medication, arranging medication delivery or any of the other features our users love about us.  \r\n<p>\r\nAbout our name \r\nThe name doctoroo originated with our core mission –taking care of you, anytime, anywhere. Being an extremely fast Australian-native animal with many species being nocturnal, it was a perfect fit for giving fast access to Australians to a doctor, anytime of the day. Since users find out about us via their friends, family or colleagues, sometimes our name Is misspelt as doctor oo, \r\ndoctor roo, droo and dr oo among others. \r\n<p>\r\nDon’t just take our word for it - Backed by science & research\r\n<p>\r\nWe’re serious about healthcare and about the health of our users. That’s why we’ve made sure doctoroo actually helps you. Telehealth platforms have been studied, and shown to be beneficial in various ways through widely-recognised scientific research and studies.  \r\n<br/>\r\n1. A 2005 study of a telehealth medical evaluation program at five childcare centers found that the program reduced children’s’ absences due to illness by 63% and avoided provider office or emergency room visits in nearly 94% of cases. \r\n<br/>\r\n2. A study found that telemedicine resulted in the readmission rate being reduced from 20% to 4% as well as a reduction in the length of stay and overall costs. \r\n<br/>\r\n3.In the US, 74% of patients said they would use telehealth services \r\n<br/>\r\n4. About 90% of surveyed healthcare executives report that their organizations have already begun developing or implementing a telemedicine program \r\n<br/>\r\n5. A 2008 UC-San Francisco study compared skin cancer patients who received store and forward tele-dermatology services with patients who received conventional dermatology referrals. The tele-dermatology patients, on average, completed their initial consults in 4 days, versus 48 days for conventionally referred patients \r\n<br/>\r\n6. A study of post-traumatic stress disorder patients found that telemedicine patients had fewer treatment program drop-outs, 6% versus 29%. ', '', 'yes', 'What conditions and symptoms can be treated via telehealth?', 'The often forgotten fact is that most visits to the doctor involve verbal diagnosis only, sometimes additional, in-clinic, physical exams are required. The fact that many of these consultation happen verbally means that the no-touch barrier that telehealth has allows doctors to treat many of the conditions which don''t actually require physical diagnosis or further examinations. Some of these conditions include:', 'Any many others', 'How much does seeing a doctor online cost? ', 'Although no one can put a price on a person’s health, it’s completely free to signup & use our site and app. Only when you book and see a doctor will you be charged anything. As one of Australia''s most affordable way to see a doctor online, consultations start from just $28, with the average consultation being around 7-8 minutes, costing just $38.', 'How private & protected is doctoroo?', 'Unlike other questionable platforms that use Skype and other easily-hacked programs to see a doctor - doctoroo actually uses a world-class, end-to-end encrypted online consultations via our site or app. This encryption means that it''s practically impossible for any unauthorised person to listen in or see your consultation with your doctor, which is something that is much more likely to occur with other platforms such as Skype.\r\n<b/>\r\nWe also host our website and apps on Australian servers, in Australia only. This means that your data is protected by Australian Law.  \r\n<b/>\r\nOther ways we ensure your privacy & information safety:', 'Our aim isn''t just to better the health of every Australian, but to do so in a private, protected and completely transparent way. ', 'How do I get started?', 'We know you''ll love the convenience and simplicity of doctoroo. It takes just a few minutes to sign up and book a doctor. Welcome!', '2018-01-04 14:11:55', '2018-01-04 19:41:57');
